-- ----------------------------
-- Table structure for xn_m_bank_settle_record
-- ----------------------------
DROP TABLE IF EXISTS `xn_m_bank_settle_record`;
CREATE TABLE `xn_m_bank_settle_record` (
  `id` char(22) NOT NULL,
  `pay_order_id` varchar(64) DEFAULT NULL COMMENT 'pay_request的 pay_order_id 订单号',
  `serial_no` varchar(64) DEFAULT NULL COMMENT '银行系统流水号',
  `fund_acc` varchar(64) DEFAULT NULL COMMENT '资金账号',
  `secu_acc` varchar(64) DEFAULT NULL COMMENT '商户方账号',
  `from_flag` varchar(20) DEFAULT NULL COMMENT '单据类型',
  `busin_code` varchar(20) DEFAULT NULL COMMENT '业务代码',
  `prd_code` varchar(20) DEFAULT NULL COMMENT '产品代码',
  `curr_type` varchar(20) DEFAULT NULL COMMENT '币种',
  `amt` decimal(16,2) DEFAULT NULL COMMENT '金额',
  `bank_fee` decimal(16,2) DEFAULT NULL COMMENT '银行代理费',
  `targ_acc` varchar(64) DEFAULT NULL COMMENT '对方账号 充值/提现为对应卡号   投资/受让/还本付息等为对方资金账号   如果对方账号为商户账号，则为空',
  `chg_flag` varchar(22) DEFAULT NULL COMMENT '0-增加  1-减少  2-冻结  3-解冻 如果有本字段,业务代码可以不填',
  `settle_status` bigint(20) DEFAULT NULL COMMENT '对账状态 ',
  `settle_date` varchar(8) DEFAULT NULL COMMENT '对账日期 YYYYMMDD',
  `data_source` bigint(20) DEFAULT NULL COMMENT '数据来源',
  `secu_no` varchar(32) DEFAULT NULL COMMENT '商户号',
  `record_type` varchar(32) DEFAULT NULL COMMENT '跟对账文件类型一样',
  `document_code` varchar(32) DEFAULT NULL COMMENT '单据号',
  `document_id` char(22) DEFAULT NULL,
  `document_type` bigint(20) DEFAULT NULL,
  `creater` varchar(64) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `ver` bigint(20) DEFAULT NULL,
  `modifier` varchar(64) DEFAULT NULL,
  `modify_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `settle_record_order_id_index` (`pay_order_id`),
  KEY `settle_record_fund_acc_index` (`fund_acc`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of xn_m_bank_settle_record
-- ----------------------------

