  `pay_passwd` varchar(128) DEFAULT NULL COMMENT '支付密码',
  PRIMARY KEY (`id`),
  KEY `FK_xn_m_capital_account_xn_m_user` (`user_id`),
  KEY `FK_xn_m_capital_account_xn_m_company` (`company_id`),
  KEY `account_fund_acc_index` (`fund_acc`),
  CONSTRAINT `FK_xn_m_capital_account_xn_m_company` FOREIGN KEY (`company_id`) REFERENCES `xn_m_company` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_xn_m_capital_account_xn_m_user` FOREIGN KEY (`user_id`) REFERENCES `xn_m_user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
