-- Table structure for xn_m_dispatch
-- ----------------------------
DROP TABLE IF EXISTS `xn_m_dispatch`;
CREATE TABLE `xn_m_dispatch` (
  `id` char(22) NOT NULL,
  `parent_dispatch_id` char(22) DEFAULT NULL,
  `dispatch_code` varchar(64) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `logistics_order_id` char(22) DEFAULT NULL,
  `plan_departure_date` datetime DEFAULT NULL,
  `plan_arrival_date` datetime DEFAULT NULL,
  `real_departure_date` datetime DEFAULT NULL,
  `real_arrival_date` datetime DEFAULT NULL,
  `signed_time` datetime DEFAULT NULL,
  `signed_passwd` varchar(64) DEFAULT NULL,
  `signed_comment` varchar(64) DEFAULT NULL,
  `load_profile_photo_id` char(22) DEFAULT NULL,
  `load_tail_photo_id` char(22) DEFAULT NULL,
  `unload_profile_photo_id` char(22) DEFAULT NULL,
  `unload_tail_photo_id` char(22) DEFAULT NULL,
  `receipt_sign_photo_id` char(22) DEFAULT NULL,
  `receipt_group_photo_id` char(22) DEFAULT NULL,
  `consignee_id` char(22) DEFAULT NULL,
  `send_address_id` char(22) DEFAULT NULL,
  `receive_address_id` char(22) DEFAULT NULL,
  `dispatch_batch_id` char(22) DEFAULT NULL,
  `is_destination` bigint(20) DEFAULT NULL,
  `sender_id` char(22) DEFAULT NULL,
  `delivery_mode` bigint(20) DEFAULT NULL,
  `code` char(18) DEFAULT NULL,
  `creater` char(22) NOT NULL,
  `modifier` char(22) DEFAULT NULL,
  `modify_time` datetime DEFAULT NULL,
  `ver` bigint(20) DEFAULT NULL,
  `delivery_outlets_id` char(22) DEFAULT NULL,
  `arrival_outlets_id` char(22) DEFAULT NULL,
  `auth_code` varchar(50) DEFAULT NULL,
  `rht` bigint(20) DEFAULT NULL,
  `lft` bigint(20) DEFAULT NULL,
  `node_ver` bigint(20) DEFAULT NULL,
  `appkey` varchar(256) DEFAULT NULL,
  `is_registered` bigint(20) DEFAULT '0',
  `signed_user_name` varchar(64) DEFAULT NULL,
  `signed_id_card_no` char(18) DEFAULT NULL,
  `signed_mobile` varchar(32) DEFAULT NULL,
  `signed_agent` mediumint(9) DEFAULT NULL,
  `register_id` char(22) DEFAULT NULL,
  `register_time` datetime DEFAULT NULL,
  `is_warn` bigint(20) DEFAULT '0',
  `distance` decimal(20,0) DEFAULT '0',
  `is_more_photo` smallint(2) DEFAULT NULL COMMENT '是否有更多图片 1  是的  否则代表无',
  `dept_handover_mode` smallint(6) DEFAULT '0',
  `signed_handover_mode` smallint(6) DEFAULT '0',
  `dept_qrcode_id` char(22) DEFAULT NULL,
  `sign_qrcode_id` char(22) DEFAULT NULL,
  `dept_lon_lat` varchar(64) DEFAULT NULL COMMENT '出发时经纬度，逗号“,”分割',
  `signed_lon_lat` varchar(64) DEFAULT NULL COMMENT '签收时经纬度，逗号“,”分割',
  `dept_lon_lat_addr` bigint(20) DEFAULT NULL COMMENT '出发时三级城市code',
  `signed_lon_lat_addr` bigint(20) DEFAULT NULL COMMENT '签收时三级城市code',
  `cost_price` decimal(20,6) DEFAULT NULL,
  `arrival_forecast_notice` int(8) DEFAULT NULL,
  `busi_real_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `R_140` (`logistics_order_id`),
  KEY `R_156` (`load_profile_photo_id`),
  KEY `R_157` (`load_tail_photo_id`),
  KEY `R_158` (`unload_profile_photo_id`),
  KEY `R_159` (`unload_tail_photo_id`),
  KEY `R_160` (`receipt_sign_photo_id`),
  KEY `R_161` (`receipt_group_photo_id`),
  KEY `R_168` (`consignee_id`),
  KEY `R_174` (`send_address_id`),
  KEY `R_175` (`receive_address_id`),
  KEY `R_176` (`dispatch_batch_id`),
  KEY `R_177` (`parent_dispatch_id`),
  KEY `R_178` (`sender_id`),
  KEY `R_179` (`delivery_mode`),
  KEY `R_311` (`delivery_outlets_id`),
  KEY `R_312` (`arrival_outlets_id`),
  KEY `xn_m_dispatch_dispatch_code` (`dispatch_code`),
  CONSTRAINT `xn_m_dispatch_ibfk_1` FOREIGN KEY (`logistics_order_id`) REFERENCES `xn_m_logistics_order` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_dispatch_ibfk_10` FOREIGN KEY (`parent_dispatch_id`) REFERENCES `xn_m_dispatch` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_dispatch_ibfk_11` FOREIGN KEY (`sender_id`) REFERENCES `xn_m_contact` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_dispatch_ibfk_12` FOREIGN KEY (`delivery_mode`) REFERENCES `xn_m_dictionary` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_dispatch_ibfk_13` FOREIGN KEY (`delivery_outlets_id`) REFERENCES `xn_m_outlets` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_dispatch_ibfk_14` FOREIGN KEY (`arrival_outlets_id`) REFERENCES `xn_m_outlets` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_dispatch_ibfk_15` FOREIGN KEY (`load_profile_photo_id`) REFERENCES `xn_m_file` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_dispatch_ibfk_16` FOREIGN KEY (`load_tail_photo_id`) REFERENCES `xn_m_file` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_dispatch_ibfk_2` FOREIGN KEY (`unload_profile_photo_id`) REFERENCES `xn_m_file` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_dispatch_ibfk_3` FOREIGN KEY (`unload_tail_photo_id`) REFERENCES `xn_m_file` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_dispatch_ibfk_4` FOREIGN KEY (`receipt_sign_photo_id`) REFERENCES `xn_m_file` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_dispatch_ibfk_5` FOREIGN KEY (`receipt_group_photo_id`) REFERENCES `xn_m_file` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_dispatch_ibfk_6` FOREIGN KEY (`consignee_id`) REFERENCES `xn_m_contact` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_dispatch_ibfk_7` FOREIGN KEY (`send_address_id`) REFERENCES `xn_m_address` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_dispatch_ibfk_8` FOREIGN KEY (`receive_address_id`) REFERENCES `xn_m_address` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_dispatch_ibfk_9` FOREIGN KEY (`dispatch_batch_id`) REFERENCES `xn_m_dispatch_batch` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

