-- ----------------------------
-- Table structure for xn_m_driver
-- ----------------------------
DROP TABLE IF EXISTS `xn_m_driver`;
CREATE TABLE `xn_m_driver` (
  `id` char(22) NOT NULL,
  `name` varchar(64) DEFAULT NULL,
  `fixed_telephone` varchar(64) DEFAULT NULL,
  `certification_state` bigint(20) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `idcard_no` varchar(32) DEFAULT NULL,
  `ver` bigint(20) DEFAULT NULL,
  `creater` varchar(64) DEFAULT NULL,
  `modifier` varchar(64) DEFAULT NULL,
  `modify_time` datetime DEFAULT NULL,
  `driver_licence_phone_id` char(22) DEFAULT NULL,
  `driving_years` bigint(20) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `user_id` char(22) DEFAULT NULL,
  `appkey` varchar(256) DEFAULT NULL,
  `complain_count` bigint(20) DEFAULT NULL,
  `rating_count` bigint(20) DEFAULT NULL,
  `driver_licence_expiry_date` timestamp NULL DEFAULT NULL,
  `gender` char(1) NOT NULL DEFAULT '1' COMMENT '性别 1男 2女',
  `qualification_cerrificate_number` varchar(19) DEFAULT NULL COMMENT '从业资格信息证号',
  `driver_licence_first_get_date` datetime DEFAULT NULL COMMENT '首次驾照签发日期',
  `driver_license_type` varchar(16) DEFAULT NULL COMMENT '驾驶证类型',
  `driver_licence_start_date` datetime DEFAULT NULL COMMENT '驾驶证有效期开始日期',
  `supporting_dangerous_id` char(22) DEFAULT NULL COMMENT '司机危险货物运输从业资格证',
  `taxpayer_bank_card_id` char(22) DEFAULT NULL COMMENT '司机纳税人银行卡正面',
  PRIMARY KEY (`id`),
  KEY `R_367` (`user_id`),
  CONSTRAINT `xn_m_driver_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `xn_m_user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

