  `id` char(22) NOT NULL,
  `status` int(11) DEFAULT NULL,
  `export_type` varchar(50) DEFAULT NULL,
  `export_template_id` char(22) DEFAULT NULL,
  `export_where` varchar(2000) DEFAULT NULL,
  `export_count` int(11) DEFAULT NULL,
  `export_date` datetime DEFAULT NULL,
  `app_key` varchar(50) DEFAULT NULL,
  `file_name` varchar(50) DEFAULT NULL,
  `file_id` char(22) DEFAULT NULL,
  `file_url` varchar(100) DEFAULT NULL,
  `message` varchar(255) DEFAULT NULL,
  `creater` char(22) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `modify` char(22) DEFAULT NULL,
  `modify_time` datetime DEFAULT NULL,
  `ver` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of xn_m_export
-- ----------------------------

-- ----------------------------
-- Table structure for xn_m_export_template
-- ----------------------------
DROP TABLE IF EXISTS `xn_m_export_template`;
CREATE TABLE `xn_m_export_template` (
  `id` char(255) NOT NULL,
  `export_type` varchar(50) DEFAULT NULL,
  `export_column` varchar(255) DEFAULT NULL,
  `export_sql` varchar(12000) DEFAULT NULL,
  `export_name` varchar(50) DEFAULT NULL,
  `ver` int(11) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of xn_m_export_template
-- ----------------------------
INSERT INTO `xn_m_export_template` VALUES ('10', 'operateDriver', '服务评价,姓名,性别,手机号码,公司,运输队,人事关系,身份证号码,从业资格证,驾龄,驾驶证到期日,默认载具,备注,承运数,录入人员,注册时间', 'SELECT\r\n\r\nREPEAT\r\n	(\'☆\', c.service_star) \'服务评价\',\r\n	d. NAME \'姓名\',\r\n	CASE d.gender\r\nWHEN 1 THEN\r\n	\'男\'\r\nELSE\r\n	\'女\'\r\nEND \'性别\',\r\n concat(u.mobile, \'\\t\') \'手机号码\',\r\n c2.`name` \'公司\',\r\n tt.`name` \'运输队\',\r\n CASE cd.relation_type\r\nWHEN 1 THEN\r\n	\'外协司机\'\r\nWHEN 2 THEN\r\n	\'公司同事\'\r\nELSE\r\n	\'其他\'\r\nEND \'人事关系\',\r\n concat(d.idcard_no, \'\\t\') \'身份证号码\',\r\n d.qualification_cerrificate_number \'从业资格证\',\r\n CASE d.driving_years\r\nWHEN NULL THEN\r\n	\'\'\r\nELSE\r\n	CONCAT(d.driving_years, \'年\')\r\nEND \'驾龄\',\r\n d.driver_licence_expiry_date \'驾驶证到期日\',\r\n vv.default_code \'默认载具\',\r\n d.description \'备注\',\r\n ifnull(tmdb.execCount, 0) \'承运数\',\r\n u2.`name` \'录入人员\',\r\n CONCAT(d.create_time, \'\\t\') \'注册时间\'\r\nFROM\r\n	xn_m_driver d\r\nLEFT JOIN xn_m_user u ON d.user_id = u.id\r\nLEFT JOIN xn_m_user u2 ON d.creater = u2.id\r\nLEFT JOIN xn_r_company_driver cd ON cd.driver_id = d.id\r\nLEFT JOIN xn_m_company c ON c.id = u.company_id\r\nLEFT JOIN xn_m_company c2 ON c2.id = cd.company_id\r\nLEFT JOIN xn_m_transport_team_driver ttd ON ttd.driver_id = d.id\r\nLEFT JOIN xn_m_transport_team tt ON tt.id = ttd.transport_team_id\r\nLEFT JOIN (\r\n	SELECT\r\n		d.id,\r\n		group_concat(v.vehicle_code SEPARATOR \';\') default_code\r\n	FROM\r\n		xn_m_vehicles v\r\n	LEFT JOIN xn_r_company_vehicles cv ON v.id = cv.vehicles_id\r\n	JOIN xn_m_driver d ON cv.default_driver_id = d.id\r\n	GROUP BY\r\n		d.id\r\n) vv ON vv.id = d.id\r\nLEFT JOIN (\r\n	SELECT\r\n		count(1) AS execCount,\r\n		tdb.driver_id\r\n	FROM\r\n		xn_m_dispatch_batch tdb\r\n	GROUP BY\r\n		tdb.driver_id\r\n) tmdb ON tmdb.driver_id = d.id\r\nWHERE\r\n	u.mobile LIKE \'%#mobile#%\' \r\nAND c2.`name` LIKE \'%#companyName#%\'\r\nAND u. NAME LIKE \'%#name#%\'\r\nAND (\r\n	ifnull(tt.id, \'\') = \'#teamId#\'\r\n	OR \'#teamId#\' = \'\'\r\n)\r\nAND cd.relation_type >= CASE ifnull(\'#relationType#\', \'\')\r\nWHEN \'\' THEN\r\n	0\r\nELSE\r\n	\'#relationType#\'\r\nEND\r\nORDER BY\r\n	cd.create_time DESC;', '运营司机导出', '1', null);
INSERT INTO `xn_m_export_template` VALUES ('11', 'operateCompany', '公司名称,地址,管理员姓名,手机号码,公司类型,伙伴关系,认证状态,是否是签约客户,注册时间', 'SELECT\r\n	t. NAME AS \'公司名称\',\r\n	CONCAT(IFNULL(ad3.`name`,\'\'),IF (ad2.id = \'2015310100\',\'\',IFNULL(ad2.`name`,\'\')),IFNULL(ad.`name`,\'\'),\' \',IFNULL(a.street_name,\'\')) \'地址\',\r\n	u. NAME AS \'管理员姓名\',\r\n	CONCAT(u.mobile, \'\\t\') AS \'手机号码\',\r\n	CASE t.company_type\r\nWHEN \'2541010\' THEN\r\n	\'托运人\'\r\nWHEN \'2541020\' THEN\r\n	\'物流商\'\r\nWHEN \'2541030\' THEN\r\n	\'司机\'\r\nELSE\r\n	\'\'\r\nEND \'公司类型\',\r\nIF(t1.member_type IS NULL AND t2.member_type IS NULL AND t3.member_type IS NULL AND t4.supply_company_id IS NULL, \'——\',  CONCAT_WS(\r\n	\' | \',\r\nIF (t1.member_type IS NULL,NULL,\'托运人\'),\r\nIF (t2.member_type IS NULL,NULL,\'收发货单位\'),\r\nIF (t3.member_type IS NULL,NULL,\'承运人\'),\r\nIF (t4.supply_company_id IS NULL,NULL,\'供应商\')\r\n))\r\n \'伙伴关系\',\r\n CASE t.certification_state\r\nWHEN \'1\' THEN\r\n	\'已认证\'\r\nWHEN \'2\' THEN\r\n	\'认证中\'\r\nELSE\r\n	\'未认证\'\r\nEND \'认证状态\',\r\n CASE t.is_vip\r\nWHEN \'1\' THEN\r\n	\'是\'\r\nELSE\r\n	\'否\'\r\nEND \'是否是签约客户\',\r\n CONCAT(t.create_time, \'\\t\') AS \'注册时间\'\r\nFROM\r\n	xn_m_company t\r\nLEFT JOIN xn_m_user u ON t.company_admin = u.id\r\nLEFT JOIN xn_r_company_member t1 ON (\r\n	t1.company_id = \'#companyId#\'\r\n	AND t.id = t1.member_company_id\r\n	AND t1.member_type = 2505010\r\n)\r\nLEFT JOIN xn_r_company_member t2 ON (\r\n	t2.company_id = \'#companyId#\'\r\n	AND t.id = t2.member_company_id\r\n	AND t2.member_type = 2505020\r\n)\r\nLEFT JOIN xn_r_company_member t3 ON (\r\n	t3.company_id = \'#companyId#\'\r\n	AND t.id = t3.member_company_id\r\n	AND t3.member_type = 2505030\r\n)\r\nLEFT JOIN xn_m_company_supply t4 ON (\r\n	t4.company_id = \'#companyId#\'\r\n	AND t.id = t4.supply_company_id\r\n)\r\nLEFT JOIN xn_m_contact c ON t.contact_id = c.id\r\nLEFT JOIN xn_m_address a ON c.address_id = a.id\r\nLEFT JOIN xn_m_administration_division ad ON a.administrator_division_id = ad.id\r\nLEFT JOIN xn_m_administration_division ad2 ON ad.parent_administration_division_id = ad2.id\r\nLEFT JOIN xn_m_administration_division ad3 ON ad2.parent_administration_division_id = ad3.id\r\nWHERE\r\n	t.organization_type = \'2091010\'\r\nAND IFNULL(t.company_agent_id,\'\') LIKE \'%#companyAgentId#%\'\r\nAND t.id != \'#id#\'\r\nAND IFNULL(a.administrator_division_id,\'\') LIKE \'%#cityId#%\'\r\n#queryStr#\r\n#partnershipType#\r\nAND DATE_FORMAT(t.create_time,\'%Y-%m-%d\') >= \'#regisStartTime#\'\r\nAND DATE_FORMAT(t.create_time,\'%Y-%m-%d\') <= \'#regisEndTime#\'\r\nAND IFNULL(t.certification_state,0) LIKE \'%#certificationState#%\'\r\nAND t.is_vip LIKE \'%#isVip#%\'\r\nORDER BY\r\n	t.create_time DESC;', '运营公司导出', '1', null);
INSERT INTO `xn_m_export_template` VALUES ('12', 'dispatchOperate', '派车单,车船,荷载吨位,司机,调度状态,订单号,订单类型,调度单号,托运人,承运人,发货地,收货地,计划出发,计划到达,货物,配载量,装运量,签收量,结果,车辆装载率,调度员,调度时间', 'SELECT\r\n	xmdb.dispatch_batch_code \'派车单\',\r\n	xmv.vehicle_code \'车船\',\r\n	CONCAT(xmv.vehicle_tonnage, \'吨\') \'荷载吨位\',\r\n	CASE WHEN xmd2.NAME IS NULL THEN xmd1.NAME \r\n       WHEN xmd2.NAME IS NOT NULL THEN CONCAT(xmd1.NAME, \';\', xmd2.NAME)\r\n  END \'司机\',\r\n  CASE WHEN xmdsh.dispatch_status = \'1141000\' THEN \'待执行\'\r\n		   WHEN xmdsh.dispatch_status = \'1141010\' THEN \'已装运\'\r\n			 WHEN xmdsh.dispatch_status = \'1141020\' THEN \'已到达\'\r\n			 WHEN xmdsh.dispatch_status = \'1141030\' THEN \'已签收\'\r\n			 WHEN xmdsh.dispatch_status = \'1141040\' THEN \'已作废\'\r\n			 WHEN xmdsh.dispatch_status = \'1141050\' THEN \'已中止\'\r\n  END \'调度状态\',\r\n  xmlo. CODE \'订单号\',\r\n  CASE WHEN xmlo.order_type = \'1191000\' THEN \'委托\'\r\n       WHEN xmlo.order_type = \'1191010\' THEN \'承运\'\r\n  END \'订单类型\',\r\n  xmdp.dispatch_code \'调度单号\',\r\n  xmc1.NAME \'托运人\',\r\n  xmc2.NAME \'承运人\',\r\n  t1.senderAddress \'发货地\',\r\n  t2.consigneeAddress \'收货地\',\r\n  xmdi.plan_arrival_date \'计划出发\',\r\n  xmdi.plan_departure_date \'计划到达\',\r\n  xmg.NAME \'货物\',\r\n  CONCAT(0+CONVERT(t3.weight,CHAR),t3.weightUnit,\' \',t3.quantity,t3.quantityUnit) \'配载量\',\r\n  CONCAT(0+CONVERT(t4.weight,CHAR),t4.weightUnit,\' \',t4.quantity,t4.quantityUnit) \'装运量\',\r\n  CONCAT(0+CONVERT(t5.weight,CHAR),t5.weightUnit,\' \',t5.quantity,t5.quantityUnit) \'签收量\',\r\n  CASE WHEN xmdr.dispatch_result_desc_id = \'1123000\' THEN \'正常\'\r\n       WHEN xmdr.dispatch_result_desc_id = \'1123010\' THEN \'延误\'\r\n       WHEN xmdr.dispatch_result_desc_id = \'1123020\' THEN \'破损\'\r\n       WHEN xmdr.dispatch_result_desc_id = \'1123030\' THEN \'缺失\'\r\n       WHEN xmdr.dispatch_result_desc_id = \'1123040\' THEN \'拒收\'\r\n  END \'结果\',\r\n  CONCAT((0+CONVERT(ROUND((t3.weight/xmv.vehicle_tonnage)*100,2),CHAR)),\'%\') \'车辆装载率\',\r\n  xmu.NAME \'调度员\',\r\n  xmdb.busi_real_time \'调度时间\'\r\nFROM xn_m_dispatch_batch xmdb\r\nINNER JOIN xn_m_dispatch_info xmdi ON xmdb.id = xmdi.dispatch_batch_id\r\nINNER JOIN xn_m_vehicles xmv ON xmv.id = xmdb.vehicles_id\r\nINNER JOIN xn_m_driver xmd1 ON xmd1.id = xmdb.driver_id\r\nLEFT JOIN xn_m_driver xmd2 ON xmd2.id = xmdb.slave_driver_id\r\nLEFT JOIN xn_m_logistics_order xmlo ON xmlo.id = xmdi.logistics_order_id\r\nAND IFNULL(xmlo.is_delete, 0) = 0\r\nAND xmlo.carry_company_id IS NOT NULL\r\nAND xmlo.principal_company_id IS NOT NULL\r\nLEFT JOIN xn_m_dispatch xmdp ON xmdp.dispatch_batch_id = xmdb.id AND xmdp.logistics_order_id = xmlo.id\r\nAND xmdp.dispatch_code IS NOT NULL\r\nLEFT JOIN xn_m_dispatch_status_his xmdsh ON  xmdsh.dispatch_id = xmdp.id and xmdsh.is_valid = 1\r\nLEFT JOIN xn_m_dispatch_result xmdr ON xmdr.dispatch_id = xmdp.id\r\nLEFT JOIN xn_m_company xmc1 ON xmlo.principal_company_id = xmc1.id\r\nLEFT JOIN xn_m_company xmc2 ON xmlo.carry_company_id = xmc2.id\r\nLEFT JOIN xn_m_address xma1 ON xmdi.senderAddressID = xma1.id\r\nLEFT JOIN (SELECT \r\n  CASE WHEN IFNULL(xmad2.parent_administration_division_id,FALSE) THEN CONCAT(xmad3.NAME,xmad2.NAME, xmad1.NAME,xma.street_name)\r\n       WHEN IFNULL(xmad2.parent_administration_division_id,TRUE) THEN CONCAT(xmad2.NAME, xmad1.NAME,xma.street_name) \r\n	END senderAddress,xma.id senderAddressId\r\n	FROM xn_m_address xma\r\n	INNER JOIN xn_m_administration_division xmad1 ON xma.administrator_division_id = xmad1.id\r\n	INNER JOIN xn_m_administration_division xmad2 ON xmad1.parent_administration_division_id = xmad2.id\r\n  LEFT JOIN xn_m_administration_division xmad3 ON xmad2.parent_administration_division_id  = xmad3.id\r\n) t1 ON t1.senderAddressId = xmdi.senderAddressID\r\nLEFT JOIN (SELECT \r\n	CASE WHEN IFNULL(xmad2.parent_administration_division_id,FALSE) THEN CONCAT(xmad3.NAME,xmad2.NAME, xmad1.NAME,xma.street_name)\r\n       WHEN IFNULL(xmad2.parent_administration_division_id,TRUE) THEN CONCAT(xmad2.NAME, xmad1.NAME,xma.street_name)\r\n  END consigneeAddress,xma.id consigneeAddressId \r\n  FROM xn_m_address xma\r\n	INNER JOIN xn_m_administration_division xmad1 ON xma.administrator_division_id = xmad1.id\r\n	INNER JOIN xn_m_administration_division xmad2 ON xmad1.parent_administration_division_id = xmad2.id\r\n	LEFT JOIN xn_m_administration_division xmad3 ON xmad2.parent_administration_division_id  = xmad3.id\r\n) t2 ON t2.consigneeAddressId = xmdi.consigneeAddressID\r\nLEFT JOIN xn_r_dispatch_goods xrdg ON xrdg.dispatch_id = xmdp.id\r\nLEFT JOIN xn_m_goods xmg ON xrdg.goods_id = xmg.id\r\nLEFT JOIN (SELECT xmgm.weight weight,xmd1.NAME weightUnit,xmgm.quantity quantity,xmd2.NAME quantityUnit,xmgm.id planGoodsMeasureId\r\n	FROM xn_m_goods_measuring xmgm\r\n	LEFT JOIN xn_m_dictionary xmd1 ON xmd1.id = xmgm.weight_unit\r\n	LEFT JOIN xn_m_dictionary xmd2 ON xmd2.id = xmgm.quantity_unit\r\n) t3 ON t3.planGoodsMeasureId = xrdg.plan_dspt_goods_measure_id\r\nLEFT JOIN (\r\n	SELECT xmgm.weight weight,xmd1.NAME weightUnit,xmgm.quantity quantity,xmd2.NAME quantityUnit,xmgm.id planGoodsMeasureId\r\n	FROM xn_m_goods_measuring xmgm\r\n	LEFT JOIN xn_m_dictionary xmd1 ON xmd1.id = xmgm.weight_unit\r\n	LEFT JOIN xn_m_dictionary xmd2 ON xmd2.id = xmgm.quantity_unit\r\n) t4 ON t4.planGoodsMeasureId = xrdg.real_dspt_goods_measure_id\r\nLEFT JOIN (\r\n	SELECT xmgm.weight weight,xmd1.NAME weightUnit,xmgm.quantity quantity,xmd2.NAME quantityUnit,xmgm.id planGoodsMeasureId\r\n	FROM xn_m_goods_measuring xmgm\r\n	LEFT JOIN xn_m_dictionary xmd1 ON xmd1.id = xmgm.weight_unit\r\n	LEFT JOIN xn_m_dictionary xmd2 ON xmd2.id = xmgm.quantity_unit\r\n) t5 ON t5.planGoodsMeasureId = xrdg.signed_goods_measure_id\r\nLEFT JOIN xn_m_user xmu ON xmdb.dispatch_user_id = xmu.id\r\nWHERE \r\nxmlo.agent_id = (SELECT company_agent_id FROM xn_m_company WHERE id = \'#companyId#\')\r\nAND	xmdb.dispatch_batch_status IS NOT NULL\r\nAND xmlo.order_type IS NOT NULL\r\nAND (xmdb.dispatch_batch_code LIKE \'%#dispatchBatchCode#%\' OR xmdp.dispatch_code LIKE \'%#dispatchBatchCode#%\' OR xmlo. CODE LIKE \'%#dispatchBatchCode#%\')\r\nAND (xmc1.NAME LIKE \'%#shipper#%\' OR xmc2.NAME LIKE \'%#shipper#%\')\r\nAND t1.senderAddress LIKE \'%#senderAddress#%\'\r\nAND t2.consigneeAddress LIKE \'%#consigneeAddress#%\'\r\nAND (xmv.vehicle_code LIKE \'%#vehicleDriver#%\' OR (xmd1.NAME LIKE \'%#vehicleDriver#%\' OR xmd1.NAME IS NULL) OR (xmd2.NAME LIKE \'%#vehicleDriver#%\' OR xmd2.NAME IS NULL))\r\nAND CASE WHEN \'#startTime#\' = \'\' THEN TRUE\r\n         WHEN \'#startTime#\' != \'\' THEN xmdb.busi_real_time > \'#startTime#\'\r\n    END\r\nAND CASE WHEN \'#endTime#\' = \'\' THEN TRUE\r\n         WHEN \'#endTime#\' != \'\' THEN xmdb.busi_real_time < \'#endTime#\'\r\n    END\r\nAND CASE WHEN \'#dispatchStatus#\' = \'\' THEN TRUE\r\n         WHEN \'#dispatchStatus#\' != \'\' THEN xmdsh.dispatch_status = \'#dispatchStatus#\'\r\n    END\r\nAND CASE WHEN \'#orderType#\' = \'\' THEN TRUE\r\n         WHEN \'#orderType#\' != \'\' THEN xmlo.order_type = \'#orderType#\'\r\n    END\r\nAND CASE WHEN \'#result#\' = \'1123000\' THEN TRUE\r\n         WHEN IFNULL(xmdr.dispatch_result_desc_id,TRUE) THEN TRUE\r\n         WHEN \'#result#\' != \'1123000\' THEN xmdr.dispatch_result_desc_id = \'#result#\'\r\n		END\r\nORDER BY xmdb.busi_real_time DESC;', '运营调度导出', '1', null);
INSERT INTO `xn_m_export_template` VALUES ('13', 'dispatch', '派车单,派车单执行状态,车船,荷载吨位,司机,调度状态,订单号,订单类型,调度单号,发货地,收货地,计划出发,计划到达,货物,配载量,装运量,签收量,结果,车辆装载率,调度员,调度时间', '	SELECT xmdb.dispatch_batch_code \'派车单\',\r\n  CASE WHEN xmdb.dispatch_batch_status = \'1142000\' THEN \'待执行\'\r\n			 WHEN xmdb.dispatch_batch_status = \'1142010\' THEN \'执行中\'\r\n			 WHEN xmdb.dispatch_batch_status = \'1142020\' THEN \'已装运\'\r\n			 WHEN xmdb.dispatch_batch_status = \'1142040\' THEN \'已签收\'\r\n			 WHEN xmdb.dispatch_batch_status = \'1142050\' THEN \'已作废\'\r\n  END \'派车单执行状态\',\r\n	xmv.vehicle_code \'车船\',\r\n	CONCAT(xmv.vehicle_tonnage, \'吨\') \'荷载吨位\',\r\n	CASE WHEN xmd2.NAME IS NULL THEN xmd1.NAME \r\n       WHEN xmd2.NAME IS NOT NULL THEN CONCAT(xmd1.NAME, \';\', xmd2.NAME)\r\n  END \'司机\',\r\n  CASE WHEN xmdsh.dispatch_status = \'1141000\' THEN \'待执行\'\r\n		   WHEN xmdsh.dispatch_status = \'1141010\' THEN \'已装运\'\r\n			 WHEN xmdsh.dispatch_status = \'1141020\' THEN \'已到达\'\r\n			 WHEN xmdsh.dispatch_status = \'1141030\' THEN \'已签收\'\r\n			 WHEN xmdsh.dispatch_status = \'1141040\' THEN \'已作废\'\r\n			 WHEN xmdsh.dispatch_status = \'1141050\' THEN \'已中止\'\r\n  END \'调度状态\',\r\n  xmlo. CODE \'订单号\',\r\n  CASE WHEN \'#companyId#\' = xmlo.carry_company_id THEN \'承运\'\r\n       WHEN \'#companyId#\' = xmlo.principal_company_id THEN \'委托\'\r\n  END \'订单类型\',\r\n  xmdp.dispatch_code \'调度单号\',\r\n  t1.senderAddress \'发货地\',\r\n  t2.consigneeAddress \'收货地\',\r\n  xmdi.plan_arrival_date \'计划出发\',\r\n  xmdi.plan_departure_date \'计划到达\',\r\n  xmg.NAME \'货物\',\r\n  CONCAT(0+CONVERT(t3.weight,CHAR),t3.weightUnit,\' \',t3.quantity,t3.quantityUnit) \'配载量\',\r\n  CONCAT(0+CONVERT(t4.weight,CHAR),t4.weightUnit,\' \',t4.quantity,t4.quantityUnit) \'装运量\',\r\n  CONCAT(0+CONVERT(t5.weight,CHAR),t5.weightUnit,\' \',t5.quantity,t5.quantityUnit) \'签收量\',\r\n  REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(GROUP_CONCAT(xmdr.dispatch_result_desc_id),\'1123000\',\'正常\'),\'1123010\',\'延误\'),\'1123020\',\'破损\'),\'1123030\',\'缺失\'),\'1123040\',\'拒收\'),\',\',\';\') \'结果\',\r\n  CONCAT((0+CONVERT(ROUND((t3.weight/xmv.vehicle_tonnage)*100,2),CHAR)),\'%\') \'车辆装载率\',\r\n  xmu.NAME \'调度员\',\r\n  xmdb.busi_real_time \'调度时间\'\r\nFROM xn_m_dispatch_batch xmdb\r\nINNER JOIN xn_m_dispatch_info xmdi ON xmdb.id = xmdi.dispatch_batch_id\r\nINNER JOIN xn_m_vehicles xmv ON xmv.id = xmdb.vehicles_id\r\nINNER JOIN xn_m_driver xmd1 ON xmd1.id = xmdb.driver_id\r\nLEFT JOIN xn_m_driver xmd2 ON xmd2.id = xmdb.slave_driver_id\r\nLEFT JOIN xn_m_logistics_order xmlo ON xmlo.id = xmdi.logistics_order_id\r\nAND IFNULL(xmlo.is_delete, 0) = 0\r\nAND xmlo.carry_company_id IS NOT NULL\r\nAND xmlo.principal_company_id IS NOT NULL\r\nLEFT JOIN xn_m_dispatch xmdp ON xmdp.dispatch_batch_id = xmdb.id AND xmdp.logistics_order_id = xmlo.id\r\nAND xmdp.dispatch_code IS NOT NULL\r\nLEFT JOIN xn_m_dispatch_status_his xmdsh ON  xmdsh.dispatch_id = xmdp.id and xmdsh.is_valid = 1\r\nLEFT JOIN xn_m_dispatch_result xmdr ON xmdr.dispatch_id = xmdp.id\r\nLEFT JOIN xn_m_company xmc1 ON xmlo.principal_company_id = xmc1.id\r\nLEFT JOIN xn_m_company xmc2 ON xmlo.carry_company_id = xmc2.id\r\nLEFT JOIN xn_m_address xma1 ON xmdi.senderAddressID = xma1.id\r\nLEFT JOIN (SELECT \r\n  CASE WHEN IFNULL(xmad2.parent_administration_division_id,FALSE) THEN CONCAT(xmad3.NAME,xmad2.NAME, xmad1.NAME,xma.street_name)\r\n       WHEN IFNULL(xmad2.parent_administration_division_id,TRUE) THEN CONCAT(xmad2.NAME, xmad1.NAME,xma.street_name) \r\n	END senderAddress,xma.id senderAddressId\r\n	FROM xn_m_address xma\r\n	INNER JOIN xn_m_administration_division xmad1 ON xma.administrator_division_id = xmad1.id\r\n	INNER JOIN xn_m_administration_division xmad2 ON xmad1.parent_administration_division_id = xmad2.id\r\n  LEFT JOIN xn_m_administration_division xmad3 ON xmad2.parent_administration_division_id  = xmad3.id\r\n) t1 ON t1.senderAddressId = xmdi.senderAddressID\r\nLEFT JOIN (SELECT \r\n	CASE WHEN IFNULL(xmad2.parent_administration_division_id,FALSE) THEN CONCAT(xmad3.NAME,xmad2.NAME, xmad1.NAME,xma.street_name)\r\n       WHEN IFNULL(xmad2.parent_administration_division_id,TRUE) THEN CONCAT(xmad2.NAME, xmad1.NAME,xma.street_name)\r\n  END consigneeAddress,xma.id consigneeAddressId \r\n  FROM xn_m_address xma\r\n	INNER JOIN xn_m_administration_division xmad1 ON xma.administrator_division_id = xmad1.id\r\n	INNER JOIN xn_m_administration_division xmad2 ON xmad1.parent_administration_division_id = xmad2.id\r\n	LEFT JOIN xn_m_administration_division xmad3 ON xmad2.parent_administration_division_id  = xmad3.id\r\n) t2 ON t2.consigneeAddressId = xmdi.consigneeAddressID\r\nLEFT JOIN xn_r_dispatch_goods xrdg ON xrdg.dispatch_id = xmdp.id\r\nLEFT JOIN xn_m_goods xmg ON xrdg.goods_id = xmg.id\r\nLEFT JOIN (SELECT xmgm.weight weight,xmd1.NAME weightUnit,xmgm.quantity quantity,xmd2.NAME quantityUnit,xmgm.id planGoodsMeasureId\r\n	FROM xn_m_goods_measuring xmgm\r\n	LEFT JOIN xn_m_dictionary xmd1 ON xmd1.id = xmgm.weight_unit\r\n	LEFT JOIN xn_m_dictionary xmd2 ON xmd2.id = xmgm.quantity_unit\r\n) t3 ON t3.planGoodsMeasureId = xrdg.plan_dspt_goods_measure_id\r\nLEFT JOIN (\r\n	SELECT xmgm.weight weight,xmd1.NAME weightUnit,xmgm.quantity quantity,xmd2.NAME quantityUnit,xmgm.id planGoodsMeasureId\r\n	FROM xn_m_goods_measuring xmgm\r\n	LEFT JOIN xn_m_dictionary xmd1 ON xmd1.id = xmgm.weight_unit\r\n	LEFT JOIN xn_m_dictionary xmd2 ON xmd2.id = xmgm.quantity_unit\r\n) t4 ON t4.planGoodsMeasureId = xrdg.real_dspt_goods_measure_id\r\nLEFT JOIN (\r\n	SELECT xmgm.weight weight,xmd1.NAME weightUnit,xmgm.quantity quantity,xmd2.NAME quantityUnit,xmgm.id planGoodsMeasureId\r\n	FROM xn_m_goods_measuring xmgm\r\n	LEFT JOIN xn_m_dictionary xmd1 ON xmd1.id = xmgm.weight_unit\r\n	LEFT JOIN xn_m_dictionary xmd2 ON xmd2.id = xmgm.quantity_unit\r\n) t5 ON t5.planGoodsMeasureId = xrdg.signed_goods_measure_id\r\nLEFT JOIN xn_m_user xmu ON xmdb.dispatch_user_id = xmu.id\r\nWHERE \r\nxmlo.agent_id = (SELECT company_agent_id FROM xn_m_company WHERE id = \'#companyId#\')\r\nAND	xmdb.dispatch_batch_status IS NOT NULL\r\nAND xmlo.order_type IS NOT NULL\r\nAND (xmdb.dispatch_batch_code LIKE \'%#dispatchBatchCode#%\' OR xmdp.dispatch_code LIKE \'%#dispatchBatchCode#%\' OR xmlo. CODE LIKE \'%#dispatchBatchCode#%\')\r\nAND t1.senderAddress LIKE \'%#senderAddress#%\'\r\nAND t2.consigneeAddress LIKE \'%#consigneeAddress#%\'\r\nAND (xmv.vehicle_code LIKE \'%#vehicleDriver#%\' OR xmd1.NAME LIKE \'%#vehicleDriver#%\' OR xmd2.NAME LIKE \'%#vehicleDriver#%\')\r\nAND CASE WHEN \'#startTime#\' = \'\' THEN TRUE\r\n         WHEN \'#startTime#\' != \'\' THEN xmdb.busi_real_time > \'#startTime#\'\r\n    END\r\nAND CASE WHEN \'#endTime#\' = \'\' THEN TRUE\r\n         WHEN \'#endTime#\' != \'\' THEN xmdb.busi_real_time < \'#endTime#\'\r\n    END\r\nAND CASE WHEN \'#dispatchStatus#\' = \'\' THEN TRUE\r\n         WHEN \'#dispatchStatus#\' != \'\' THEN xmdsh.dispatch_status = \'#dispatchStatus#\'\r\n    END\r\nAND CASE WHEN \'#dispatchBatchStatus#\' = \'\' THEN TRUE\r\n         WHEN \'#dispatchBatchStatus#\' != \'\' THEN xmdb.dispatch_batch_status = \'#dispatchBatchStatus#\'\r\n    END\r\nAND CASE WHEN \'#result#\' = \'1123000\' THEN TRUE\r\n         WHEN IFNULL(xmdr.dispatch_result_desc_id,TRUE) THEN TRUE\r\n         WHEN \'#result#\' != \'1123000\' THEN xmdr.dispatch_result_desc_id = \'#result#\'\r\n		END\r\nAND (xmlo.carry_company_id = \'#companyId#\'\r\nOR xmlo.principal_company_id = \'#companyId#\'\r\nOR xmlo.sender_company_id = \'#companyId#\'\r\nOR xmlo.consignee_company_id = \'#companyId#\'\r\nOR xmdi.creater = \'#userId#\'\r\nOR xmlo.principal_user_id = \'#userId#\'\r\nOR xmdi.consigneeMobile = (select mobile from xn_m_user where id = \'#userId#\')\r\nOR xmdi.senderMobile = (select mobile from xn_m_user where id = \'#userId#\')\r\nOR xmd1.user_id = \'#userId#\'\r\nOR xmd2.user_id = \'#userId#\')\r\nAND CASE WHEN \'#orderType#\' = \'\' THEN TRUE\r\n         WHEN \'#orderType#\' = \'1191010\' THEN \'#companyId#\' = xmlo.carry_company_id\r\n         WHEN \'#orderType#\' = \'1191000\' THEN \'#companyId#\' = xmlo.principal_company_id\r\n    END\r\nGROUP BY xmdb.dispatch_batch_code\r\nORDER BY xmdb.busi_real_time DESC;', '调度配载导出', '1', null);
INSERT INTO `xn_m_export_template` VALUES ('14', 'receivePay', '公司名称,期初应收,期初应付,应收发生,已收,应付发生,已付,期末应收,期末应付', 'select CASE WHEN table3.otherCompanyId IS NULL THEN \'合计\'\r\n            ELSE table3.otherCompanyName END \'公司名称\',\r\n       beforeReceiveMoney \'期初应收\',\r\n			 beforePayMoney \'期初应付\',\r\n		   receivable \'应收发生\',\r\n			 receiveMoney \'已收\',\r\n       payable \'应付发生\',\r\n			 payMoney \'已付\',\r\n			 CASE WHEN afterRayMoney IS NOT NULL && afterReceiveMoney > afterRayMoney THEN afterReceiveMoney - afterRayMoney \r\n            WHEN afterRayMoney IS NULL THEN afterReceiveMoney END \'期末应收\',\r\n       CASE WHEN afterReceiveMoney IS NOT NULL && afterRayMoney > afterReceiveMoney THEN afterRayMoney - afterReceiveMoney\r\n            WHEN afterReceiveMoney IS NULL THEN afterRayMoney END \'期末应付\'\r\n       from (select table2.otherCompanyId,\r\n       table2.otherCompanyName otherCompanyName,\r\n       SUM(beforeReceiveMoney) beforeReceiveMoney,\r\n			 SUM(beforePayMoney) beforePayMoney,\r\n		   SUM(receivable) receivable,\r\n			 SUM(receiveMoney) receiveMoney,\r\n       SUM(payable) payable,\r\n			 SUM(payMoney) payMoney,\r\n			 SUM(afterReceiveMoney) afterReceiveMoney,\r\n			 SUM(afterRayMoney) afterRayMoney\r\n       from (select table1.otherCompanyId otherCompanyId,\r\n       table1.otherCompanyName otherCompanyName,\r\n       table1.beforeReceiveMoney beforeReceiveMoney,\r\n       table1.beforePayMoney beforePayMoney,\r\n       SUM(table1.receivable) receivable,\r\n       SUM(table1.receiveMoney) receiveMoney,\r\n		   SUM(table1.payable) payable,\r\n       SUM(table1.payMoney) payMoney,\r\n       CASE WHEN (IFNULL(beforeReceiveMoney,0) - IFNULL(beforePayMoney,0) + IFNULL(SUM(table1.receivable),0) - IFNULL(SUM(table1.receiveMoney),0) - IFNULL(SUM(table1.payable),0) + IFNULL(SUM(table1.payMoney),0)) > 0\r\n            THEN (IFNULL(beforeReceiveMoney,0) - IFNULL(beforePayMoney,0) + IFNULL(SUM(table1.receivable),0) - IFNULL(SUM(table1.receiveMoney),0) - IFNULL(SUM(table1.payable),0) + IFNULL(SUM(table1.payMoney),0))\r\n            ELSE NULL\r\n            END afterReceiveMoney,\r\n			 CASE WHEN (IFNULL(beforeReceiveMoney,0) - IFNULL(beforePayMoney,0) + IFNULL(SUM(table1.receivable),0) - IFNULL(SUM(table1.receiveMoney),0) - IFNULL(SUM(table1.payable),0) + IFNULL(SUM(table1.payMoney),0)) < 0\r\n            THEN -(IFNULL(beforeReceiveMoney,0) - IFNULL(beforePayMoney,0) + IFNULL(SUM(table1.receivable),0) - IFNULL(SUM(table1.receiveMoney),0) - IFNULL(SUM(table1.payable),0) + IFNULL(SUM(table1.payMoney),0))\r\n            ELSE NULL\r\n            END afterRayMoney,\r\n	   table1.account_direction\r\n from ((SELECT\r\n	t.other_company_id otherCompanyId,\r\n	t.otherCompanyName,\r\n	CASE t.account_direction WHEN 2410000 THEN sum(total_price) - IFNULL(sum(total_price2),0) END beforeReceiveMoney,\r\n  CASE t.account_direction WHEN 2410010 THEN sum(total_price) - IFNULL(sum(total_price2),0) END beforePayMoney,\r\n  NULL AS receivable,\r\n  NULL AS receiveMoney,\r\n  NULL AS payable,\r\n  NULL payMoney,\r\n  t.account_direction account_direction\r\nFROM\r\n	(\r\n		SELECT\r\n			rpd.*,\r\n			c. NAME otherCompanyName,\r\n			(\r\n				SELECT\r\n					sum(rv.total_price)\r\n				FROM\r\n					xn_m_record_voucher rv\r\n				WHERE\r\n					rv.rec_pay_detail_id = rpd.id\r\n				AND UNIX_TIMESTAMP(\r\n					date_format(rv.occur_date, \'%Y-%m-%d\')\r\n				) <= UNIX_TIMESTAMP(date_format(\'#endTime#\', \'%Y-%m-%d\'))\r\n			) total_price2\r\n		FROM\r\n			xn_m_receive_pay_detail rpd\r\n		JOIN xn_m_company c ON c.id = rpd.other_company_id\r\n		WHERE\r\n			rpd.is_delete != 1\r\n		AND rpd.company_id = \'#companyId#\'\r\n		AND UNIX_TIMESTAMP(\r\n			date_format(rpd.occur_date, \'%Y-%m-%d\')\r\n		) <= UNIX_TIMESTAMP(date_format(DATE_SUB(\'#startTime#\', INTERVAL 1 DAY), \'%Y-%m-%d\'))\r\n	) t\r\nGROUP BY\r\n	t.other_company_id,\r\n	t.account_direction\r\nORDER BY\r\n	t.other_company_id)\r\n\r\nUNION ALL\r\n\r\n(SELECT\r\n	t.other_company_id otherCompanyId,\r\n	t.otherCompanyName,\r\n  NULL AS beforeReceiveMoney,\r\n  NULL AS beforePayMoney,\r\n	CASE t.account_direction WHEN 2410000 THEN sum(total_price) END receivable,\r\n	CASE t.account_direction WHEN 2410000 THEN sum(total_price2) END receiveMoney,\r\n	CASE t.account_direction WHEN 2410010 THEN sum(total_price) END payable,\r\n	CASE t.account_direction WHEN 2410010 THEN sum(total_price2) END payMoney,\r\n	t.account_direction account_direction\r\nFROM\r\n	(\r\n		SELECT\r\n			rpd.*,\r\n			c. NAME otherCompanyName,\r\n			(\r\n				SELECT\r\n					sum(rv.total_price)\r\n				FROM\r\n					xn_m_record_voucher rv\r\n				WHERE\r\n					rv.rec_pay_detail_id = rpd.id\r\n        AND rpd.company_id = \'#companyId#\'\r\n				AND UNIX_TIMESTAMP(\r\n					date_format(rv.occur_date, \'%Y-%m-%d\')\r\n				) >= UNIX_TIMESTAMP(date_format(\'#startTime#\', \'%Y-%m-%d\'))\r\n				AND UNIX_TIMESTAMP(\r\n					date_format(rv.occur_date, \'%Y-%m-%d\')\r\n				) <= UNIX_TIMESTAMP(date_format(\'#endTime#\', \'%Y-%m-%d\'))\r\n			) total_price2\r\n		FROM\r\n			xn_m_receive_pay_detail rpd\r\n		JOIN xn_m_company c ON c.id = rpd.other_company_id\r\n		WHERE\r\n			rpd.is_delete != 1\r\n		AND rpd.company_id = \'#companyId#\'\r\n		AND UNIX_TIMESTAMP(\r\n			date_format(rpd.occur_date, \'%Y-%m-%d\')\r\n		) >= UNIX_TIMESTAMP(date_format(\'#startTime#\', \'%Y-%m-%d\'))\r\n		AND UNIX_TIMESTAMP(\r\n			date_format(rpd.occur_date, \'%Y-%m-%d\')\r\n		) <= UNIX_TIMESTAMP(date_format(\'#endTime#\', \'%Y-%m-%d\'))\r\n	) t\r\nGROUP BY\r\n	t.other_company_id,\r\n	t.account_direction\r\nORDER BY\r\n	t.other_company_id)) table1\r\ngroup by table1.otherCompanyId,\r\ntable1.account_direction) table2\r\nGROUP BY table2.otherCompanyId\r\nWITH ROLLUP) table3\r\nWHERE INSTR(table3.otherCompanyName,\'#otherCompanyName#\');', '应收应付汇总导出', null, null);
INSERT INTO `xn_m_export_template` VALUES ('15', 'receivePayDetail', '审核状态,发票,核销状态,结算单,记账方向,费用类型,单据类型,单据号,单据状态,经办人,对方单位,对方银行,对方银行账号,对方经办人,合计(元),已核销(元),应收(元),应付(元),审核人,审核意见,审核时间', 'SELECT\r\n	 xmd1.name \'审核状态\',\r\n   IFNULL(xmii.invoice_code,\'——\') \'发票\',\r\n   xmd2.name \'核销状态\',\r\n   CONCAT(xmrpd.settle_code, \'\\t\') \'结算单\',\r\n   CASE xmrpd.account_direction\r\n      WHEN 2410010 THEN \'应付\'\r\n			WHEN 2410000 THEN \'应收\'\r\n      END \'记账方向\',\r\n   xmd4.name \'费用类型\',\r\n   xmd5.name \'单据类型\',\r\n   CASE xmrpd.document_type\r\n			WHEN 1133000 THEN CONCAT(xmlo.CODE, \'\\t\')\r\n			WHEN 1133030 THEN CONCAT(xmdb.dispatch_batch_code, \'\\t\')\r\n			WHEN 1133060 THEN CONCAT(xmrv1.voucher_code, \'\\t\')\r\n			WHEN 1133120 THEN CONCAT(xmpp.code, \'\\t\')\r\n			END \'单据号\',\r\n	IFNULL(\r\n		CASE xmrpd.document_type\r\n			WHEN 1133000 THEN xmd6.name\r\n			WHEN 1133030 THEN xmd7.name\r\n			END,\'\'\r\n	) \'单据状态\',\r\n	xmu.name \'经办人\',\r\n  xmc.name \'对方单位\',\r\n	CASE xmdb.settlement_type\r\n		WHEN 2741020 THEN\r\n			xrcv.owner_opening_bank\r\n		WHEN 2741010 THEN\r\n			xrcd.opening_bank\r\n		ELSE\r\n			xmc.opening_bank\r\n		END \'对方银行\',\r\n	CASE xmdb.settlement_type\r\n		WHEN 2741020 THEN\r\n			CONCAT(xrcv.owner_bank_card_code, \'\\t\')\r\n		WHEN 2741010 THEN\r\n			CONCAT(xrcd.bank_card_code, \'\\t\')\r\n		ELSE\r\n			CONCAT(xmc.bank_account, \'\\t\')\r\n		END \'对方银行账号\',\r\n	xmu2.name \'对方经办人\',\r\n  xmrpd.total_price \'合计(元)\',\r\n	SUM(xmrv2.total_price) \'已核销(元)\',\r\n	CASE xmrpd.account_direction\r\n		WHEN 2410010 THEN \'\'\r\n		WHEN 2410000 THEN (xmrpd.total_price - IFNULL(SUM(xmrv2.total_price),0))\r\n		END \'应收(元)\',\r\n	CASE xmrpd.account_direction\r\n		WHEN 2410010 THEN (xmrpd.total_price - IFNULL(SUM(xmrv2.total_price),0))\r\n		WHEN 2410000 THEN \'\'\r\n		END \'应付(元)\',\r\n	xmu3.name \'审核人\',\r\n  xmrpd.audit_remark \'审核意见\',\r\n  CONCAT(xmrpd.audit_time, \'\\t\') \'审核时间\'\r\nFROM\r\n	xn_m_receive_pay_detail xmrpd\r\nLEFT JOIN (select GROUP_CONCAT(name) distribute,document_id from ( select dad.org_id, org.`name`,document_id from xn_r_data_author_detail dad left join xn_m_organization org on dad.org_id = org.id where  dad.document_type=1133080 ) t GROUP BY t.document_id ) dis\r\non dis.document_id = xmrpd.id\r\nLEFT JOIN xn_m_dictionary xmd1 ON xmd1.id = xmrpd.audit_status\r\nLEFT JOIN xn_r_receive_pay_detail_invoice_info xrpdi ON xrpdi.receive_pay_detail_id = xmrpd.id\r\nLEFT JOIN xn_m_invoice_info xmii ON xmii.id = xrpdi.invoice_info_id\r\nLEFT JOIN xn_m_dictionary xmd2 ON xmd2.id = xmrpd.verification_status\r\nLEFT JOIN xn_m_dictionary xmd4 ON xmd4.id = xmrpd.rec_pay_fee_type\r\nLEFT JOIN xn_m_dictionary xmd5 ON xmd5.id = xmrpd.document_type\r\nLEFT JOIN xn_m_logistics_order xmlo ON xmlo.id = xmrpd.document_id AND xmrpd.document_type = 1133000\r\nLEFT JOIN xn_m_dispatch_batch xmdb ON xmdb.id = xmrpd.document_id AND xmrpd.document_type = 1133030\r\nLEFT JOIN xn_m_record_voucher xmrv1 ON xmrv1.id = xmrpd.document_id AND xmrpd.document_type = 1133060\r\nLEFT JOIN xn_m_part_purchase xmpp ON xmpp.id = xmrpd.document_id AND xmrpd.document_type = 1133120\r\nLEFT JOIN xn_m_logistics_order_status_his xmlosh ON xmlosh.logistics_order_id = xmrpd.document_id AND xmrpd.document_type = 1133000 AND xmlosh.status_type = 1\r\nLEFT JOIN xn_m_dictionary xmd6 ON xmd6.id = xmlosh.logistics_order_status\r\nLEFT JOIN xn_m_dictionary xmd7 ON xmd7.id = xmdb.dispatch_batch_status\r\nLEFT JOIN xn_m_user xmu ON xmu.id  = xmrpd.sales_user_id\r\nLEFT JOIN xn_m_company xmc ON xmc.id = xmrpd.other_company_id\r\nLEFT JOIN xn_m_vehicles xmv ON xmv.id = xmdb.vehicles_id\r\nLEFT JOIN xn_r_company_vehicles xrcv ON xrcv.vehicles_id = xmv.id AND xrcv.company_id = \'#companyId#\'\r\nLEFT JOIN xn_m_driver xmd ON xmd.id = xmdb.driver_id\r\nLEFT JOIN xn_r_company_driver xrcd ON xrcd.driver_id = xmd.id AND xrcd.company_id = \'#companyId#\'\r\nLEFT JOIN xn_m_user xmu2 ON xmu2.id = xmrpd.other_sales_user_id\r\nLEFT JOIN xn_m_user xmu3 ON xmu3.id = xmrpd.audit_user_id\r\nLEFT JOIN xn_m_record_voucher xmrv2 ON xmrv2.rec_pay_detail_id = xmrpd.id AND xmrv2.voucher_source = \'2412010\'\r\nWHERE xmrpd.is_delete != 1 AND xmrpd.company_id = \'#companyId#\'\r\nAND CASE xmrpd.document_type\r\n			WHEN 1133000 THEN xmlosh.logistics_order_status != \'1121050\' and xmlosh.logistics_order_status != \'1121070\'\r\n			WHEN 1133030 THEN xmdb.dispatch_batch_status != \'1142050\'\r\n			END\r\nAND CASE WHEN \'#startTime#\' = \'\' THEN TRUE\r\n         WHEN \'#startTime#\' != \'\' THEN UNIX_TIMESTAMP(date_format(xmrpd.occur_date, \'%Y-%m-%d\')) >= UNIX_TIMESTAMP(date_format(\'#startTime#\', \'%Y-%m-%d\'))\r\n    END\r\nAND CASE WHEN \'#endTime#\' = \'\' THEN TRUE\r\n         WHEN \'#endTime#\' != \'\' THEN UNIX_TIMESTAMP(date_format(xmrpd.occur_date, \'%Y-%m-%d\')) <= UNIX_TIMESTAMP(date_format(\'#endTime#\', \'%Y-%m-%d\'))\r\n    END\r\nAND (CASE xmrpd.document_type\r\n			WHEN 1133000 THEN xmlo.CODE LIKE \'%#documentCode#%\'\r\n			WHEN 1133030 THEN xmdb.dispatch_batch_code LIKE \'%#documentCode#%\'\r\n			WHEN 1133060 THEN xmrv1.voucher_code LIKE \'%#documentCode#%\'\r\n			WHEN 1133120 THEN xmpp.code LIKE \'%#documentCode#%\'\r\n			END\r\n	or (  exists(select 1 from xn_m_dispatch dp inner join xn_m_logistics_order  lo on dp.logistics_order_id =lo.id  and lo.`code` = \'#documentCode#\'\r\n					where dp.dispatch_batch_id = xmdb.id)\r\n		)\r\n)		\r\nAND xmc.name LIKE \'%#otherCompanyName#%\'\r\nAND CASE WHEN \'#accountDirection#\' = \'\' THEN TRUE\r\n         WHEN \'#accountDirection#\' != \'\' THEN xmrpd.account_direction = \'#accountDirection#\'\r\n    END\r\nAND CASE WHEN \'#documentType#\' = \'\' THEN TRUE\r\n         WHEN \'#documentType#\' != \'\' THEN xmdb.dispatch_batch_status = \'#documentType#\'\r\n    END\r\nAND CASE WHEN \'#auditStatus#\' = \'\' THEN TRUE\r\n         WHEN \'#auditStatus#\' != \'\' THEN xmrpd.audit_status = \'#auditStatus#\'\r\n    END\r\nAND CASE WHEN \'#verificationStatus#\' = \'\' THEN TRUE\r\n         WHEN \'#verificationStatus#\' != \'\' THEN xmrpd.verification_status = \'#verificationStatus#\'\r\n    END\r\nAND (\r\n	CASE WHEN \'#isUserAuthOrgId#\' = \'yes\' THEN \r\n		xmrpd.id in  (\r\n			select dad.document_id from xn_r_data_author_detail dad\r\n			where dad.document_type = 1133080 and\r\n			dad.org_id in #arrUserAuthOrgId#\r\n			)\r\n	END\r\n	or	(\r\n		CASE WHEN \'#isRootCompanyOrgId#\' = \'yes\' THEN \r\n			xmrpd.id not in (\r\n				select dad.document_id from xn_r_data_author_detail dad\r\n				where dad.document_type = 1133080 and\r\n				dad.org_id in  #arrRootCompanyOrgId# \r\n				) \r\n		END \r\n		and\r\n			(\r\n				1=1\r\n			)\r\n		)\r\n) \r\nGROUP BY xmrpd.settle_code\r\norder by xmrpd.occur_date DESC,xmrpd.id;', '应收应付明细导出', null, '2019-05-18 23:45:34');
INSERT INTO `xn_m_export_template` VALUES ('16', 'sendAddress', '发货地,收货地,订单数,重量(吨),体积(立方米),数量(单位),车次,合同金额(元),结算金额(元),合同占比', 'SELECT \r\n	CASE \'#groupByCityId#\' \r\n	WHEN \'3\' THEN \'——\' \r\n	ELSE table1.sendAddress\r\n	END \'发货地\', \r\n	CASE \'#groupByCityId#\'\r\n	WHEN \'2\' THEN \'——\'\r\n	ELSE table1.reciveAddress \r\n	END \'收货地\',\r\n  table1.orderNum \'订单数\',\r\n	table1.weight \'重量(吨)\',\r\n	table1.volume \'体积(立方米)\',\r\n	table1.quatity \'数量(单位)\',\r\n	table1.tripSerial \'车次\',\r\n	table1.contractNum \'合同金额(元)\',\r\n	table1.settleNum \'结算金额(元)\',\r\n  CONCAT(ROUND((table1.contractNum/table3.contractPriceSum)*100,2),\'%\') \'合同占比\'\r\nFROM (SELECT\r\n  t1.sendAddress sendAddress,\r\n  t2.reciveAddress reciveAddress,\r\n  COUNT(xmlo.id) orderNum,\r\n  ROUND(SUM(xrlog.totalWeight),2) weight,\r\n  ROUND(SUM(xrlog.totalVolume),2) volume,\r\n  SUM(xrlog.totalQuatity) quatity,\r\n  getTripSerial(GROUP_CONCAT(xmlo.id)) tripSerial,\r\n  ROUND(SUM(xmcc.total_price),2) contractNum,\r\n	ROUND(SUM(xmsc.total_price),2) settleNum\r\nFROM\r\n	xn_m_logistics_order xmlo\r\nLEFT JOIN xn_m_logistics_order xmlop ON xmlo.parent_logistics_order_id = xmlop.id\r\nINNER JOIN xn_m_logistics_order_status_his xmlos ON xmlo.id = xmlos.logistics_order_id\r\nAND xmlos.status_type = 1\r\nLEFT JOIN (SELECT\r\n  CASE WHEN IFNULL(xmad1.parent_administration_division_id,TRUE) = TRUE THEN CONCAT(xmad1.NAME)\r\n       WHEN IFNULL(xmad2.parent_administration_division_id,TRUE) != TRUE THEN CONCAT(xmad3.NAME,xmad2.NAME, xmad1.NAME)\r\n       WHEN IFNULL(xmad2.parent_administration_division_id,TRUE) = TRUE THEN CONCAT(xmad2.NAME, xmad1.NAME) \r\n	END sendAddress,xma.id sendAddressId,xma.administrator_division_id adminDivisionId\r\n	FROM xn_m_address xma\r\n	LEFT JOIN xn_m_administration_division xmad1 ON xma.administrator_division_id = xmad1.id\r\n	LEFT JOIN xn_m_administration_division xmad2 ON xmad1.parent_administration_division_id = xmad2.id\r\n  LEFT JOIN xn_m_administration_division xmad3 ON xmad2.parent_administration_division_id  = xmad3.id\r\n) t1 ON t1.sendAddressId = xmlo.send_address_id\r\nLEFT JOIN (SELECT\r\n CASE WHEN IFNULL(xmad1.parent_administration_division_id,TRUE) = TRUE THEN CONCAT(xmad1.NAME)\r\n       WHEN IFNULL(xmad2.parent_administration_division_id,TRUE) != TRUE THEN CONCAT(xmad3.NAME,xmad2.NAME, xmad1.NAME)\r\n       WHEN IFNULL(xmad2.parent_administration_division_id,TRUE) = TRUE THEN CONCAT(xmad2.NAME, xmad1.NAME) \r\n	END reciveAddress,xma.id reciveAddressId,xma.administrator_division_id adminDivisionId\r\n	FROM xn_m_address xma\r\n	LEFT JOIN xn_m_administration_division xmad1 ON xma.administrator_division_id = xmad1.id\r\n	LEFT JOIN xn_m_administration_division xmad2 ON xmad1.parent_administration_division_id = xmad2.id\r\n  LEFT JOIN xn_m_administration_division xmad3 ON xmad2.parent_administration_division_id  = xmad3.id\r\n) t2 ON t2.reciveAddressId = xmlo.receive_address_id\r\nLEFT JOIN (\r\n	SELECT\r\n		xrlog1.logistics_order_id orderId,\r\n		SUM(xmgm.quantity) totalQuatity,\r\n		xmgm.quantity_unit quantityUnit,\r\n		SUM(xmgm.volume) totalVolume,\r\n		xmgm.volume_unit volumeUnit,\r\n		SUM(xmgm.weight) totalWeight,\r\n		xmgm.weight_unit weightUnit\r\n	FROM\r\n		xn_r_logistics_order_goods xrlog1\r\n	LEFT JOIN xn_m_goods_measuring xmgm ON xmgm.id = xrlog1.commissioned_goods_measuring_id\r\n	GROUP BY\r\n		xrlog1.logistics_order_id\r\n) xrlog ON xrlog.orderId = xmlo.id\r\nLEFT JOIN xn_m_transport_charge xmcc ON xmcc.id = xmlo.contract_price_id\r\nLEFT JOIN xn_m_transport_charge xmsc ON xmsc.id = xmlo.settle_price_id\r\nWHERE\r\n	IFNULL(xmlo.is_delete, 0) = 0\r\nAND xmlos.logistics_order_status != \'1121050\'\r\nAND (\r\n	(xmlo.carry_company_id = \'#companyId#\')\r\n	OR (xmlo.principal_company_id =\'#companyId#\')\r\n)\r\nAND (\r\n	xmlop.carry_company_id !=\'#companyId#\'\r\n	OR xmlop.carry_company_id IS NULL\r\n)\r\nAND (\r\n	xmlop.principal_company_id !=\'#companyId#\'\r\n	OR xmlop.principal_company_id IS NULL\r\n)\r\nAND CASE WHEN \'#beginTime#\' = \'\' THEN TRUE\r\n         WHEN \'#beginTime#\' != \'\' THEN UNIX_TIMESTAMP(date_format(xmlo.create_time, \'%Y-%m-%d %H:%i:%s\'))>= UNIX_TIMESTAMP(date_format(\'#beginTime#\', \'%Y-%m-%d %H:%i:%s\'))\r\n    END\r\nAND CASE WHEN \'#endTime#\' = \'\' THEN TRUE\r\n         WHEN \'#endTime#\' != \'\' THEN UNIX_TIMESTAMP(date_format(xmlo.create_time, \'%Y-%m-%d %H:%i:%s\'))<= UNIX_TIMESTAMP(date_format(\'#endTime#\', \'%Y-%m-%d %H:%i:%s\'))\r\n    END\r\nAND CASE WHEN \'#sendCityCode#\' = \'\' THEN TRUE\r\n         WHEN \'#sendCityCode#\' != \'\' THEN t1.adminDivisionId = \'#sendCityCode#\'\r\n    END\r\nAND CASE WHEN \'#receiveCityCode#\' = \'\' THEN TRUE\r\n         WHEN \'#receiveCityCode#\' != \'\' THEN t2.adminDivisionId = \'#receiveCityCode#\'\r\n    END\r\nGROUP BY #groupByCityIdStr1#\r\n) table1\r\nJOIN (\r\nSELECT SUM(table2.contractPriceSum) contractPriceSum FROM\r\n(SELECT\r\n	SUM(cc.total_price) contractPriceSum\r\nFROM\r\n	xn_m_logistics_order o\r\nLEFT JOIN xn_m_logistics_order op ON o.parent_logistics_order_id = op.id\r\nINNER JOIN xn_m_logistics_order_status_his los ON o.id = los.logistics_order_id\r\nAND los.status_type = 1\r\nINNER JOIN xn_m_company pcy ON o.principal_company_id = pcy.id\r\nINNER JOIN xn_m_company ccy ON o.carry_company_id = ccy.id\r\nLEFT JOIN xn_m_address sa ON sa.id = o.send_address_id\r\nLEFT JOIN xn_m_address ra ON ra.id = o.receive_address_id\r\nLEFT JOIN (\r\n	SELECT\r\n		og.logistics_order_id orderId,\r\n		SUM(gm.quantity) totalQuatity,\r\n		gm.quantity_unit quantityUnit,\r\n		SUM(gm.volume) totalVolume,\r\n		gm.volume_unit volumeUnit,\r\n		SUM(gm.weight) totalWeight,\r\n		gm.weight_unit weightUnit\r\n	FROM\r\n		xn_r_logistics_order_goods og\r\n	LEFT JOIN xn_m_goods_measuring gm ON gm.id = og.commissioned_goods_measuring_id\r\n	GROUP BY\r\n		og.logistics_order_id\r\n) og ON og.orderId = o.id\r\nLEFT JOIN xn_m_transport_charge cc ON cc.id = o.contract_price_id\r\nLEFT JOIN xn_m_transport_charge sc ON sc.id = o.settle_price_id\r\nWHERE\r\n	IFNULL(o.is_delete, 0) = 0\r\nAND los.logistics_order_status != \'1121050\'\r\nAND (\r\n	(o.carry_company_id = \'#companyId#\')\r\n	OR (o.principal_company_id =\'#companyId#\')\r\n)\r\nAND (\r\n	op.carry_company_id !=\'#companyId#\'\r\n	OR op.carry_company_id IS NULL\r\n)\r\nAND (\r\n	op.principal_company_id !=\'#companyId#\'\r\n	OR op.principal_company_id IS NULL\r\n)\r\nAND CASE WHEN \'#beginTime#\' = \'\' THEN TRUE\r\n         WHEN \'#beginTime#\' != \'\' THEN UNIX_TIMESTAMP(date_format(o.create_time, \'%Y-%m-%d %H:%i:%s\'))>= UNIX_TIMESTAMP(date_format(\'#beginTime#\', \'%Y-%m-%d %H:%i:%s\'))\r\n    END\r\nAND CASE WHEN \'#endTime#\' = \'\' THEN TRUE\r\n         WHEN \'#endTime#\' != \'\' THEN UNIX_TIMESTAMP(date_format(o.create_time, \'%Y-%m-%d %H:%i:%s\'))<= UNIX_TIMESTAMP(date_format(\'#endTime#\', \'%Y-%m-%d %H:%i:%s\'))\r\n    END\r\nAND CASE WHEN \'#sendCityCode#\' = \'\' THEN TRUE\r\n         WHEN \'#sendCityCode#\' != \'\' THEN sa.administrator_division_id = \'#sendCityCode#\'\r\n    END\r\nAND CASE WHEN \'#receiveCityCode#\' = \'\' THEN TRUE\r\n         WHEN \'#receiveCityCode#\' != \'\' THEN ra.administrator_division_id = \'#receiveCityCode#\'\r\n    END\r\nGROUP BY\r\n	#groupByCityIdStr2#\r\n) table2) table3;\r\n', '订单流向统计导出', '1', null);
INSERT INTO `xn_m_export_template` VALUES ('17', 'carryCompany', '服务商,订单数,重量(吨),体积(立方米),数量(件),车次,合同金额(元),合同额占比,结算金额(元),结算额占比', 'SELECT \r\n  table1.serviceCompanyName \'服务商\',\r\n	table1.orderCount \'订单数\',\r\n  table1.weightCount \'重量(吨)\',\r\n	table1.volumeCount \'体积(立方米)\',\r\n	table1.quantityCount \'数量(件)\',\r\n  table1.tripSerial \'车次\',\r\n	table1.contractPriceSum \'合同金额(元)\',\r\n  CONCAT(ROUND((table1.contractPriceSum/table3.contractPriceSumAll)*100,2),\'%\') \'合同额占比\',\r\n	table1.settlePriceSum \'结算金额(元)\',\r\n  CONCAT(ROUND((table1.settlePriceSum/table3.settlePriceSumAll)*100,2),\'%\') \'结算额占比\'\r\nFROM\r\n(SELECT\r\n	ccy. NAME serviceCompanyName,\r\n	COUNT(o.id) orderCount,\r\n  SUM(og.totalWeight) weightCount,\r\n	SUM(og.totalVolume) volumeCount,\r\n	SUM(og.totalQuatity) quantityCount,\r\n  getTripSerial(GROUP_CONCAT(o.id)) tripSerial,\r\n	ROUND(SUM(cc.total_price),2) contractPriceSum,\r\n	ROUND(SUM(sc.total_price),2) settlePriceSum\r\nFROM\r\n	xn_m_logistics_order o\r\nLEFT JOIN xn_m_logistics_order op ON o.parent_logistics_order_id = op.id\r\nINNER JOIN xn_m_logistics_order_status_his los ON o.id = los.logistics_order_id\r\nAND los.status_type = 1\r\nINNER JOIN xn_m_company pcy ON o.principal_company_id = pcy.id\r\nINNER JOIN xn_m_company ccy ON o.carry_company_id = ccy.id\r\nLEFT JOIN xn_m_address sa ON sa.id = o.send_address_id\r\nLEFT JOIN (\r\n	SELECT\r\n		og.logistics_order_id orderId,\r\n		SUM(gm.quantity) totalQuatity,\r\n		gm.quantity_unit quantityUnit,\r\n		SUM(gm.volume) totalVolume,\r\n		gm.volume_unit volumeUnit,\r\n		SUM(gm.weight) totalWeight,\r\n		gm.weight_unit weightUnit\r\n	FROM\r\n		xn_r_logistics_order_goods og\r\n	LEFT JOIN xn_m_goods_measuring gm ON gm.id = og.commissioned_goods_measuring_id\r\n	GROUP BY\r\n		og.logistics_order_id\r\n) og ON og.orderId = o.id\r\nLEFT JOIN xn_m_transport_charge cc ON cc.id = o.contract_price_id\r\nLEFT JOIN xn_m_transport_charge sc ON sc.id = o.settle_price_id\r\nLEFT JOIN (\r\n	SELECT\r\n		ps.document_id orderId,\r\n		ps.price recievePayMoney\r\n	FROM\r\n		xn_m_payment_schedule ps\r\n	WHERE\r\n		ps.document_type = 1133000\r\n	AND ps.payment_mode = 1021010\r\n) rps ON o.id = rps.orderId\r\nWHERE\r\n	IFNULL(o.is_delete, 0) = 0\r\nAND los.logistics_order_status != \'1121050\'\r\nAND o.principal_company_id =\'#companyId#\'\r\nAND (\r\n	op.carry_company_id !=\'#companyId#\'\r\n	OR op.carry_company_id IS NULL\r\n)\r\nAND (\r\n	op.principal_company_id !=\'#companyId#\'\r\n	OR op.principal_company_id IS NULL\r\n)\r\nAND CASE WHEN \'#beginTime#\' = \'\' THEN TRUE\r\n         WHEN \'#beginTime#\' != \'\' THEN UNIX_TIMESTAMP(date_format(o.create_time, \'%Y-%m-%d %H:%i:%s\'))>= UNIX_TIMESTAMP(date_format(\'#beginTime#\', \'%Y-%m-%d %H:%i:%s\'))\r\n    END\r\nAND CASE WHEN \'#endTime#\' = \'\' THEN TRUE\r\n         WHEN \'#endTime#\' != \'\' THEN UNIX_TIMESTAMP(date_format(o.create_time, \'%Y-%m-%d %H:%i:%s\'))<= UNIX_TIMESTAMP(date_format(\'#endTime#\', \'%Y-%m-%d %H:%i:%s\'))\r\n    END\r\nGROUP BY\r\n	o.carry_company_id) table1\r\nJOIN\r\n(\r\nSELECT SUM(table2.contractPriceSum) contractPriceSumAll,\r\n       SUM(table2.settlePriceSum) settlePriceSumAll\r\nFROM\r\n(SELECT\r\n	SUM(cc.total_price) contractPriceSum,\r\n	SUM(sc.total_price) settlePriceSum\r\nFROM\r\n	xn_m_logistics_order o\r\nLEFT JOIN xn_m_logistics_order op ON o.parent_logistics_order_id = op.id\r\nINNER JOIN xn_m_logistics_order_status_his los ON o.id = los.logistics_order_id\r\nAND los.status_type = 1\r\nINNER JOIN xn_m_company pcy ON o.principal_company_id = pcy.id\r\nINNER JOIN xn_m_company ccy ON o.carry_company_id = ccy.id\r\nLEFT JOIN xn_m_address sa ON sa.id = o.send_address_id\r\nLEFT JOIN (\r\n	SELECT\r\n		og.logistics_order_id orderId,\r\n		SUM(gm.quantity) totalQuatity,\r\n		gm.quantity_unit quantityUnit,\r\n		SUM(gm.volume) totalVolume,\r\n		gm.volume_unit volumeUnit,\r\n		SUM(gm.weight) totalWeight,\r\n		gm.weight_unit weightUnit\r\n	FROM\r\n		xn_r_logistics_order_goods og\r\n	LEFT JOIN xn_m_goods_measuring gm ON gm.id = og.commissioned_goods_measuring_id\r\n	GROUP BY\r\n		og.logistics_order_id\r\n) og ON og.orderId = o.id\r\nLEFT JOIN xn_m_transport_charge cc ON cc.id = o.contract_price_id\r\nLEFT JOIN xn_m_transport_charge sc ON sc.id = o.settle_price_id\r\nLEFT JOIN (\r\n	SELECT\r\n		ps.document_id orderId,\r\n		ps.price recievePayMoney\r\n	FROM\r\n		xn_m_payment_schedule ps\r\n	WHERE\r\n		ps.document_type = 1133000\r\n	AND ps.payment_mode = 1021010\r\n) rps ON o.id = rps.orderId\r\nWHERE\r\n	IFNULL(o.is_delete, 0) = 0\r\nAND los.logistics_order_status != \'1121050\'\r\nAND o.principal_company_id =\'#companyId#\'\r\nAND (\r\n	op.carry_company_id !=\'#companyId#\'\r\n	OR op.carry_company_id IS NULL\r\n)\r\nAND (\r\n	op.principal_company_id !=\'#companyId#\'\r\n	OR op.principal_company_id IS NULL\r\n)\r\nAND CASE WHEN \'#beginTime#\' = \'\' THEN TRUE\r\n         WHEN \'#beginTime#\' != \'\' THEN UNIX_TIMESTAMP(date_format(o.create_time, \'%Y-%m-%d %H:%i:%s\'))>= UNIX_TIMESTAMP(date_format(\'#beginTime#\', \'%Y-%m-%d %H:%i:%s\'))\r\n    END\r\nAND CASE WHEN \'#endTime#\' = \'\' THEN TRUE\r\n         WHEN \'#endTime#\' != \'\' THEN UNIX_TIMESTAMP(date_format(o.create_time, \'%Y-%m-%d %H:%i:%s\'))<= UNIX_TIMESTAMP(date_format(\'#endTime#\', \'%Y-%m-%d %H:%i:%s\'))\r\n    END\r\nGROUP BY\r\n	o.carry_company_id) table2) table3;', '承运人订单统计导出', '1', null);
INSERT INTO `xn_m_export_template` VALUES ('18', 'shipmentDetail', '订单号,订单日期,货物名称,货物编号,规格型号,托运人,承运人,发货单位,发货联系人,发货联系人手机,收货单位,收货联系人,收货联系人手机,发货省份,收货城市,街道地址,收货省份,收货城市,街道地址,里程(km),要求到货时间,实际到货时间,订单金额(元),结算金额(元),结算单价,订单重量,订单体积,订单数量,装运重量,装运体积,装运数量,装运时间,签收重量,签收体积,签收数量,车船号,回单要求,订单状态,执行结果,订单备注', 'SELECT\r\n	o.code \'订单号\',\r\n	o.delivery_date \'订单日期\',\r\n  g.name \'货物名称\',\r\n  g.code \'货物编号\',\r\n  g.model \'规格型号\',\r\n  pc.name \'托运人\',\r\n  cc.name \'承运人\',\r\n  senderCom.name \'发货单位\',\r\n	senderContact.NAME \'发货联系人\',\r\n	senderContact.mobile \'发货联系人手机\',\r\n	consigneeCom.`name` \'收货单位\',\r\n	consigneeContact.NAME \'收货联系人\',\r\n	consigneeContact.mobile \'收货联系人手机\',\r\n  t2.senderAddress AS \'发货省份\',\r\n	t1.senderAddress \'发货城市\',\r\n  sa.street_name \'街道地址\',\r\n  t4.senderAddress AS \'收货省份\',\r\n  t3.senderAddress \'收货城市\',\r\n	ra.street_name \'街道地址\',\r\n  o.distance \'里程(km)\',\r\n  o.arrival_date \'要求到货时间\',\r\n  sign.signed_time \'实际到货时间\',\r\n  tc.total_price \'订单金额(元)\',\r\n  stc.total_price \'结算金额(元)\',\r\n  ROUND((stc.total_price/gm.weight),2) \'结算单价\',\r\n  gm.weight \'订单重量\',\r\n  gm.volume \'订单体积\',\r\n  gm.quantity \'订单数量\',\r\n  ROUND(getRealWeightOrVolumeOrQuatity(o.root_order_id,o.lft,o.rht,sa.administrator_division_id,sa.street_name,og.goods_id,\'weight\'),2) \'装运重量\',\r\n  ROUND(getRealWeightOrVolumeOrQuatity(o.root_order_id,o.lft,o.rht,sa.administrator_division_id,sa.street_name,og.goods_id,\'volumne\'),2) \'装运体积\',\r\n	getRealWeightOrVolumeOrQuatity(o.root_order_id,o.lft,o.rht,sa.administrator_division_id,sa.street_name,og.goods_id,\'quantity\') \'装运数量\',\r\n	sign.signed_time \'装运时间\',\r\n	ROUND(getSignedWeightOrVolumeOrQuatity(o.root_order_id,o.lft,o.rht,ra.administrator_division_id,ra.street_name,og.goods_id,\'weight\'),2) \'签收重量\',\r\n	ROUND(getSignedWeightOrVolumeOrQuatity(o.root_order_id,o.lft,o.rht,ra.administrator_division_id,ra.street_name,og.goods_id,\'volumne\'),2) \'签收体积\',\r\n	getSignedWeightOrVolumeOrQuatity(o.root_order_id,o.lft,o.rht,ra.administrator_division_id,ra.street_name,og.goods_id,\'quantity\')\'签收数量\',\r\n	REPLACE(getVehicleCodes(o.root_order_id,o.lft,o.rht),\',\',\';\') \'车船号\',\r\n	tDemand.demandDesc \'回单要求\',\r\n	xmd.name \'订单状态\',\r\n	IFNULL(oExcu.excuResult, \'正常\') \'执行结果\',\r\n	o.comment \'订单备注\'\r\nFROM\r\n	xn_m_logistics_order AS o\r\nLEFT JOIN xn_r_logistics_order_goods AS og ON og.logistics_order_id = o.id\r\nLEFT JOIN xn_m_logistics_order_status_his oh ON oh.logistics_order_id = o.id\r\nAND oh.status_type = 1\r\nLEFT JOIN xn_m_dictionary xmd ON oh.logistics_order_status = xmd.id\r\nLEFT JOIN xn_m_logistics_order_status_his signOh ON signOh.logistics_order_id = o.id\r\nAND signOh.logistics_order_status = 1121030\r\nLEFT JOIN xn_m_goods AS g ON og.goods_id = g.id\r\nLEFT JOIN xn_m_address sa ON sa.id = o.send_address_id\r\nLEFT JOIN xn_m_address ra ON ra.id = o.receive_address_id\r\nLEFT JOIN (SELECT \r\n  CASE WHEN IFNULL(xmad2.parent_administration_division_id,FALSE) THEN xmad1.NAME\r\n       WHEN IFNULL(xmad2.parent_administration_division_id,TRUE) THEN xmad1.NAME \r\n	END senderAddress,xma.id senderAddressId\r\n	FROM xn_m_address xma\r\n	INNER JOIN xn_m_administration_division xmad1 ON xma.administrator_division_id = xmad1.id\r\n	INNER JOIN xn_m_administration_division xmad2 ON xmad1.parent_administration_division_id = xmad2.id\r\n  LEFT JOIN xn_m_administration_division xmad3 ON xmad2.parent_administration_division_id  = xmad3.id\r\n) t1 ON t1.senderAddressId = o.send_address_id\r\nLEFT JOIN (SELECT \r\n  CASE WHEN IFNULL(xmad2.parent_administration_division_id,FALSE) THEN xmad3.NAME\r\n       WHEN IFNULL(xmad2.parent_administration_division_id,TRUE) THEN xmad2.NAME \r\n	END senderAddress,xma.id senderAddressId\r\n	FROM xn_m_address xma\r\n	INNER JOIN xn_m_administration_division xmad1 ON xma.administrator_division_id = xmad1.id\r\n	INNER JOIN xn_m_administration_division xmad2 ON xmad1.parent_administration_division_id = xmad2.id\r\n  LEFT JOIN xn_m_administration_division xmad3 ON xmad2.parent_administration_division_id  = xmad3.id\r\n) t2 ON t2.senderAddressId = o.send_address_id\r\nLEFT JOIN (SELECT \r\n  CASE WHEN IFNULL(xmad2.parent_administration_division_id,FALSE) THEN xmad1.NAME\r\n       WHEN IFNULL(xmad2.parent_administration_division_id,TRUE) THEN xmad1.NAME \r\n	END senderAddress,xma.id senderAddressId\r\n	FROM xn_m_address xma\r\n	INNER JOIN xn_m_administration_division xmad1 ON xma.administrator_division_id = xmad1.id\r\n	INNER JOIN xn_m_administration_division xmad2 ON xmad1.parent_administration_division_id = xmad2.id\r\n  LEFT JOIN xn_m_administration_division xmad3 ON xmad2.parent_administration_division_id  = xmad3.id\r\n) t3 ON t3.senderAddressId = o.receive_address_id\r\nLEFT JOIN (SELECT \r\n  CASE WHEN IFNULL(xmad2.parent_administration_division_id,FALSE) THEN xmad3.NAME\r\n       WHEN IFNULL(xmad2.parent_administration_division_id,TRUE) THEN xmad2.NAME \r\n	END senderAddress,xma.id senderAddressId\r\n	FROM xn_m_address xma\r\n	INNER JOIN xn_m_administration_division xmad1 ON xma.administrator_division_id = xmad1.id\r\n	INNER JOIN xn_m_administration_division xmad2 ON xmad1.parent_administration_division_id = xmad2.id\r\n  LEFT JOIN xn_m_administration_division xmad3 ON xmad2.parent_administration_division_id  = xmad3.id\r\n) t4 ON t4.senderAddressId = o.receive_address_id\r\nLEFT JOIN xn_m_company pc ON pc.id = o.principal_company_id\r\nLEFT JOIN xn_m_company cc ON cc.id = o.carry_company_id\r\nLEFT JOIN xn_m_company consigneeCom ON consigneeCom.id = o.consignee_company_id\r\nLEFT JOIN xn_m_company senderCom ON senderCom.id = o.sender_company_id\r\nLEFT JOIN xn_m_contact rl ON rl.id = o.sender_id\r\nLEFT JOIN xn_m_outlets soutlets ON soutlets.id = o.delivery_outlets_id\r\nLEFT JOIN xn_m_goods_measuring gm ON gm.id = og.commissioned_goods_measuring_id\r\nLEFT JOIN xn_m_transport_charge tc ON o.contract_price_id = tc.id\r\nLEFT JOIN xn_m_transport_charge stc ON o.settle_price_id = stc.id\r\nLEFT JOIN xn_m_logistics_order op ON op.id = o.parent_logistics_order_id\r\nLEFT JOIN xn_m_contact consigneeContact ON o.consignee_id = consigneeContact.id\r\nLEFT JOIN xn_m_contact senderContact ON o.sender_id = senderContact.id\r\nLEFT JOIN xn_m_user pu ON pu.id = o.principal_user_id\r\nLEFT JOIN xn_m_user cu ON cu.id = o.carry_user_id\r\nLEFT JOIN (\r\n	SELECT\r\n		t.order_id,\r\n		IFNULL(\r\n			GROUP_CONCAT(d.description),\r\n			\'正常\'\r\n		) excuResult\r\n	FROM\r\n		xn_m_order_excu_result t\r\n	LEFT JOIN xn_m_dictionary d ON t.excu_result_id = d.id\r\n	GROUP BY\r\n		t.order_id\r\n) oExcu ON oExcu.order_id = o.id\r\nLEFT JOIN (\r\n	SELECT\r\n		demand.order_id,\r\n		GROUP_CONCAT(d.description) demandDesc\r\n	FROM\r\n		xn_m_order_receipt_demand demand\r\n	LEFT JOIN xn_m_dictionary d ON demand.ereceipt_demand_id = d.id\r\n	GROUP BY\r\n		demand.order_id\r\n) tDemand ON tDemand.order_id = o.id\r\nLEFT JOIN (\r\n	SELECT\r\n		MAX(dis.signed_time) AS signed_time,\r\n		dis.logistics_order_id\r\n	FROM\r\n		xn_m_dispatch dis\r\n	GROUP BY\r\n		dis.logistics_order_id\r\n) sign ON sign.logistics_order_id = o.id\r\nWHERE\r\n	1 = 1\r\nAND (IFNULL(o.is_delete, 0) = 0)\r\nAND o.id IN (SELECT DISTINCT\r\n	o.id orderID\r\nFROM\r\n	xn_m_logistics_order AS o\r\nLEFT JOIN xn_r_logistics_order_goods AS og ON og.logistics_order_id = o.id\r\nLEFT JOIN xn_m_logistics_order_status_his oh ON oh.logistics_order_id = o.id\r\nAND oh.status_type = 1\r\nLEFT JOIN xn_m_logistics_order_status_his signOh ON signOh.logistics_order_id = o.id\r\nAND signOh.logistics_order_status = 1121030\r\nLEFT JOIN xn_m_goods AS g ON og.goods_id = g.id\r\nLEFT JOIN xn_m_address sa ON sa.id = o.send_address_id\r\nLEFT JOIN xn_m_company pc ON pc.id = o.principal_company_id\r\nLEFT JOIN xn_m_company cc ON cc.id = o.carry_company_id\r\nLEFT JOIN xn_m_company consigneeCom ON consigneeCom.id = o.consignee_company_id\r\nLEFT JOIN xn_m_company senderCom ON senderCom.id = o.sender_company_id\r\nLEFT JOIN xn_m_contact rl ON rl.id = o.sender_id\r\nLEFT JOIN xn_m_outlets soutlets ON soutlets.id = o.delivery_outlets_id\r\nLEFT JOIN xn_m_address ra ON ra.id = o.receive_address_id\r\nLEFT JOIN xn_m_goods_measuring gm ON gm.id = og.commissioned_goods_measuring_id\r\nLEFT JOIN xn_m_transport_charge tc ON o.contract_price_id = tc.id\r\nLEFT JOIN xn_m_transport_charge stc ON o.settle_price_id = stc.id\r\nLEFT JOIN xn_m_logistics_order op ON op.id = o.parent_logistics_order_id\r\nLEFT JOIN xn_m_contact consigneeContact ON o.consignee_id = consigneeContact.id\r\nLEFT JOIN xn_m_contact senderContact ON o.sender_id = senderContact.id\r\nLEFT JOIN xn_m_user pu ON pu.id = o.principal_user_id\r\nLEFT JOIN xn_m_user cu ON cu.id = o.carry_user_id\r\nLEFT JOIN (\r\n	SELECT\r\n		t.order_id,\r\n		IFNULL(\r\n			GROUP_CONCAT(d.description),\r\n			\'正常\'\r\n		) excuResult\r\n	FROM\r\n		xn_m_order_excu_result t\r\n	LEFT JOIN xn_m_dictionary d ON t.excu_result_id = d.id\r\n	GROUP BY\r\n		t.order_id\r\n) oExcu ON oExcu.order_id = o.id\r\nLEFT JOIN (\r\n	SELECT\r\n		demand.order_id,\r\n		GROUP_CONCAT(d.description) demandDesc\r\n	FROM\r\n		xn_m_order_receipt_demand demand\r\n	LEFT JOIN xn_m_dictionary d ON demand.ereceipt_demand_id = d.id\r\n	GROUP BY\r\n		demand.order_id\r\n) tDemand ON tDemand.order_id = o.id\r\nLEFT JOIN (\r\n	SELECT\r\n		dad.document_id\r\n	FROM\r\n		xn_m_organization org,\r\n		xn_r_organization_users oru,\r\n		xn_r_data_author_detail dad,\r\n		xn_r_post_autho_data pad\r\n	WHERE\r\n		1 = 1\r\n	AND dad.document_type = 1133000\r\n	AND (\r\n		org.id = dad.org_id\r\n		OR org.pater_id = dad.org_id\r\n	)\r\n	AND pad.organization_id = org.id\r\n	AND (\r\n		pad.post_id = oru.organization_id\r\n		OR pad.organization_id = oru.organization_id\r\n	)\r\n	AND oru.user_id = \'#userId#\'\r\n	GROUP BY\r\n		dad.document_id\r\n) a_dd ON a_dd.document_id = o.id\r\nLEFT JOIN (\r\n	SELECT\r\n		dad.document_id\r\n	FROM\r\n		xn_m_organization org,\r\n		xn_r_organization_users oru,\r\n		xn_r_data_author_detail dad\r\n	WHERE\r\n		1 = 1\r\n	AND dad.document_type = 1133000\r\n	AND (\r\n		org.id = dad.org_id\r\n		OR org.pater_id = dad.org_id\r\n	)\r\n	AND org.id = oru.organization_id\r\n	AND org.root_company_id = \'#companyId#\'\r\n	GROUP BY\r\n		dad.document_id\r\n) b_dd ON b_dd.document_id = o.id\r\nWHERE\r\n	1 = 1\r\nAND (IFNULL(o.is_delete, 0) = 0)\r\nAND (\r\n	a_dd.document_id IS NOT NULL\r\n	OR (\r\n		b_dd.document_id IS NULL\r\n		AND (\r\n			o.carry_company_id IN (\'#companyId#\')\r\n			OR o.principal_company_id IN (\'#companyId#\')\r\n		)\r\n	)\r\n)\r\nAND (\r\n	(\r\n		(o.principal_company_id =\'#companyId#\')\r\n		OR (pu.company_id =\'#companyId#\')\r\n	)\r\n	AND (\r\n		op.principal_company_id !=\'#companyId#\'\r\n		OR op.principal_company_id IS NULL\r\n	)\r\n)\r\nORDER BY\r\n	o.trade_time DESC\r\n)\r\nAND (\r\n	(\r\n		(o.principal_company_id =\'#companyId#\')\r\n		OR (pu.company_id =\'#companyId#\')\r\n	)\r\n	AND (\r\n		op.principal_company_id !=\'#companyId#\'\r\n		OR op.principal_company_id IS NULL\r\n	)\r\n)\r\nAND CASE WHEN \'#beginTime#\' = \'\' THEN TRUE\r\n         WHEN \'#beginTime#\' != \'\' THEN UNIX_TIMESTAMP(date_format(o.trade_time, \'%Y-%m-%d\')) >= UNIX_TIMESTAMP(date_format(\'#beginTime#\', \'%Y-%m-%d\'))\r\n    END\r\nAND CASE WHEN \'#endTime#\' = \'\' THEN TRUE\r\n         WHEN \'#endTime#\' != \'\' THEN UNIX_TIMESTAMP(date_format(o.trade_time, \'%Y-%m-%d\')) <= UNIX_TIMESTAMP(date_format(\'#endTime#\', \'%Y-%m-%d\'))\r\n    END\r\nAND (\r\n    CASE WHEN \'#codeOrName#\' = \'\' THEN TRUE\r\n         WHEN \'#codeOrName#\' != \'\' THEN instr(g.name ,\'#codeOrName#\') OR instr(g.CODE ,\'#codeOrName#\')\r\n    END\r\n)\r\nAND CASE WHEN \'#sendAddress#\' = \'\' THEN TRUE\r\n         WHEN \'#sendAddress#\' != \'\' THEN sa.administrator_division_id LIKE CONCAT(\'#sendAddress#\', \'%\')\r\n    END\r\nAND CASE WHEN \'#receiveAddress#\' = \'\' THEN TRUE\r\n         WHEN \'#receiveAddress#\' != \'\' THEN ra.administrator_division_id LIKE CONCAT(\'#receiveAddress#\', \'%\')\r\n    END\r\nAND CASE WHEN \'#carryCompanyId#\' = \'\' THEN TRUE\r\n         WHEN \'#carryCompanyId#\' != \'\' THEN cc.id =\'#carryCompanyId#\'\r\n    END\r\nAND CASE WHEN \'#consigneeName#\' = \'\' THEN TRUE\r\n         WHEN \'#consigneeName#\' != \'\' THEN instr(rl.name ,\'#consigneeName#\')\r\n    END\r\nORDER BY\r\n	o.trade_time DESC;', '货物托运明细导出', '1', null);
INSERT INTO `xn_m_export_template` VALUES ('19', 'shipmentDetailCarry', '订单号,订单日期,货物名称,货物编号,规格型号,托运人,承运人,收货单位,发货省份,发货城市,街道地址,收货省份,收货城市,街道地址,里程(km),要求到货时间,实际到货时间,订单金额(元),结算金额(元),结算单价,费用支出(元),订单毛利(元),毛利率(%),订单重量,订单体积,订单数量,装运重量,装运体积,装运数量,装运时间,签收重量,签收体积,签收数量,车船号,回单要求,订单状态,执行结果,订单备注,保险单号,1,保险公司', 'SELECT\r\n	o.code \'订单号\',\r\n	o.delivery_date \'订单日期\',\r\n	g.name \'货物名称\',\r\n	g.code \'货物编号\',\r\n	g.model \'规格型号\',\r\n	pc.name \'托运人\',\r\n	cc.name \'承运人\',\r\n  consigneeCom.`name` \'收货单位\',\r\n	t2.senderAddress \'发货省份\',\r\n	t1.senderAddress \'发货城市\',\r\n  sa.street_name \'街道地址\',\r\n  t4.senderAddress \'收货省份\',\r\n  t3.senderAddress \'收货城市\',\r\n	ra.street_name \'街道地址\',\r\n	o.distance \'里程(km)\',\r\n  o.arrival_date \'要求到货时间\',\r\n  sign.signed_time \'实际到货时间\',\r\n  ROUND(tc.total_price,2) \'订单金额(元)\',\r\n  ROUND(stc.total_price,2) \'结算金额(元)\',\r\n  ROUND((stc.total_price/gm.weight),2) \'结算单价\',\r\n  getPayment(o.id) \'费用支出(元)\',\r\n  ROUND((stc.total_price-getPayment(o.id)),2) \'订单毛利(元)\',\r\n  CONCAT(ROUND(((stc.total_price-getPayment(o.id))/stc.total_price)*100,2),\'%\') \'毛利率(%)\',\r\n  ROUND(gm.weight,2) \'订单重量\',\r\n  ROUND(gm.volume,2) \'订单体积\',\r\n  gm.quantity \'订单数量\',\r\n  ROUND(getRealWeightOrVolumeOrQuatity(o.root_order_id,o.lft,o.rht,sa.administrator_division_id,sa.street_name,og.goods_id,\'weight\'),2) \'装运重量\',\r\n  ROUND(getRealWeightOrVolumeOrQuatity(o.root_order_id,o.lft,o.rht,sa.administrator_division_id,sa.street_name,og.goods_id,\'volumne\'),2) \'装运体积\',\r\n	getRealWeightOrVolumeOrQuatity(o.root_order_id,o.lft,o.rht,sa.administrator_division_id,sa.street_name,og.goods_id,\'quantity\') \'装运数量\',\r\n	sign.signed_time \'装运时间\',\r\n	ROUND(getSignedWeightOrVolumeOrQuatity(o.root_order_id,o.lft,o.rht,ra.administrator_division_id,ra.street_name,og.goods_id,\'weight\'),2) \'签收重量\',\r\n	ROUND(getSignedWeightOrVolumeOrQuatity(o.root_order_id,o.lft,o.rht,ra.administrator_division_id,ra.street_name,og.goods_id,\'volumne\'),2) \'签收体积\',\r\n	getSignedWeightOrVolumeOrQuatity(o.root_order_id,o.lft,o.rht,ra.administrator_division_id,ra.street_name,og.goods_id,\'quantity\')\'签收数量\',\r\n	REPLACE(getVehicleCodes(o.root_order_id,o.lft,o.rht),\',\',\';\') \'车船号\',\r\n	tDemand.demandDesc \'回单要求\',\r\n	xmd.name \'订单状态\',\r\n	IFNULL(oExcu.excuResult, \'正常\') \'执行结果\',\r\n	o.comment \'订单备注\',\r\n  NULL AS \'保险单号\',\r\n  NULL AS \'1\',\r\n  NULL AS \'保险公司\'\r\nFROM\r\n	xn_m_logistics_order AS o\r\nLEFT JOIN xn_r_logistics_order_goods AS og ON og.logistics_order_id = o.id\r\nLEFT JOIN xn_m_logistics_order_status_his oh ON oh.logistics_order_id = o.id\r\nAND oh.status_type = 1\r\nLEFT JOIN xn_m_dictionary xmd ON oh.logistics_order_status = xmd.id\r\nLEFT JOIN xn_m_logistics_order_status_his signOh ON signOh.logistics_order_id = o.id\r\nAND signOh.logistics_order_status = 1121030\r\nLEFT JOIN xn_m_goods AS g ON og.goods_id = g.id\r\nLEFT JOIN xn_m_address sa ON sa.id = o.send_address_id\r\nLEFT JOIN xn_m_address ra ON ra.id = o.receive_address_id\r\nLEFT JOIN (SELECT \r\n  CASE WHEN IFNULL(xmad2.parent_administration_division_id,FALSE) THEN xmad1.NAME\r\n       WHEN IFNULL(xmad2.parent_administration_division_id,TRUE) THEN xmad1.NAME \r\n	END senderAddress,xma.id senderAddressId\r\n	FROM xn_m_address xma\r\n	INNER JOIN xn_m_administration_division xmad1 ON xma.administrator_division_id = xmad1.id\r\n	INNER JOIN xn_m_administration_division xmad2 ON xmad1.parent_administration_division_id = xmad2.id\r\n  LEFT JOIN xn_m_administration_division xmad3 ON xmad2.parent_administration_division_id  = xmad3.id\r\n) t1 ON t1.senderAddressId = o.send_address_id\r\nLEFT JOIN (SELECT \r\n  CASE WHEN IFNULL(xmad2.parent_administration_division_id,FALSE) THEN xmad3.NAME\r\n       WHEN IFNULL(xmad2.parent_administration_division_id,TRUE) THEN xmad2.NAME \r\n	END senderAddress,xma.id senderAddressId\r\n	FROM xn_m_address xma\r\n	INNER JOIN xn_m_administration_division xmad1 ON xma.administrator_division_id = xmad1.id\r\n	INNER JOIN xn_m_administration_division xmad2 ON xmad1.parent_administration_division_id = xmad2.id\r\n  LEFT JOIN xn_m_administration_division xmad3 ON xmad2.parent_administration_division_id  = xmad3.id\r\n) t2 ON t2.senderAddressId = o.send_address_id\r\nLEFT JOIN (SELECT \r\n  CASE WHEN IFNULL(xmad2.parent_administration_division_id,FALSE) THEN xmad1.NAME\r\n       WHEN IFNULL(xmad2.parent_administration_division_id,TRUE) THEN xmad1.NAME \r\n	END senderAddress,xma.id senderAddressId\r\n	FROM xn_m_address xma\r\n	INNER JOIN xn_m_administration_division xmad1 ON xma.administrator_division_id = xmad1.id\r\n	INNER JOIN xn_m_administration_division xmad2 ON xmad1.parent_administration_division_id = xmad2.id\r\n  LEFT JOIN xn_m_administration_division xmad3 ON xmad2.parent_administration_division_id  = xmad3.id\r\n) t3 ON t3.senderAddressId = o.receive_address_id\r\nLEFT JOIN (SELECT \r\n  CASE WHEN IFNULL(xmad2.parent_administration_division_id,FALSE) THEN xmad3.NAME\r\n       WHEN IFNULL(xmad2.parent_administration_division_id,TRUE) THEN xmad2.NAME \r\n	END senderAddress,xma.id senderAddressId\r\n	FROM xn_m_address xma\r\n	INNER JOIN xn_m_administration_division xmad1 ON xma.administrator_division_id = xmad1.id\r\n	INNER JOIN xn_m_administration_division xmad2 ON xmad1.parent_administration_division_id = xmad2.id\r\n  LEFT JOIN xn_m_administration_division xmad3 ON xmad2.parent_administration_division_id  = xmad3.id\r\n) t4 ON t4.senderAddressId = o.receive_address_id\r\nLEFT JOIN xn_m_company pc ON pc.id = o.principal_company_id\r\nLEFT JOIN xn_m_company cc ON cc.id = o.carry_company_id\r\nLEFT JOIN xn_m_company consigneeCom ON consigneeCom.id = o.consignee_company_id\r\nLEFT JOIN xn_m_company senderCom ON senderCom.id = o.sender_company_id\r\nLEFT JOIN xn_m_contact rl ON rl.id = o.sender_id\r\nLEFT JOIN xn_m_outlets soutlets ON soutlets.id = o.delivery_outlets_id\r\nLEFT JOIN xn_m_goods_measuring gm ON gm.id = og.commissioned_goods_measuring_id\r\nLEFT JOIN xn_m_transport_charge tc ON o.contract_price_id = tc.id\r\nLEFT JOIN xn_m_transport_charge stc ON o.settle_price_id = stc.id\r\nLEFT JOIN xn_m_logistics_order op ON op.id = o.parent_logistics_order_id\r\nLEFT JOIN xn_m_contact consigneeContact ON o.consignee_id = consigneeContact.id\r\nLEFT JOIN xn_m_contact senderContact ON o.sender_id = senderContact.id\r\nLEFT JOIN xn_m_user pu ON pu.id = o.principal_user_id\r\nLEFT JOIN xn_m_user cu ON cu.id = o.carry_user_id\r\nLEFT JOIN (\r\n	SELECT\r\n		t.order_id,\r\n		IFNULL(\r\n			GROUP_CONCAT(d.description),\r\n			\'正常\'\r\n		) excuResult\r\n	FROM\r\n		xn_m_order_excu_result t\r\n	LEFT JOIN xn_m_dictionary d ON t.excu_result_id = d.id\r\n	GROUP BY\r\n		t.order_id\r\n) oExcu ON oExcu.order_id = o.id\r\nLEFT JOIN (\r\n	SELECT\r\n		demand.order_id,\r\n		GROUP_CONCAT(d.description) demandDesc\r\n	FROM\r\n		xn_m_order_receipt_demand demand\r\n	LEFT JOIN xn_m_dictionary d ON demand.ereceipt_demand_id = d.id\r\n	GROUP BY\r\n		demand.order_id\r\n) tDemand ON tDemand.order_id = o.id\r\nLEFT JOIN (\r\n	SELECT\r\n		MAX(dis.signed_time) AS signed_time,\r\n		dis.logistics_order_id\r\n	FROM\r\n		xn_m_dispatch dis\r\n	GROUP BY\r\n		dis.logistics_order_id\r\n) sign ON sign.logistics_order_id = o.id\r\nWHERE\r\n	1 = 1\r\nAND (IFNULL(o.is_delete, 0) = 0)\r\nAND o.id IN (\r\n\r\nSELECT DISTINCT\r\n	o.id orderID\r\nFROM\r\n	xn_m_logistics_order AS o\r\nLEFT JOIN xn_r_logistics_order_goods AS og ON og.logistics_order_id = o.id\r\nLEFT JOIN xn_m_logistics_order_status_his oh ON oh.logistics_order_id = o.id\r\nAND oh.status_type = 1\r\nLEFT JOIN xn_m_logistics_order_status_his signOh ON signOh.logistics_order_id = o.id\r\nAND signOh.logistics_order_status = 1121030\r\nLEFT JOIN xn_m_goods AS g ON og.goods_id = g.id\r\nLEFT JOIN xn_m_company pc ON pc.id = o.principal_company_id\r\nLEFT JOIN xn_m_company cc ON cc.id = o.carry_company_id\r\nLEFT JOIN xn_m_company consigneeCom ON consigneeCom.id = o.consignee_company_id\r\nLEFT JOIN xn_m_company senderCom ON senderCom.id = o.sender_company_id\r\nLEFT JOIN xn_m_contact rl ON rl.id = o.sender_id\r\nLEFT JOIN xn_m_outlets soutlets ON soutlets.id = o.delivery_outlets_id\r\nLEFT JOIN xn_m_address ra ON ra.id = o.receive_address_id\r\nLEFT JOIN xn_m_goods_measuring gm ON gm.id = og.commissioned_goods_measuring_id\r\nLEFT JOIN xn_m_transport_charge tc ON o.contract_price_id = tc.id\r\nLEFT JOIN xn_m_transport_charge stc ON o.settle_price_id = stc.id\r\nLEFT JOIN xn_m_logistics_order op ON op.id = o.parent_logistics_order_id\r\nLEFT JOIN xn_m_contact consigneeContact ON o.consignee_id = consigneeContact.id\r\nLEFT JOIN xn_m_contact senderContact ON o.sender_id = senderContact.id\r\nLEFT JOIN xn_m_user pu ON pu.id = o.principal_user_id\r\nLEFT JOIN xn_m_user cu ON cu.id = o.carry_user_id\r\nLEFT JOIN (\r\n	SELECT\r\n		t.order_id,\r\n		IFNULL(\r\n			GROUP_CONCAT(d.description),\r\n			\'正常\'\r\n		) excuResult\r\n	FROM\r\n		xn_m_order_excu_result t\r\n	LEFT JOIN xn_m_dictionary d ON t.excu_result_id = d.id\r\n	GROUP BY\r\n		t.order_id\r\n) oExcu ON oExcu.order_id = o.id\r\nLEFT JOIN (\r\n	SELECT\r\n		demand.order_id,\r\n		GROUP_CONCAT(d.description) demandDesc\r\n	FROM\r\n		xn_m_order_receipt_demand demand\r\n	LEFT JOIN xn_m_dictionary d ON demand.ereceipt_demand_id = d.id\r\n	GROUP BY\r\n		demand.order_id\r\n) tDemand ON tDemand.order_id = o.id\r\nLEFT JOIN (\r\n	SELECT\r\n		dad.document_id\r\n	FROM\r\n		xn_m_organization org,\r\n		xn_r_organization_users oru,\r\n		xn_r_data_author_detail dad,\r\n		xn_r_post_autho_data pad\r\n	WHERE\r\n		1 = 1\r\n	AND dad.document_type = 1133000\r\n	AND (\r\n		org.id = dad.org_id\r\n		OR org.pater_id = dad.org_id\r\n	)\r\n	AND pad.organization_id = org.id\r\n	AND (\r\n		pad.post_id = oru.organization_id\r\n		OR pad.organization_id = oru.organization_id\r\n	)\r\nAND oru.user_id = \'#userId#\'\r\n	GROUP BY\r\n		dad.document_id\r\n) a_dd ON a_dd.document_id = o.id\r\nLEFT JOIN (\r\n	SELECT\r\n		dad.document_id\r\n	FROM\r\n		xn_m_organization org,\r\n		xn_r_organization_users oru,\r\n		xn_r_data_author_detail dad\r\n	WHERE\r\n		1 = 1\r\n	AND dad.document_type = 1133000\r\n	AND (\r\n		org.id = dad.org_id\r\n		OR org.pater_id = dad.org_id\r\n	)\r\n	AND org.id = oru.organization_id\r\n	AND org.root_company_id = \'#companyId#\'\r\n	GROUP BY\r\n		dad.document_id\r\n) b_dd ON b_dd.document_id = o.id\r\nWHERE\r\n	1 = 1\r\nAND (IFNULL(o.is_delete, 0) = 0)\r\nAND (\r\n	a_dd.document_id IS NOT NULL\r\n	OR (\r\n		b_dd.document_id IS NULL\r\n		AND (\r\n			o.carry_company_id IN (\'#companyId#\')\r\n			OR o.principal_company_id IN (\'#companyId#\')\r\n		)\r\n	)\r\n)\r\nAND (\r\n	(\r\n		(o.carry_company_id = \'#companyId#\')\r\n		OR (cu.company_id = \'#companyId#\')\r\n	)\r\n	AND (\r\n		op.carry_company_id != \'#companyId#\'\r\n		OR op.carry_company_id IS NULL\r\n	)\r\n)\r\nORDER BY\r\n	o.trade_time DESC\r\n)\r\nAND (\r\n	(\r\n		(o.carry_company_id = \'#companyId#\')\r\n		OR (cu.company_id = \'#companyId#\')\r\n	)\r\n	AND (\r\n		op.carry_company_id != \'#companyId#\'\r\n		OR op.carry_company_id IS NULL\r\n	)\r\n)\r\nAND CASE WHEN \'#beginTime#\' = \'\' THEN TRUE\r\n         WHEN \'#beginTime#\' != \'\' THEN UNIX_TIMESTAMP(date_format(o.trade_time, \'%Y-%m-%d\')) >= UNIX_TIMESTAMP(date_format(\'#beginTime#\', \'%Y-%m-%d\'))\r\n    END\r\nAND CASE WHEN \'#endTime#\' = \'\' THEN TRUE\r\n         WHEN \'#endTime#\' != \'\' THEN UNIX_TIMESTAMP(date_format(o.trade_time, \'%Y-%m-%d\')) <= UNIX_TIMESTAMP(date_format(\'#endTime#\', \'%Y-%m-%d\'))\r\n    END\r\nAND (\r\n    CASE WHEN \'#codeOrName#\' = \'\' THEN TRUE\r\n         WHEN \'#codeOrName#\' != \'\' THEN instr(g.name ,\'#codeOrName#\') OR instr(g.CODE ,\'#codeOrName#\')\r\n    END\r\n)\r\nAND CASE WHEN \'#sendAddress#\' = \'\' THEN TRUE\r\n         WHEN \'#sendAddress#\' != \'\' THEN sa.administrator_division_id LIKE CONCAT(\'#sendAddress#\', \'%\')\r\n    END\r\nAND CASE WHEN \'#receiveAddress#\' = \'\' THEN TRUE\r\n         WHEN \'#receiveAddress#\' != \'\' THEN ra.administrator_division_id LIKE CONCAT(\'#receiveAddress#\', \'%\')\r\n    END\r\nAND CASE WHEN \'#principalCompanyId#\' = \'\' THEN TRUE\r\n         WHEN \'#principalCompanyId#\' != \'\' THEN cc.id =\'#principalCompanyId#\'\r\n    END\r\nAND CASE WHEN \'#consigneeName#\' = \'\' THEN TRUE\r\n         WHEN \'#consigneeName#\' != \'\' THEN instr(rl.name ,\'#consigneeName#\')\r\n    END\r\nORDER BY\r\n	o.trade_time DESC;', '货物承运明细导出', '1', null);
INSERT INTO `xn_m_export_template` VALUES ('20', 'dispatchReceiptList', '订单号,订单类型,托运人,承运人,订单金额,调度单号,发货地,收货地,调度状态,货物签收时间,回单状态,计划接收日期,接收日期,转寄日期,催单日期,操作人', 'SELECT\r\n	o.`code` \'订单号\',\r\n	CASE o.order_type\r\nWHEN \'1191000\' THEN\r\n	\'委托订单\'\r\nWHEN \'1191010\' THEN\r\n	\'承运订单\'\r\nEND AS \'订单类型\',\r\n truC. NAME AS \'托运人\',\r\n carC. NAME AS \'承运人\',\r\n ctc.total_price AS \'订单金额\',\r\n dis.dispatch_code AS \'调度单号\',\r\n conD. NAME AS \'发货地\',\r\n ceeD. NAME AS \'收货地\',\r\n dsh.dispatch_status \'调度状态\',\r\n dis.signed_time AS \'货物签收时间\',\r\n CASE dre.receipt_status\r\nWHEN 1122100 THEN\r\n	\'未登记\'\r\nWHEN 1122110 THEN\r\n	\'已登记\'\r\nWHEN 1122120 THEN\r\n	\'已逾期\'\r\nEND AS \'回单状态\',\r\n dre.plan_receipt_date AS \'计划接收日期\',\r\n dre.receipt_date AS \'接收日期\',\r\n dre.forward_date AS \'转寄日期\',\r\n dre.remind_date AS \'催单日期\',\r\n u. NAME \'操作人\'\r\nFROM\r\n	xn_m_order_info o\r\nLEFT JOIN xn_m_company truC ON truC.id = o.`principal_company_id`\r\nLEFT JOIN xn_m_company carC ON carC.id = o.carry_company_id\r\nLEFT JOIN xn_m_administration_division conD ON conD.id = o.`senderAdminDiviId`\r\nLEFT JOIN xn_m_administration_division ceeD ON ceeD.id = o.`consigneeAdminDiviId`\r\nLEFT JOIN xn_m_transport_charge ctc ON ctc.id = o.contract_price_id\r\nLEFT JOIN xn_m_dispatch dis ON dis.logistics_order_id = o.id\r\nLEFT JOIN xn_m_dispatch_status_his dsh ON dsh.dispatch_id = dis.id\r\nAND dsh.is_valid = 1\r\nLEFT JOIN xn_m_dispatch_receipt dre ON dre.dispatch_id = dis.id\r\nLEFT JOIN xn_m_user u ON u.id = dre.user_id\r\nWHERE\r\n	1 = 1\r\nAND CASE \r\nWHEN \'#companyID#\' = \'\' THEN\r\n	TRUE\r\nWHEN \'#companyID#\' != \'\' THEN\r\n	(\r\n		o.carry_company_id = \'#companyID#\'\r\n		OR o.principal_company_id = \'#companyID#\'\r\n	)\r\nEND\r\nAND CASE\r\nWHEN \'#orderCode#\' = \'\' THEN\r\n	TRUE\r\nWHEN \'#orderCode#\' != \'\' THEN\r\n	(\r\n		instr(o. CODE, \'#orderCode#\')\r\n	)\r\nEND -- 回单状态\r\nAND CASE\r\nWHEN \'#receiptStatus#\' = \'\' THEN\r\n	TRUE\r\nWHEN \'#receiptStatus#\' != \'\' THEN\r\n	(\r\n		dre.receipt_status = \'#receiptStatus#\'\r\n	)\r\nEND\r\nAND CASE\r\nWHEN \'#dispatchStatus#\' = \'\' THEN\r\n	TRUE\r\nWHEN \'#dispatchStatus#\' != \'\' THEN\r\n	(\r\n		dre.receipt_status = \'#dispatchStatus#\'\r\n	)\r\nEND\r\nAND CASE\r\nWHEN \'#deliveryCityCode#\' = \'\' THEN\r\n	TRUE\r\nWHEN \'#deliveryCityCode#\' != \'\' THEN\r\n	(\r\n		instr(\r\n			o.senderAdminDiviId,\r\n			TRIM(\r\n				TRAILING \'00\'\r\n				FROM\r\n					\'#deliveryCityCode#\'\r\n			)\r\n		) = 1\r\n	)\r\nEND\r\nAND CASE\r\nWHEN \'#destinationCityCode#\' = \'\' THEN\r\n	TRUE\r\nWHEN \'#destinationCityCode#\' != \'\' THEN\r\n	(\r\n		instr(\r\n			o.consigneeAdminDiviId,\r\n			TRIM(\r\n				TRAILING \'00\'\r\n				FROM\r\n					\'#destinationCityCode#\'\r\n			)\r\n		) = 1\r\n	)\r\nEND\r\nAND CASE\r\nWHEN \'#busiRelater#\' = \'\' THEN\r\n	TRUE\r\nWHEN \'#busiRelater#\' != \'\' THEN\r\n	(\r\n		instr(\r\n			o.principal_company_name,\r\n			\'#busiRelater#\'\r\n		)\r\n		OR instr(\r\n			o.carry_company_name,\r\n			\'#busiRelater#\'\r\n		)\r\n	)\r\nEND\r\nAND CASE\r\nWHEN \'#beginTime#\' = \'\' THEN\r\n	TRUE\r\nWHEN \'#beginTime#\' != \'\' THEN\r\n	(\r\n		o.modify_time>= \'#beginTime#\'\r\n		OR o.orderStatusCreateTime >= \'#beginTime#\'\r\n	)\r\nEND\r\nAND CASE\r\nWHEN \'#endTime#\' = \'\' THEN\r\n	TRUE\r\nWHEN \'#endTime#\' != \'\' THEN\r\n	(\r\n		o.modify_time <= \'#endTime#\'\r\n	)\r\nEND', '回单列表导出', '1', null);
INSERT INTO `xn_m_export_template` VALUES ('3', 'vehicle', '牌照号,运输许可证号,道路运输证有效期,GPS设备号,发动机号（车辆）,车架号（车辆）,底盘号（车辆）,类型,运营状态,作业状态,默认司机,运输队,归属关系,型号描述,载具所有人,所有人手机号,开户行,银行卡号,载具联系人,联系人手机号,当前位置,常跑城市,承运数', 'SELECT\r\n	v.vehicle_code \'牌照号\',\r\n	concat(road_tran_cert_code,\'	\') \'运输许可证号\',\r\n	concat(road_tran_cert_available_date,\'	\') \'运输许可证有效期\',\r\n	concat(gps_deviceid,\'	\') \'GPS设备号\',\r\n	concat(engine_number,\'	\') \'发动机号（车辆）\', \r\n	concat(vehicle_number,\'	\') \'车架号（车辆）\', \r\n  concat(chassis_number,\'	\') \'底盘号（车辆）\',\r\n	d1.name \'类型\',\r\n	case enable_status when 0 then \'停运\' else \'正常\' end \'运营状态\',\r\n	case enable_status when 0 then \'\' else (case is_free when 1 then \'空载\' else \'满载\' end) end  \'作业状态\',\r\n	CONCAT_WS(\' \',d.`name`,u.mobile) \'	默认司机\',\r\n	tt.name \'运输队\',\r\n	case v.relation_type when 1 then \'外协\' when 2 then \'自有\' else \'其他\' end \'归属关系\',\r\n	CONCAT_WS(\'-\',d2.name,d3.name,concat(vehicle_tonnage,\'吨\')) \'	型号描述\',\r\n	cont.`name` \'载具所有人\',\r\n	cont.mobile \'所有人手机号\',\r\n	cv.owner_opening_bank \'开户行\',\r\n	cv.owner_bank_card_code \'银行卡号\',\r\n	cont2.`name` \'载具联系人\',\r\n	cont2.mobile \'联系人手机号\',\r\n	v.current_point \'当前位置\',\r\n	normalCity \'常跑城市\',\r\n	ifnull(dispatch_count,0) \'承运数\'\r\n	FROM\r\n		xn_m_vehicles v\r\nleft join xn_r_company_vehicles cv on v.id = cv.vehicles_id\r\nLEFT JOIN xn_m_contact cont on cont.id = cv.owner_linkman_id\r\nLEFT JOIN xn_m_contact cont2 on cont2.id = cv.inner_linkman_id\r\nleft join xn_m_driver d on cv.default_driver_id = d.id\r\nleft join xn_m_dictionary d1 on d1.id = v.vehicles_mode\r\nleft join xn_m_dictionary d2 on d2.id = v.vehicle_type\r\nleft join xn_m_dictionary d3 on d3.id = case vehicles_mode when \'1071000\' then v.vehicle_length else v.ship_zone end \r\nleft join xn_m_user u on d.user_id = u.id \r\nLEFT JOIN xn_m_transport_team_vehicles ttv ON ttv.vehicle_id=v.id\r\nLEFT JOIN xn_m_transport_team tt ON tt.id = ttv.transport_team_id\r\nleft join (select group_concat(replace(replace(getDiviParentNameLst(administration_division_id),\',\',\'\'),\'市辖区\',\'\') SEPARATOR \';\') normalCity,vehicles_id  from xn_r_vehicles_direction group by vehicles_id) vd \r\non (vd.vehicles_id = v.id or vd.vehicles_id is null)\r\n	WHERE\r\n1=1 and cv.company_id = \'#companyId#\'\r\n		and vehicle_code like \'%#vehicleCode#%\'\r\n		and ifnull(v.current_point,\'\') like \'%#deliveryCityCode#%\'\r\n		and ifnull(normalCity,\'\') like \'%#normalCity#%\'\r\n		and ifnull(v.vehicle_type,\'\') like \'%#vehicleType#%\'\r\n		and ifnull(v.vehicle_length,\'\') like \'%#vehicleLength#%\'\r\n		and ifnull(v.ship_zone,\'\') like \'%#shipZone#%\'\r\n		and v.vehicles_mode like \'%#vehiclesMode#%\'\r\n		and v.relation_type like \'%#relationType#%\';', null, '2', null);
INSERT INTO `xn_m_export_template` VALUES ('4', 'driver', '服务评价,姓名,性别,手机号码,运输队,人事关系,身份证号码,银行卡号,从业资格证,驾龄,驾驶证到期日,默认载具,备注,承运数', 'select repeat(\'☆\',c.service_star) \'服务评价\',u.name \'姓名\',	CASE d.gender WHEN 1 THEN \'男\' ELSE \'女\' END \'性别\', concat(u.mobile,\'\\t\') \'手机号码\',tt.`name` \'运输队\',\r\ncase cd.relation_type when 1 then \'外协司机\' when 2 then \'公司同事\' else \'其他\' end \'人事关系\',\r\nconcat(d.idcard_no,\'\\t\') \'身份证号码\',trcd.bank_card_code \'银行卡号\', d.qualification_cerrificate_number \'从业资格证\',case d.driving_years when null then \'\' else CONCAT(d.driving_years,\'年\') end\'驾龄\',\r\nconcat(d.driver_licence_expiry_date,\'\\t\') \'驾驶证到期日\',vv.default_code \'默认载具\',d.description \'备注\',ifnull(tmdb.execCount,0) \'承运数\'\r\n from xn_m_driver d\r\nLEFT JOIN xn_r_company_driver trcd ON trcd.driver_id = d.id\r\nleft join xn_m_user u on d.user_id = u.id  \r\nLEFT JOIN xn_r_company_driver cd ON cd.driver_id = d.id\r\nleft join xn_m_company c on c.id = u.company_id\r\nLEFT JOIN xn_m_transport_team_driver ttd ON ttd.driver_id=d.id\r\nLEFT JOIN xn_m_transport_team tt ON tt.id = ttd.transport_team_id\r\nleft join (select d.id,group_concat(v.vehicle_code SEPARATOR \';\') default_code from xn_m_vehicles v left join xn_r_company_vehicles cv on v.id = cv.vehicles_id join xn_m_driver d on cv.default_driver_id = d.id GROUP BY d.id) vv\r\non vv.id = d.id\r\nLEFT JOIN (\r\n			SELECT\r\n				count(1) AS execCount,\r\n				tdb.driver_id\r\n			FROM\r\n				xn_m_dispatch_batch tdb\r\n			GROUP BY\r\n				tdb.driver_id\r\n		) tmdb ON tmdb.driver_id = d.id\r\nwhere u.mobile like \'%#mobile#%\' and cd.company_id = \'#companyId#\'  and u.name like \'%#name#%\' and (ifnull(tt.id,\'\') = \'#teamId#\' or  \'#teamId#\' = \'\')\r\nand cd.relation_type >= case ifnull(\'#relationType#\',\'\') when \'\' then 0 else \'#relationType#\' end \r\norder by d.create_time desc;', null, null, null);
INSERT INTO `xn_m_export_template` VALUES ('5', 'memberCarry', '公司名称,信用积分,地址,联系人,运输区域,运输方式,订单量,累计金额,状态,操作员,加入时间', '\r\n\r\n\r\nSELECT\r\n	NAME 公司名称,\r\n  ifnull(score,\'-\') 信用积分,\r\n	address 地址,\r\n	contact 联系人,\r\n	area 运输区域,\r\n	tran 运输方式,\r\n	count(total_price) 订单量,\r\n	convert(sum(ifnull(total_price, 0)),decimal) 累计金额,\r\n	case audit_status when 2522200 then \'已审核\' when 2522100 then \'待审核\' else audit_status end 	状态,\r\n	creater 操作员,\r\n	CONCAT(create_time,\'\\t\') 加入时间\r\nFROM\r\n	(\r\n		SELECT\r\n			c.*, oc.total_price,re.score,\r\n			oc.memberCompanyId,area,tran,areaCode,tranCode\r\n		FROM\r\n			(\r\n				SELECT\r\n					c.id,\r\n					c. NAME,\r\n					concat_ws(\' \',REPLACE (REPLACE (getDiviParentNameLst (ct.cityId),\',\',\'\'),\'市辖区\',\'\'),address) address,\r\n					concat_ws(\' \', ct. NAME, ct.mobile) contact,\r\n					u. NAME creater,\r\n					cm.create_time,\r\n					cm.member_company_id,\r\n					cm.company_id,\r\n					cm.audit_status\r\n				FROM\r\n					xn_r_company_member cm\r\n				LEFT JOIN xn_m_company c ON cm.member_company_id = c.id\r\n				LEFT JOIN xn_m_user u ON u.id = cm.creater\r\n				LEFT JOIN xn_m_contact_info ct ON ct.id = cm.contact_id\r\n				WHERE\r\n					cm.company_id = \'#companyId#\' and c.name like \'%#companyName#%\' and (ct. NAME like \'%#nameORmobile#%\' or ct.mobile like \'%#nameORmobile#%\')\r\n				AND cm.member_type = \'#memberType#\' \r\n			) c\r\n		LEFT JOIN (\r\n				SELECT\r\n					tc.total_price AS total_price,\r\n					t.carry_company_id,\r\n					CASE #memberType# WHEN 2505010 THEN t.principal_company_id WHEN 2505020 THEN t.consignee_company_id ELSE t.carry_company_id END AS memberCompanyId,\r\n					t.principal_company_id AS principal_company_id,\r\n					op.carry_company_id AS carry_parent_company_id,\r\n					op.principal_company_id AS principal_parent_company_id\r\n				FROM\r\n				(( xn_m_logistics_order t LEFT JOIN xn_m_transport_charge tc ON ((t.settle_price_id = tc.id)))\r\n					LEFT JOIN xn_m_logistics_order op ON ( ( op.id = t.parent_logistics_order_id ) ) )\r\n				) oc \r\n					ON c.id = oc.memberCompanyId \r\n					AND ( oc.carry_company_id = \'#companyId#\' OR oc.principal_company_id = \'#companyId#\' )\r\n					AND ( oc.carry_parent_company_id != \'#companyId#\' OR oc.carry_parent_company_id IS NULL )\r\n					AND ( oc.principal_parent_company_id != \'#companyId#\' OR oc.principal_parent_company_id IS NULL )\r\n		#信用积分\r\n		left join (\r\n			select sum(t.score) score,rep.carry_company_id from xn_m_examine_item t\r\n			left join xn_m_credit_report rep on rep.id = t.credit_report_id \r\n			 group by rep.carry_company_id\r\n		) re on re.carry_company_id = oc.memberCompanyId\r\n	\r\n		#运输区域\r\n		left join (\r\n			SELECT company_id,member_company_id,group_concat(REPLACE (REPLACE (getDiviParentNameLst (transport_area_id),\',\',\'\'),\'市辖区\',\'\') SEPARATOR \' | \') area,group_concat(transport_area_id SEPARATOR \' | \') areaCode from xn_r_transport_area a GROUP by company_id,member_company_id\r\n		) area on area.company_id = c.company_id and area.member_company_id = oc.memberCompanyId\r\n		#运输方式	\r\n		left join(\r\n				select company_id,member_company_id,group_concat(d.name SEPARATOR \' | \') tran,group_concat(m.transport_mode_id SEPARATOR \' | \') tranCode from xn_r_transport_mode m \r\n				left join xn_m_dictionary d on m.transport_mode_id = d.id\r\n				GROUP BY m.company_id,m.member_company_id\r\n			) tran on tran.company_id = c.company_id and tran.member_company_id = oc.memberCompanyId\r\n	) a\r\nwhere (ifnull(areaCode,\'\') = \'#areaCode#\' or \'\' = \'#areaCode#\') and (ifnull(tranCode,\'\') = \'#tranCode#\' or \'\' = \'#tranCode#\')\r\nGROUP BY\r\n	a. name,creater,create_time,contact\r\nORDER BY\r\n	create_time DESC\r\n', '承运人导出', '1', null);
INSERT INTO `xn_m_export_template` VALUES ('6', 'member', '公司名称,地址,联系人,订单量,累计金额,操作员,加入时间', 'SELECT\r\n	NAME 公司名称,\r\n	address 地址,\r\n	contact 联系人,\r\n	count(total_price) 订单量,\r\n	convert(sum(ifnull(total_price, 2)),decimal) 累计金额,\r\n	creater 操作员,\r\n	#DATE_FORMAT(create_time,\'%Y-%m-%d %H:%i:%s\') 加入时间\r\n	CONCAT(create_time,\'\\t\') 加入时间\r\nFROM\r\n	(\r\n		SELECT\r\n			c.*, oc.total_price,\r\n			oc.memberCompanyId\r\n		FROM\r\n			(\r\n				SELECT\r\n					c.id,\r\n					c. NAME,\r\n					concat_ws(\r\n						\' \',\r\n						REPLACE (\r\n							REPLACE (\r\n								getDiviParentNameLst (ct.cityId),\r\n								\',\',\r\n								\'\'\r\n							),\r\n							\'市辖区\',\r\n							\'\'\r\n						),\r\n						address\r\n					) address,\r\n					concat_ws(\' \', ct. NAME, ct.mobile) contact,\r\n					u. NAME creater,\r\n					cm.create_time,\r\n					cm.member_company_id\r\n				FROM\r\n					xn_r_company_member cm\r\n				LEFT JOIN xn_m_company c ON cm.member_company_id = c.id\r\n				LEFT JOIN xn_m_user u ON u.id = cm.creater\r\n				LEFT JOIN xn_m_contact_info ct ON ct.id = cm.contact_id\r\n				WHERE\r\n					cm.company_id = \'#companyId#\' and c.name like \'%#companyName#%\' and (ct. NAME like \'%#nameORmobile#%\' or ct.mobile like \'%#nameORmobile#%\')\r\n				AND cm.member_type = \'#memberType#\'\r\n			) c\r\n		LEFT JOIN (\r\n			SELECT\r\n				tc.total_price AS total_price,\r\n				t.carry_company_id,\r\n				CASE #memberType#\r\n			WHEN 2505010 THEN\r\n				t.principal_company_id\r\n			WHEN 2505020 THEN\r\n				t.consignee_company_id\r\n			ELSE\r\n				t.carry_company_id\r\n			END AS memberCompanyId,\r\n			t.principal_company_id AS principal_company_id,\r\n			op.carry_company_id AS carry_parent_company_id,\r\n			op.principal_company_id AS principal_parent_company_id\r\n		FROM\r\n			(\r\n				(\r\n					xn_m_logistics_order t\r\n					LEFT JOIN xn_m_transport_charge tc ON ((t.settle_price_id = tc.id))\r\n				)\r\n				LEFT JOIN xn_m_logistics_order op ON (\r\n					(\r\n						op.id = t.parent_logistics_order_id\r\n					)\r\n				)\r\n			)\r\n		) oc ON c.id = oc.memberCompanyId\r\n		AND (\r\n			oc.carry_company_id = \'#companyId#\'\r\n			OR oc.principal_company_id = \'#companyId#\'\r\n		)\r\n		AND (\r\n			oc.carry_parent_company_id != \'#companyId#\'\r\n			OR oc.carry_parent_company_id IS NULL\r\n		)\r\n		AND (\r\n			oc.principal_parent_company_id != \'#companyId#\'\r\n			OR oc.principal_parent_company_id IS NULL\r\n		)\r\n	) a\r\nGROUP BY\r\n	a. name,creater,create_time\r\nORDER BY\r\n	create_time DESC\r\n', '伙伴导出', '1', null);
INSERT INTO `xn_m_export_template` VALUES ('7', 'member1', '公司名称,地址,联系人,订单量,累计金额,操作员,加入时间', 'SELECT\r\n	NAME 公司名称,\r\n	address 地址,\r\n	contact 联系人,\r\n	count(total_price) 订单量,\r\n	convert(sum(ifnull(total_price, 2)),decimal) 累计金额,\r\n	creater 操作员,\r\n	#DATE_FORMAT(create_time,\'%Y-%m-%d %H:%i:%s\') 加入时间\r\n	CONCAT(create_time,\'\\t\') 加入时间\r\nFROM\r\n	(\r\n		SELECT\r\n			c.*, oc.total_price,\r\n			oc.memberCompanyId\r\n		FROM\r\n			(\r\n				SELECT\r\n					c.id,\r\n					c. NAME,\r\n					concat_ws(\r\n						\' \',\r\n						REPLACE (\r\n							REPLACE (\r\n								getDiviParentNameLst (ct.cityId),\r\n								\',\',\r\n								\'\'\r\n							),\r\n							\'市辖区\',\r\n							\'\'\r\n						),\r\n						address\r\n					) address,\r\n					concat_ws(\' \', ct. NAME, ct.mobile) contact,\r\n					u. NAME creater,\r\n					cm.create_time,\r\n					cm.member_company_id\r\n				FROM\r\n					xn_r_company_member cm\r\n				LEFT JOIN xn_m_company c ON cm.member_company_id = c.id\r\n				LEFT JOIN xn_m_user u ON u.id = cm.creater\r\n				LEFT JOIN xn_m_contact_info ct ON ct.id = cm.contact_id\r\n				WHERE\r\n					cm.company_id = \'#companyId#\' and c.name like \'%#companyName#%\' and (ct. NAME like \'%#nameORmobile#%\' or ct.mobile like \'%#nameORmobile#%\')\r\n				AND cm.member_type = \'#memberType#\'\r\n			) c\r\n		LEFT JOIN (\r\n			SELECT\r\n				tc.total_price AS total_price,\r\n				t.carry_company_id,\r\n				CASE #memberType#\r\n			WHEN 2505010 THEN\r\n				t.principal_company_id\r\n			WHEN 2505020 THEN\r\n				t.consignee_company_id\r\n			ELSE\r\n				t.carry_company_id\r\n			END AS memberCompanyId,\r\n			t.principal_company_id AS principal_company_id,\r\n			op.carry_company_id AS carry_parent_company_id,\r\n			op.principal_company_id AS principal_parent_company_id\r\n		FROM\r\n			(\r\n				(\r\n					xn_m_logistics_order t\r\n					LEFT JOIN xn_m_transport_charge tc ON ((t.settle_price_id = tc.id))\r\n				)\r\n				LEFT JOIN xn_m_logistics_order op ON (\r\n					(\r\n						op.id = t.parent_logistics_order_id\r\n					)\r\n				)\r\n			)\r\n		) oc ON c.id = oc.memberCompanyId\r\n		AND (\r\n			oc.carry_company_id = \'#companyId#\'\r\n			OR oc.principal_company_id = \'#companyId#\'\r\n		)\r\n		AND (\r\n			oc.carry_parent_company_id != \'#companyId#\'\r\n			OR oc.carry_parent_company_id IS NULL\r\n		)\r\n		AND (\r\n			oc.principal_parent_company_id != \'#companyId#\'\r\n			OR oc.principal_parent_company_id IS NULL\r\n		)\r\n	) a\r\nGROUP BY\r\n	a. name,creater,create_time\r\nORDER BY\r\n	create_time DESC\r\n', '伙伴导出', '1', null);
INSERT INTO `xn_m_export_template` VALUES ('8', 'user', '公司,姓名,手机号码,公司类型,伙伴关系,认证状态,启用状态,注册日期', 'select c.`name` \'公司\',u.`name` \'姓名\',CONCAT(u.mobile,\'\\t\') \'手机号码\',cd.name \'公司类型\',cc.memberTypeName \'伙伴关系\',\r\ncase ifnull(c.certification_state,0) when 0 then \'未认证\' when 1 then \'已认证\' when 2 then \'认证中\' end \'认证状态\',\r\ncase ifnull(enable_status,1) when 1 then \'启用\' else \'禁用\' end \'启用状态\',\r\nCONCAT(c.create_time,\'\\t\') \'注册日期\'\r\nfrom xn_m_user u\r\nLEFT JOIN xn_m_company c on u.company_id = c.id\r\nleft join xn_m_contact ct on ct.id = c.contact_id\r\nleft join xn_m_company_supply spp on c.id = spp.supply_company_id and spp.company_id = \'#company_id#\'\r\nleft join (\r\nselect DISTINCT c.company_type,d.name \r\nfrom (select company_type from xn_m_company GROUP BY company_type)c\r\nleft join xn_m_dictionary d on c.company_type = d.id\r\n) cd on c.company_type = cd.company_type\r\nleft JOIN\r\n(\r\n	select c.member_company_id,group_concat(c.member_type separator \'|\') memberTypeCode,group_concat(md.name separator \'|\') memberTypeName\r\n	 from (select member_company_id,member_type from xn_r_company_member c\r\n	join xn_m_company c1 on c.company_id = c1.id and ( c1.company_agent_id = \'#company_agent_id#\' or \'\' = \'#company_agent_id#\' )\r\n group by member_company_id,member_type\r\n	union all \r\n	select supply_company_id,\'2505040\' from xn_m_company_supply where company_id = \'#company_id#\'\r\n) c \r\n	LEFT JOIN (\r\n		select  m.member_type,case m.member_type when \'2505040\' then \'供应商\' else d.name end name  from (select member_type from xn_r_company_member group by member_type) m\r\n	left join xn_m_dictionary d  on d.id = m.member_type\r\n	) md on md.member_type = c.member_type\r\n	group by c.member_company_id\r\n) cc on cc.member_company_id = u.company_id\r\nLEFT JOIN xn_m_address a on ct.address_id = a.id\r\n\r\nwhere 1=1 and (ifnull(c.certification_state,0) = \'#certificationState#\'\r\n	or c.certification_state >= case \'#certificationState#\' when \'\' then \'\' else \'5\' end\r\n)\r\nAND(instr(u.mobile,\'#queryStr#\')\r\n				OR instr ( u.`name`,\'#queryStr#\')\r\n				OR instr ( c.`name`,\'#queryStr#\'))\r\nand (c.company_agent_id = \'#company_agent_id#\' or \'\' = \'#company_agent_id#\')\r\nAND (a.administrator_division_id = \'#cityId#\' or \'\' = \'#cityId#\')\r\nAND DATE_FORMAT(u.create_time,\'%Y-%m-%d\') >= case \'#regisStartTime#\' when \'\' then \'2010-01-01\' else  \'#regisStartTime#\' end \r\nAND DATE_FORMAT(u.create_time,\'%Y-%m-%d\') <= case  \'#regisEndTime#\'  when \'\' then \'2099-01-01\' else \'#regisEndTime#\' end\r\nand (c.company_type = \'#companyType#\' or \'\' = \'#companyType#\' )\r\nand (c.id <> \'#company_id#\' or \'\' = \'#company_agent_id#\')\r\nand (instr( memberTypeCode,case \'#partnership_type#\' when \'1\' then \'2505010\' when \'2\' then \'2505020\' when \'3\' then \'2505030\' else \'2505040\' end)>0 or \'#partnership_type#\' = \'\')\r\norder by u.create_time desc;', '用户导出', '1', null);
INSERT INTO `xn_m_export_template` VALUES ('9', 'operateVehicle', '公司,牌照号,GPS设备号,类型,道路运输证号,道路运输证有效期,运营状态,作业状态,默认司机,运输队,归属关系,型号描述,载具所有人,所有人手机号,开户行,银行卡号,载具联系人,联系人手机号,当前位置,常跑城市,承运数,录入人员,注册时间', 'SELECT\r\n	c.`name` \'公司\',\r\n	v.vehicle_code \'牌照号\',\r\n	gps_deviceid \'GPS设备号\',\r\n	d1. NAME \'类型\',\r\n	concat(road_tran_cert_code,\'	\') \'道路运输证号\',\r\n	concat(road_tran_cert_available_date,\'	\') \'道路运输证有效期\',\r\n	CASE v.enable_status\r\nWHEN 0 THEN\r\n	\'停运\'\r\nELSE\r\n	\'正常\'\r\nEND \'运营状态\',\r\n CASE v.enable_status\r\nWHEN 0 THEN\r\n	\'\'\r\nELSE\r\n	(\r\n		CASE is_free\r\n		WHEN 1 THEN\r\n			\'空载\'\r\n		ELSE\r\n			\'满载\'\r\n		END\r\n	)\r\nEND \'作业状态\',\r\n CONCAT_WS(\' \', u.`name`, u.mobile) \'	默认司机\',\r\n tt. NAME \'运输队\',\r\n CASE v.relation_type\r\nWHEN 1 THEN\r\n	\'外协\'\r\nWHEN 2 THEN\r\n	\'自有\'\r\nELSE\r\n	\'其他\'\r\nEND \'归属关系\',\r\n CONCAT_WS(\r\n	\'-\',\r\n	d2. NAME,\r\n	d3. NAME,\r\n	concat(vehicle_tonnage, \'吨\')\r\n) \'	型号描述\',\r\n	cont.`name` \'载具所有人\',\r\n	cont.mobile \'所有人手机号\',\r\n	cv.owner_opening_bank \'开户行\',\r\n	cv.owner_bank_card_code \'银行卡号\',\r\n	cont2.`name` \'载具联系人\',\r\n	cont2.mobile \'联系人手机号\',\r\n v.current_point \'当前位置\',\r\n normalCity \'常跑城市\',\r\n ifnull(v.dispatch_count, 0) \'承运数\',\r\n u2.`name` \'录入人员\',\r\n CONCAT(v.create_time,\'	\') \'注册时间\'\r\nFROM\r\n	xn_m_vehicles v\r\nLEFT JOIN xn_r_company_vehicles cv ON v.id = cv.vehicles_id\r\nLEFT JOIN xn_m_contact cont on cont.id = cv.owner_linkman_id\r\nLEFT JOIN xn_m_contact cont2 on cont2.id = cv.inner_linkman_id\r\nLEFT JOIN xn_m_company c ON cv.company_id = c.id\r\nLEFT JOIN xn_m_driver d ON cv.default_driver_id = d.id\r\nLEFT JOIN xn_m_dictionary d1 ON d1.id = v.vehicles_mode\r\nLEFT JOIN xn_m_dictionary d2 ON d2.id = v.vehicle_type\r\nLEFT JOIN xn_m_dictionary d3 ON d3.id = CASE vehicles_mode\r\nWHEN \'1071000\' THEN\r\n	v.vehicle_length\r\nELSE\r\n	v.ship_zone\r\nEND\r\nLEFT JOIN xn_m_user u ON d.user_id = u.id\r\nLEFT JOIN xn_m_user u2 ON v.creater = u2.id\r\nLEFT JOIN xn_m_transport_team_vehicles ttv ON ttv.vehicle_id = v.id\r\nLEFT JOIN xn_m_transport_team tt ON tt.id = ttv.transport_team_id\r\nLEFT JOIN (\r\n	SELECT\r\n		group_concat(\r\n			REPLACE (\r\n				REPLACE (\r\n					getDiviParentNameLst (administration_division_id),\r\n					\',\',\r\n					\'\'\r\n				),\r\n				\'市辖区\',\r\n				\'\'\r\n			) SEPARATOR \';\'\r\n		) normalCity,\r\n		vehicles_id\r\n	FROM\r\n		xn_r_vehicles_direction\r\n	GROUP BY\r\n		vehicles_id\r\n) vd ON (\r\n	vd.vehicles_id = v.id\r\n	OR vd.vehicles_id IS NULL\r\n)\r\nWHERE\r\n	1 = 1\r\nAND c.company_agent_id = \'#companyAgentId#\'\r\nAND c.`name` LIKE \'%#companyName#%\'\r\nAND vehicle_code LIKE \'%#vehicleCode#%\'\r\nAND ifnull(v.current_point, \'\') LIKE \'%#deliveryCityCode#%\'\r\nAND IFNULL(ttv.transport_team_id, \'\') LIKE \'%#teamID#%\'\r\nAND v.vehicles_mode LIKE \'%#vehiclesMode#%\'\r\nAND v.relation_type LIKE \'%#relationType#%\'\r\nORDER BY is_free DESC, v.modify_time DESC;', '运营载具导出', '2', null);

-- ----------------------------
-- Table structure for xn_m_file
-- ----------------------------
