DROP TABLE IF EXISTS `xn_m_goods`;
CREATE TABLE `xn_m_goods` (
  `id` char(22) NOT NULL,
  `name` varchar(512) DEFAULT NULL,
  `total_goods_measuring_id` char(22) DEFAULT NULL,
  `commissioned_goods_measuring_id` char(22) DEFAULT NULL,
  `code` varchar(64) DEFAULT NULL,
  `creater` char(22) NOT NULL,
  `create_time` datetime DEFAULT NULL,
  `modifier` char(22) DEFAULT NULL,
  `modify_time` datetime DEFAULT NULL,
  `ver` bigint(20) DEFAULT NULL,
  `valuation_mode` bigint(20) DEFAULT NULL,
  `relate_goods_id` char(22) DEFAULT NULL,
  `model` varchar(512) DEFAULT NULL,
  `parent_id` char(22) DEFAULT NULL,
  `flag` bigint(20) DEFAULT '0',
  `quantity_unit_id` bigint(20) DEFAULT NULL,
  `weight` decimal(10,2) DEFAULT NULL,
  `length` decimal(10,2) DEFAULT NULL,
  `width` decimal(10,2) DEFAULT NULL,
  `height` decimal(10,2) DEFAULT NULL,
  `extend_param` varchar(256) DEFAULT NULL COMMENT '西本扩展字段',
  PRIMARY KEY (`id`),
  KEY `R_35` (`total_goods_measuring_id`),
  KEY `R_63` (`commissioned_goods_measuring_id`),
  KEY `R_320` (`valuation_mode`),
  KEY `xn_m_goods_ibfk_4` (`quantity_unit_id`),
  CONSTRAINT `xn_m_goods_ibfk_1` FOREIGN KEY (`total_goods_measuring_id`) REFERENCES `xn_m_goods_measuring` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_goods_ibfk_2` FOREIGN KEY (`commissioned_goods_measuring_id`) REFERENCES `xn_m_goods_measuring` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_goods_ibfk_3` FOREIGN KEY (`valuation_mode`) REFERENCES `xn_m_dictionary` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_goods_ibfk_4` FOREIGN KEY (`quantity_unit_id`) REFERENCES `xn_m_dictionary` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

