-- ----------------------------
-- Table structure for xn_m_message
-- ----------------------------
DROP TABLE IF EXISTS `xn_m_message`;
CREATE TABLE `xn_m_message` (
  `id` char(22) NOT NULL,
  `content` varchar(1024) DEFAULT NULL,
  `send_user_id` char(22) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `creater` char(22) NOT NULL,
  `modifier` char(22) DEFAULT NULL,
  `modify_time` datetime DEFAULT NULL,
  `ver` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `R_24` (`send_user_id`),
  CONSTRAINT `xn_m_message_ibfk_1` FOREIGN KEY (`send_user_id`) REFERENCES `xn_m_user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of xn_m_message
-- ----------------------------

-- ----------------------------
-- Table structure for xn_m_message_blacklist
-- ----------------------------
DROP TABLE IF EXISTS `xn_m_message_blacklist`;
CREATE TABLE `xn_m_message_blacklist` (
  `id` char(22) NOT NULL,
  `mobile` varchar(32) DEFAULT NULL,
  `message_template_id` char(22) DEFAULT NULL,
  `creater` varchar(64) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `modifier` varchar(64) DEFAULT NULL,
  `modify_time` datetime DEFAULT NULL,
  `ver` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `R_348` (`message_template_id`),
  CONSTRAINT `xn_m_message_blacklist_ibfk_1` FOREIGN KEY (`message_template_id`) REFERENCES `xn_m_message_template` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of xn_m_message_blacklist
-- ----------------------------

-- ----------------------------
-- Table structure for xn_m_message_template
-- ----------------------------
DROP TABLE IF EXISTS `xn_m_message_template`;
CREATE TABLE `xn_m_message_template` (
  `id` char(22) NOT NULL,
  `name` varchar(128) DEFAULT NULL,
  `content` varchar(1024) DEFAULT NULL,
  `description` varchar(128) DEFAULT NULL,
  `ver` bigint(20) DEFAULT NULL,
  `creater` varchar(64) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `modifier` varchar(64) DEFAULT NULL,
  `modify_time` datetime DEFAULT NULL,
  `language` varchar(32) DEFAULT NULL,
  `code` varchar(32) DEFAULT NULL,
  `type` varchar(50) DEFAULT NULL COMMENT '模板类型：第一位表示短信 1 为短信模板，0 非模板；第二位为app模板，1位app模板，0 非模板',
  `is_setting` bigint(20) DEFAULT '0' COMMENT '1 为用户可设置的模板，0为系统模板，即不可设置',
  `is_delete` bigint(20) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

