  `payable_amount` decimal(10,2) DEFAULT NULL COMMENT '应付金额',
  `settle_amount` decimal(10,2) DEFAULT NULL COMMENT '结算金额',
  `paid_amount` decimal(10,2) DEFAULT NULL COMMENT '付款金额',
  `customer_product_id` char(22) DEFAULT NULL COMMENT '订阅管理ID',
