  `modifier` varchar(64) DEFAULT NULL COMMENT '修改人',
  `modify_time` datetime DEFAULT NULL COMMENT '修改时间',
  `ver` bigint(20) DEFAULT NULL COMMENT '版本号',
  `effect_status` bigint(20) DEFAULT NULL,
  `is_valid` bigint(20) DEFAULT NULL,
  `invalid_status` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `xn_m_payment_ibfk_1` (`oper_user_id`),
  KEY `xn_m_payment_ibfk_2` (`customer_product_id`),
  CONSTRAINT `xn_m_payment_ibfk_1` FOREIGN KEY (`oper_user_id`) REFERENCES `xn_m_user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_payment_ibfk_2` FOREIGN KEY (`customer_product_id`) REFERENCES `xn_r_customer_product` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='缴费记录表';

