INSERT INTO `xn_m_pa_cargo_type` VALUES ('x0F8uMC-RaeeZUl81GqadQ', '手机办公&家用电器类', '全新的普通机械设备；电力、通信、广播电视设备；医疗器械；仪器、仪表、量具；洗衣机、冰箱、电视机、空调；文教用品，纸浆、纸及纸制品', '16', '8402');
