DROP TABLE IF EXISTS `xn_m_vehicle_repair`;
CREATE TABLE `xn_m_vehicle_repair` (
  `id` char(22) NOT NULL,
  `company_id` char(22) NOT NULL COMMENT '公司id',
  `code` varchar(64) DEFAULT NULL COMMENT '维修单号',
  `repair_type` bigint(20) NOT NULL COMMENT '维修类型',
  `repair_factory_id` char(22) DEFAULT NULL COMMENT '维修厂id',
  `repair_user_id` char(22) DEFAULT NULL COMMENT '维修人员id',
  `vehicle_id` char(22) NOT NULL COMMENT '载具id',
  `driver_id` char(22) NOT NULL COMMENT '送修司机id',
  `repair_subject` varchar(512) NOT NULL COMMENT '维修项目',
  `labor_cost` decimal(20,2) DEFAULT NULL COMMENT '人工费',
  `subtotal_price` decimal(20,2) DEFAULT NULL COMMENT '费用总计',
  `agent_id` char(22) NOT NULL COMMENT '经办人id',
  `repair_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '送修时间',
  `remark` varchar(512) DEFAULT NULL COMMENT '备注',
  `is_delete` bigint(20) DEFAULT '0' COMMENT '是否删除',
  `creater` varchar(22) DEFAULT NULL,
  `create_time` timestamp NULL DEFAULT NULL,
  `modifier` varchar(22) DEFAULT NULL,
  `modify_time` timestamp NULL DEFAULT NULL,
  `ver` bigint(20) DEFAULT NULL,
  `merger_comment` varchar(256) DEFAULT NULL COMMENT '公司合并备注：公司A:公司B A合并到B',
  `repair_reason` varchar(256) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `xn_m_vehicle_repair_ibfk_1` (`company_id`),
  KEY `xn_m_vehicle_repair_ibfk_2` (`repair_factory_id`),
  KEY `xn_m_vehicle_repair_ibfk_3` (`repair_user_id`),
  KEY `xn_m_vehicle_repair_ibfk_4` (`vehicle_id`),
  KEY `xn_m_vehicle_repair_ibfk_5` (`driver_id`),
  KEY `xn_m_vehicle_repair_ibfk_6` (`agent_id`),
  CONSTRAINT `xn_m_vehicle_repair_ibfk_1` FOREIGN KEY (`company_id`) REFERENCES `xn_m_company` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_vehicle_repair_ibfk_2` FOREIGN KEY (`repair_factory_id`) REFERENCES `xn_m_company` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_vehicle_repair_ibfk_3` FOREIGN KEY (`repair_user_id`) REFERENCES `xn_m_user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_vehicle_repair_ibfk_4` FOREIGN KEY (`vehicle_id`) REFERENCES `xn_m_vehicles` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_vehicle_repair_ibfk_5` FOREIGN KEY (`driver_id`) REFERENCES `xn_m_driver` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `xn_m_vehicle_repair_ibfk_6` FOREIGN KEY (`agent_id`) REFERENCES `xn_m_user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

