DROP VIEW IF EXISTS `xn_m_address_info`;
CREATE  VIEW `xn_m_address_info` AS select `ad`.`id` AS `addressID`,`ad`.`street_name` AS `address`,`adm`.`id` AS `cityId`,`adm`.`name` AS `cityName`,`adm`.`short_name` AS `cityShortName`,`adm`.`administration_division_code` AS `cityCode`,`adms`.`id` AS `secondCityId`,`adms`.`name` AS `secondCityName`,`adms`.`short_name` AS `secondCityShortName`,`adms`.`administration_division_code` AS `secondCityCode`,`admf`.`id` AS `firstCityId`,`admf`.`name` AS `firstCityName`,`admf`.`short_name` AS `firstCityShortName`,`admf`.`administration_division_code` AS `firstCityCode` from (((`xn_m_address` `ad` left join `xn_m_administration_division` `adm` on((`ad`.`administrator_division_id` = `adm`.`id`))) left join `xn_m_administration_division` `adms` on((`adm`.`parent_administration_division_id` = `adms`.`id`))) left join `xn_m_administration_division` `admf` on((`adms`.`parent_administration_division_id` = `admf`.`id`))) ;

