-- View structure for xn_m_contact_info
-- ----------------------------
DROP VIEW IF EXISTS `xn_m_contact_info`;
CREATE  VIEW `xn_m_contact_info` AS select `c`.`id` AS `id`,`c`.`user_id` AS `user_id`,`c`.`name` AS `name`,`c`.`mobile` AS `mobile`,`c`.`company` AS `companyName`,`c`.`fixed_telephone` AS `fixed_telephone`,`av`.`addressID` AS `addressID`,`av`.`address` AS `address`,`av`.`cityId` AS `cityId`,`av`.`cityName` AS `cityName`,`av`.`cityShortName` AS `cityShortName`,`av`.`cityCode` AS `cityCode` from (`xn_m_contact` `c` left join `xn_m_address_info` `av` on((`c`.`address_id` = `av`.`addressID`))) ;

-- ----------------------------
-- View structure for xn_m_dispatch_info
-- ----------------------------
DROP VIEW IF EXISTS `xn_m_dispatch_info`;
CREATE  VIEW `xn_m_dispatch_info` AS select `d`.`id` AS `id`,`d`.`parent_dispatch_id` AS `parent_dispatch_id`,`d`.`dispatch_code` AS `dispatch_code`,`d`.`create_time` AS `create_time`,`d`.`logistics_order_id` AS `logistics_order_id`,`d`.`plan_departure_date` AS `plan_departure_date`,`d`.`plan_arrival_date` AS `plan_arrival_date`,`d`.`real_departure_date` AS `real_departure_date`,`d`.`real_arrival_date` AS `real_arrival_date`,`d`.`signed_time` AS `signed_time`,`d`.`signed_passwd` AS `signed_passwd`,`d`.`signed_comment` AS `signed_comment`,`d`.`load_profile_photo_id` AS `load_profile_photo_id`,`d`.`load_tail_photo_id` AS `load_tail_photo_id`,`d`.`unload_profile_photo_id` AS `unload_profile_photo_id`,`d`.`unload_tail_photo_id` AS `unload_tail_photo_id`,`d`.`receipt_sign_photo_id` AS `receipt_sign_photo_id`,`d`.`receipt_group_photo_id` AS `receipt_group_photo_id`,`d`.`consignee_id` AS `consignee_id`,`d`.`send_address_id` AS `send_address_id`,`d`.`receive_address_id` AS `receive_address_id`,`d`.`dispatch_batch_id` AS `dispatch_batch_id`,`d`.`is_destination` AS `is_destination`,`d`.`sender_id` AS `sender_id`,`d`.`delivery_mode` AS `delivery_mode`,`d`.`code` AS `code`,`d`.`creater` AS `creater`,`d`.`modifier` AS `modifier`,`d`.`modify_time` AS `modify_time`,`d`.`ver` AS `ver`,`d`.`delivery_outlets_id` AS `delivery_outlets_id`,`d`.`arrival_outlets_id` AS `arrival_outlets_id`,`d`.`auth_code` AS `auth_code`,`d`.`rht` AS `rht`,`d`.`lft` AS `lft`,`d`.`node_ver` AS `node_ver`,`d`.`appkey` AS `appkey`,`d`.`is_registered` AS `is_registered`,`d`.`signed_user_name` AS `signed_user_name`,`d`.`signed_id_card_no` AS `signed_id_card_no`,`d`.`signed_agent` AS `signed_agent`,`d`.`register_id` AS `register_id`,`d`.`register_time` AS `register_time`,`d`.`is_warn` AS `is_warn`,`d`.`distance` AS `distance`,`d`.`is_more_photo` AS `is_more_photo`,`d`.`dept_handover_mode` AS `dept_handover_mode`,`d`.`signed_handover_mode` AS `signed_handover_mode`,`d`.`dept_qrcode_id` AS `dept_qrcode_id`,`d`.`sign_qrcode_id` AS `sign_qrcode_id`,`d`.`dept_lon_lat` AS `dept_lon_lat`,`d`.`signed_lon_lat` AS `signed_lon_lat`,`d`.`dept_lon_lat_addr` AS `dept_lon_lat_addr`,`d`.`signed_lon_lat_addr` AS `signed_lon_lat_addr`,`d`.`cost_price` AS `cost_price`,`d`.`arrival_forecast_notice` AS `arrival_forecast_notice`,`ca`.`id` AS `consigneeAddressID`,`ca`.`administrator_division_id` AS `consigneeCityCode`,`ca`.`street_name` AS `consigneeAddress`,`ct`.`id` AS `consigneeID`,`ct`.`user_id` AS `consigneeUserID`,`ct`.`name` AS `consigneeName`,`ct`.`mobile` AS `consigneeMobile`,`ct`.`fixed_telephone` AS `consigneeTel`,`ct`.`company` AS `consigneeCompanyName`,`sa`.`id` AS `senderAddressID`,`sa`.`administrator_division_id` AS `senderCityCode`,`sa`.`street_name` AS `senderAddress`,`st`.`id` AS `senderID`,`st`.`user_id` AS `senderUserID`,`st`.`name` AS `senderName`,`st`.`mobile` AS `senderMobile`,`st`.`fixed_telephone` AS `senderTel`,`st`.`company` AS `senderCompanyName`,`dsh`.`dispatch_status` AS `dispatchStatus`,`dsh`.`create_time` AS `dshCreateTime`,`ba`.`busi_audit_status` AS `businessAudit`,`ba`.`busi_audit_desc` AS `auditOpinion`,`us`.`name` AS `auditor`,`ba`.`busi_audit_time` AS `AuditTime` from (((((((`xn_m_dispatch` `d` join `xn_m_dispatch_status_his` `dsh` on(((`dsh`.`dispatch_id` = `d`.`id`) and (`dsh`.`is_valid` = 1)))) join `xn_m_contact` `ct` on((`ct`.`id` = `d`.`consignee_id`))) join `xn_m_address` `ca` on((`ca`.`id` = `d`.`receive_address_id`))) join `xn_m_contact` `st` on((`st`.`id` = `d`.`sender_id`))) join `xn_m_address` `sa` on((`sa`.`id` = `d`.`send_address_id`))) join `xn_m_dispatch_batch` `ba` on((`ba`.`id` = `d`.`dispatch_batch_id`))) left join `xn_m_user` `us` on((`us`.`id` = `ba`.`busi_audit_user_id`))) where (`d`.`parent_dispatch_id` is not null) ;

