CREATE  VIEW `xn_m_order_info` AS (select `o`.`id` AS `id`,`o`.`sender_id` AS `sender_id`,`o`.`sender_company_id` AS `sender_company_id`,`o`.`consignee_id` AS `consignee_id`,`o`.`consignee_company_id` AS `consignee_company_id`,`o`.`principal_company_id` AS `principal_company_id`,`pcy`.`name` AS `principal_company_name`,`o`.`carry_company_id` AS `carry_company_id`,`ccy`.`name` AS `carry_company_name`,`o`.`delivery_mode` AS `delivery_mode`,`o`.`invoice_reqest` AS `invoice_reqest`,`o`.`comment` AS `comment`,`o`.`principal_user_id` AS `principal_user_id`,`o`.`create_time` AS `create_time`,`o`.`contract_price_id` AS `contract_price_id`,`o`.`settle_price_id` AS `settle_price_id`,`o`.`send_address_id` AS `send_address_id`,`o`.`receive_address_id` AS `receive_address_id`,`o`.`code` AS `code`,`o`.`origin_id` AS `origin_id`,`o`.`order_origin` AS `order_origin`,`o`.`creater` AS `creater`,`o`.`modifier` AS `modifier`,`o`.`modify_time` AS `modify_time`,`o`.`ver` AS `ver`,`o`.`delivery_outlets_id` AS `delivery_outlets_id`,`o`.`arrival_outlets_id` AS `arrival_outlets_id`,`o`.`auth_code` AS `auth_code`,`o`.`carry_user_id` AS `carry_user_id`,`o`.`appkey` AS `appkey`,`o`.`lft` AS `lft`,`o`.`rht` AS `rht`,`o`.`node_ver` AS `node_ver`,`o`.`parent_logistics_order_id` AS `parent_logistics_order_id`,`o`.`is_total` AS `is_total`,`o`.`loading_needs` AS `loading_needs`,`o`.`delivery_date` AS `delivery_date`,`o`.`arrival_date` AS `arrival_date`,`o`.`distance` AS `distance`,`o`.`operate_type` AS `operate_type`,`o`.`execute_result` AS `execute_result`,`o`.`is_delete` AS `is_delete`,`o`.`transport_mode` AS `transport_mode`,`o`.`root_order_id` AS `root_order_id`,`o`.`order_type` AS `order_type`,`o`.`is_split` AS `is_split`,`o`.`sales_user_id` AS `sales_user_id`,`o`.`trade_time` AS `trade_time`,`o`.`signer_code` AS `signer_code`,`o`.`valuation_mode` AS `valuation_mode`,`o`.`brokerage_money` AS `brokerage_money`,`o`.`is_destination` AS `is_destination`,`o`.`is_instock` AS `is_instock`,`o`.`sms_notify_count` AS `sms_notify_count`,`o`.`brokerage_subject_id` AS `brokerage_subject_id`,`o`.`merger_comment` AS `merger_comment`,`o`.`agent_id` AS `agent_id`,`o`.`receive_lon_lat` AS `receive_lon_lat`,`o`.`send_lon_lat` AS `send_lon_lat`,`o`.`urgent_level` AS `urgent_level`,`o`.`outer_code` AS `outer_code`,`st`.`name` AS `senderName`,`st`.`mobile` AS `senderMobile`,`st`.`fixed_telephone` AS `senderTel`,`st`.`user_id` AS `senderUserID`,`st`.`fax` AS `senderFax`,`sendercy`.`name` AS `senderCompanyName`,`sa`.`administrator_division_id` AS `senderAdminDiviId`,`sa`.`street_name` AS `senderStreet`,`sa`.`id` AS `senderAddressId`,`ct`.`name` AS `consigneeName`,`ct`.`mobile` AS `consigneeMobile`,`ct`.`fixed_telephone` AS `consigneeTel`,`ct`.`user_id` AS `consigneeUserID`,`ct`.`fax` AS `consigneeFax`,`consigneecy`.`name` AS `consigneeCompanyName`,`ca`.`administrator_division_id` AS `consigneeAdminDiviId`,`ca`.`street_name` AS `consigneeStreet`,`ca`.`id` AS `consigneeAddressId`,`osh`.`logistics_order_status` AS `orderStatus`,`osh`.`create_time` AS `orderStatusCreateTime`,`o`.`busi_audit_status` AS `businessAudit`,`o`.`busi_audit_desc` AS `auditOpinion`,`us`.`name` AS `auditor`,`o`.`busi_audit_time` AS `AuditTime` from ((((((((((`xn_m_logistics_order` `o` left join `xn_m_company` `ccy` on((`ccy`.`id` = `o`.`carry_company_id`))) left join `xn_m_company` `pcy` on((`pcy`.`id` = `o`.`principal_company_id`))) left join `xn_m_company` `sendercy` on((`sendercy`.`id` = `o`.`sender_company_id`))) left join `xn_m_company` `consigneecy` on((`consigneecy`.`id` = `o`.`consignee_company_id`))) left join `xn_m_contact` `ct` on((`o`.`consignee_id` = `ct`.`id`))) left join `xn_m_address` `ca` on((`ct`.`address_id` = `ca`.`id`))) left join `xn_m_contact` `st` on((`o`.`sender_id` = `st`.`id`))) left join `xn_m_address` `sa` on((`st`.`address_id` = `sa`.`id`))) left join `xn_m_user` `us` on((`us`.`id` = `o`.`busi_audit_user_id`))) left join `xn_m_logistics_order_status_his` `osh` on(((`osh`.`logistics_order_id` = `o`.`id`) and (`osh`.`status_type` = 1))))) ;

