DROP VIEW IF EXISTS `xn_m_process_list`;
CREATE  VIEW `xn_m_process_list` AS select `p`.`id` AS `id`,`p`.`process_name` AS `process_name`,`p`.`process_type` AS `process_type`,`p`.`status` AS `status`,`p`.`message` AS `message`,`p`.`user_id` AS `user_id`,`p`.`main_index` AS `main_index`,`p`.`main_attr` AS `main_attr`,`p`.`main_api` AS `main_api`,`p`.`create_time` AS `create_time`,`ua`.`token` AS `token`,`a`.`appkey` AS `appkey`,`a`.`private_key` AS `private_key` from ((`xn_m_process` `p` join `xn_m_user_app` `ua` on((`ua`.`user_id` = `p`.`user_id`))) join `xn_m_app` `a` on(((`a`.`id` = `ua`.`app_id`) and (`a`.`appkey` = `p`.`app_key`)))) where (`ua`.`device_type` = 'web') ;

-- ----------------------------
-- Procedure structure for func_company
-- ----------------------------
DROP PROCEDURE IF EXISTS `func_company`;
DELIMITER ;;
CREATE  PROCEDURE `func_company`()
BEGIN
	DECLARE isend INT DEFAULT 0;
	DECLARE companyId char(22) DEFAULT '';
	DECLARE cur CURSOR FOR SELECT company_id FROM ( SELECT * FROM xn_r_func_auth_company GROUP BY company_id ) t1 LEFT JOIN xn_m_company t2 ON t1.company_id = t2.id WHERE t2.company_agent_id != ( SELECT id FROM xn_m_company_agent WHERE `code` = 'XNDY' ) OR t2.company_agent_id IS NULL;
	DECLARE CONTINUE HANDLER FOR NOT FOUND set isend=1;
	open cur;
	FETCH cur into companyId;
	while isend!=1 do
		INSERT INTO xn_r_func_auth_company(id,func_auth_id,company_id) VALUES (SUBSTR(UUID(),1,22),'UEbeLRqkSdacXFRJ1S0dSQ',companyId);
	FETCH cur into companyId;	
	end WHILE;
	close cur;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for func_signCustomer
-- ----------------------------
DROP PROCEDURE IF EXISTS `func_signCustomer`;
DELIMITER ;;
CREATE  PROCEDURE `func_signCustomer`()
BEGIN
	DECLARE isend INT DEFAULT 0;
	DECLARE customerId char(22) DEFAULT '';
	DECLARE cur CURSOR FOR SELECT sign_customer_id FROM xn_r_sign_customer_func_auth WHERE sign_customer_id != ( SELECT id FROM xn_m_sign_customer WHERE company_id = ( SELECT company_id FROM xn_m_company_agent WHERE `code` = 'XNDY' )) GROUP BY sign_customer_id;
	DECLARE CONTINUE HANDLER FOR NOT FOUND set isend=1;
	open cur;
	FETCH cur into customerId;
	while isend!=1 do
		INSERT INTO xn_r_sign_customer_func_auth(func_auth_id,sign_customer_id,id) VALUES('UEbeLRqkSdacXFRJ1S0dSQ',customerId,SUBSTR(UUID(),1,22));
	FETCH cur into customerId;	
	end WHILE;
	close cur;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for pro_run_old_statistics
-- ----------------------------
DROP PROCEDURE IF EXISTS `pro_run_old_statistics`;
DELIMITER ;;
CREATE  PROCEDURE `pro_run_old_statistics`(
IN in_start_date date,IN in_end_date date,OUT res int(11))
    SQL SECURITY INVOKER
BEGIN
	DECLARE v_start_date date ;  
 	DECLARE v_end_date date DEFAULT now();  
	
	set  v_start_date = in_start_date;
	set v_end_date = in_end_date;
	-- DELETE from xn_m_statistics ;
	while v_start_date < v_end_date do
		call pro_statistics(DATE_FORMAT(v_start_date,'%Y-%m-%d') , DATE_FORMAT(now(),'%Y%m%d%H%i%s'),@res2);
		set v_start_date =  DATE_ADD(v_start_date,INTERVAL 1 DAY);
	end while;
	
	 -- 结尾返回
	set res =1 ;	
	select res;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for pro_statistics
-- ----------------------------
DROP PROCEDURE IF EXISTS `pro_statistics`;
DELIMITER ;;
CREATE  PROCEDURE `pro_statistics`(IN `in_statistics_date` VARCHAR(20), IN `in_batch_code` VARCHAR(20), OUT `@res` INT)
BEGIN
	
	DECLARE v_curr_date datetime DEFAULT now(); 
	DECLARE v_company_id char(22); 
	DECLARE v_carriers_id char(22);
	DECLARE v_goods_supply_num int;
	DECLARE v_count_num int DEFAULT 0;
	DECLARE v_num int;
  DECLARE v_quoted_total_max decimal(20,5);
	DECLARE v_quoted_total_avg decimal(20,5);
	DECLARE v_quoted_total_winning decimal(20,5);
	DECLARE v_total decimal(20,5);

	DECLARE v_plan_sum_weight_ton decimal(20,5);
	DECLARE v_plan_sum_weight decimal(20,5);
	DECLARE v_plan_sum_quantity decimal(20,5);
	DECLARE v_real_sum_weight_ton decimal(20,5);
	DECLARE v_real_sum_weight decimal(20,5);
	DECLARE v_real_sum_quantity decimal(20,5);
	DECLARE v_signed_sum_weight_ton decimal(20,5);
	DECLARE v_signed_sum_weight decimal(20,5);
	DECLARE v_signed_sum_quantity decimal(20,5);
	DECLARE v_plan_sum_volume decimal(20,5);
	DECLARE v_real_sum_volume decimal(20,5);
	DECLARE v_signed_sum_volume decimal(20,5);


	DECLARE v_carry_order_weight_ton decimal(20,5);
	DECLARE v_carry_order_sum_weight decimal(20,5);
	DECLARE v_carry_order_sum_volume decimal(20,5);
	DECLARE v_carry_order_sum_quantity decimal(20,5);

	DECLARE v_principal_order_weight_ton decimal(20,5);
	DECLARE v_principal_order_sum_weight decimal(20,5);
	DECLARE v_principal_order_sum_volume decimal(20,5);
	DECLARE v_principal_order_sum_quantity decimal(20,5);
	
	
	DECLARE v_exec_sql varchar(200); 
	DECLARE v_error_desc varchar(200); 

	-- 异常标志，默认为0，出现异常 值为1；
	DECLARE error_falg INTEGER DEFAULT 0;
 
		 -- 遍历数据结束标志
  DECLARE done INT DEFAULT FALSE;

	  
	 -- 定义 游标 开始
	 	/** 货源数量**/
  DECLARE cur_goods_supply CURSOR FOR  
	select  t0.principal_company_id ,	count(t0.id) goods_supply_num   			
 		from xn_m_goods_supply t0 		 						  	 
		where DATE_FORMAT( t0.create_time,'%Y-%m-%d')  = in_statistics_date	
				and (t0.bid_type = 2527010 or t0.bid_type is null)
				and t0.principal_company_id is not null
		group by t0.principal_company_id;  
			
	/** 报价数量**/
	DECLARE cur_goods_supply_quoted CURSOR FOR  
	 select  gsq.quotation_company_id ,count( gsq.id  )	
	 from xn_m_goods_supply_quotation gsq
		inner join xn_m_goods_supply gs on gs.id = gsq.goods_supply_id
		where DATE_FORMAT( gsq.create_time,'%Y-%m-%d')  = in_statistics_date	
			group by gsq.quotation_company_id; 

		/** 承运订单数量**/
		DECLARE cur_order_principal CURSOR FOR  	
 		select lo.principal_company_id , count(lo.id) ,sum(tc.total_price)
			from xn_m_logistics_order  lo
			inner join xn_m_company c2 on c2.id  = lo.principal_company_id
			inner join xn_m_logistics_order_status_his loh on (lo.id = loh.logistics_order_id and loh.logistics_order_status != 1121070 and loh.status_type = 1)
			inner join xn_m_transport_charge tc on tc.id = lo.contract_price_id
			where DATE_FORMAT( lo.create_time,'%Y-%m-%d')  = in_statistics_date
			group by  lo.principal_company_id ; 

		/** 承运订单计量 **/
		DECLARE cur_order_principal_measuring CURSOR FOR  	
 		select lo.principal_company_id
				, sum( if(lo.valuation_mode=1131000 ,gm.weight , null )) principal_order_weight_ton
				, sum( if(lo.valuation_mode=1131020 ,gm.weight,null)  ) principal_order_sum_weight
				, sum( if(lo.valuation_mode=1131010 ,gm.volume ,null ) ) principal_order_sum_volume
				, sum( gm.quantity ) principal_order_sum_quantity
			from xn_m_logistics_order  lo
			inner join xn_m_company c2 on c2.id  = lo.principal_company_id
			inner join xn_m_logistics_order_status_his loh on (lo.id = loh.logistics_order_id and loh.logistics_order_status != 1121070 and loh.status_type = 1)
			inner join xn_r_logistics_order_goods log on lo.id = log.logistics_order_id
			inner join xn_m_goods_measuring gm on log.commissioned_goods_measuring_id = gm.id
			where DATE_FORMAT( lo.create_time,'%Y-%m-%d')  = in_statistics_date
			group by  lo.principal_company_id ;

		/** 委托订单数量**/
		DECLARE cur_order_carry CURSOR FOR  	
 		select lo.carry_company_id , count(lo.id) ,sum(tc.total_price)
			from xn_m_logistics_order  lo
			inner join xn_m_company c2 on c2.id  = lo.carry_company_id
			inner join xn_m_logistics_order_status_his loh on (lo.id = loh.logistics_order_id and loh.logistics_order_status != 1121070 and loh.status_type = 1)
			inner join xn_m_transport_charge tc on tc.id = lo.contract_price_id
			where DATE_FORMAT( lo.create_time,'%Y-%m-%d')  = in_statistics_date
			group by  lo.carry_company_id ; 

		/** 委托订单计量**/
		DECLARE cur_order_carry_measuring CURSOR FOR  	
 		select lo.carry_company_id
				, sum( if(lo.valuation_mode=1131000 ,gm.weight , null )) carry_order_weight_ton
				, sum( if(lo.valuation_mode=1131020 ,gm.weight,null)  ) carry_order_sum_weight
				, sum( if(lo.valuation_mode=1131010 ,gm.volume ,null ) ) carry_order_sum_volume
				, sum( gm.quantity ) carry_order_sum_quantity
			from xn_m_logistics_order  lo
			inner join xn_m_company c2 on c2.id  = lo.carry_company_id
			inner join xn_m_logistics_order_status_his loh on (lo.id = loh.logistics_order_id and loh.logistics_order_status != 1121070 and loh.status_type = 1)
			inner join xn_r_logistics_order_goods log on lo.id = log.logistics_order_id
			inner join xn_m_goods_measuring gm on log.commissioned_goods_measuring_id = gm.id
			where DATE_FORMAT( lo.create_time,'%Y-%m-%d')  = in_statistics_date
			group by  lo.carry_company_id ; 
	
		/** 调度批次数量 委托人**/	
		DECLARE cur_dispatch_batch_principal CURSOR FOR  			
		select lo.principal_company_id , count(d.id)  		 
 		from xn_m_dispatch_batch  db 		 						  	 
		INNER JOIN xn_m_dispatch d    on d.dispatch_batch_id = db.id
		INNER JOIN xn_m_logistics_order  lo   on lo.id = d.logistics_order_id
		where DATE_FORMAT( db.create_time,'%Y-%m-%d')  = in_statistics_date		
		group by lo.principal_company_id ; 

		/** 调度批次数量 承运人**/	
		DECLARE cur_dispatch_batch_carry CURSOR FOR  			
		select lo.carry_company_id , count(d.id)  		 
 		from xn_m_dispatch_batch  db 		 						  	 
		INNER JOIN xn_m_dispatch d    on d.dispatch_batch_id = db.id
		INNER JOIN xn_m_logistics_order  lo   on lo.id = d.logistics_order_id
		where DATE_FORMAT( db.create_time,'%Y-%m-%d')  = in_statistics_date		
		group by lo.carry_company_id ; 
		
	/** 货源中标数量**/
		DECLARE cur_goods_supply_winning CURSOR FOR  
		select  t0.principal_company_id  ,	count(t0.id) failed_tenders_num   			
 		from xn_m_goods_supply t0 		 						  	 
		where DATE_FORMAT( t0.modify_time,'%Y-%m-%d')  = in_statistics_date		
				and t0.`status` = '2131010'
				and (t0.bid_type = 2527010 or t0.bid_type is null)
				and t0.principal_company_id is not null
		group by t0.principal_company_id ;
		 
		/** 货源流标数量**/
		DECLARE cur_goods_supply_failed CURSOR FOR  
		select  t0.principal_company_id  ,	count(t0.id) failed_tenders_num   			
 		from xn_m_goods_supply t0 		 						  	 
		where DATE_FORMAT( t0.modify_time,'%Y-%m-%d')  = in_statistics_date		
				and t0.`status` = '2131040'
				and (t0.bid_type = 2527010 or t0.bid_type is null)
				and t0.principal_company_id is not null
		group by t0.principal_company_id ;  

		/** 货源的报价 最大 平均 中标**/
		DECLARE cur_goods_supply_quoted_total CURSOR FOR  
		select tt.principal_company_id , truncate(max(tt.goods_supply_quoted_max),6 ) goods_quoted_max  , 
			truncate(	avg(tt.goods_supply_quoted_avg) ,6) goods_quoted_avg  , 
			truncate(avg(tt.goods_supply_quoted_winning),6) goods_quoted_winning   
			from (
					SELECT t0.principal_company_id ,gsq.goods_supply_id, MAX(gsq.total_price) goods_supply_quoted_max, AVG(gsq.total_price) goods_supply_quoted_avg
					, (
					SELECT AVG(gsq2.total_price)
					FROM xn_m_goods_supply_quotation gsq2
					INNER JOIN xn_m_goods_supply t1 on t1.id = gsq2.goods_supply_id
					where  DATE_FORMAT( gsq2.create_time,'%Y-%m-%d')  = '2017-03-06'
						and (t1.bid_type = 2527010 or t1.bid_type is null)
						and t1.status = 2131010
						and gsq2.quotation_status =2
						and t1.principal_company_id = t0.principal_company_id
					) goods_supply_quoted_winning
					
					FROM xn_m_goods_supply_quotation gsq
					INNER JOIN xn_m_goods_supply t0 on t0.id = gsq.goods_supply_id
					where  DATE_FORMAT( gsq.create_time,'%Y-%m-%d')  = in_statistics_date
						and (t0.bid_type = 2527010 or t0.bid_type is null)
						and t0.status = 2131010
					GROUP BY t0.principal_company_id , gsq.goods_supply_id  
			 ) tt
				GROUP BY tt.principal_company_id;

				/** 委托订单 执行中 数据 和 合同价格 **/
				DECLARE cur_order_execute_principal CURSOR FOR  
				 select lo.principal_company_id ,count(distinct lo.id) ,sum(tc.total_price)  
				 from  xn_m_logistics_order lo
				 inner join xn_m_logistics_order_status_his losh on losh.logistics_order_id = lo.id
				 inner join xn_m_transport_charge tc on tc.id = lo.contract_price_id
				where losh.logistics_order_status  = '1121020'  and losh.status_type=1
							and  DATE_FORMAT( losh.create_time,'%Y-%m-%d')  = in_statistics_date
				group by  lo.principal_company_id ;

				/** 承运订单 执行中 数据 和 合同价格 **/
				DECLARE cur_order_execute_carry CURSOR FOR  
				 select lo.carry_company_id ,count(distinct lo.id) ,sum(tc.total_price)  
				 from  xn_m_logistics_order lo
				 inner join xn_m_logistics_order_status_his losh on losh.logistics_order_id = lo.id
				 inner join xn_m_transport_charge tc on tc.id = lo.contract_price_id
				where losh.logistics_order_status  = '1121020'  and losh.status_type=1
							and  DATE_FORMAT( losh.create_time,'%Y-%m-%d')  = in_statistics_date
				group by  lo.carry_company_id ;


				/** 委托订单 已完成 数据 和 合同价格 **/
				DECLARE cur_order_finished_principal  CURSOR FOR  
				 select lo.principal_company_id ,count(lo.id) ,sum(tc.total_price)  
				 from  xn_m_logistics_order lo 
				 inner join xn_m_logistics_order_status_his losh on losh.logistics_order_id = lo.id
				 inner join xn_m_transport_charge tc on tc.id = lo.contract_price_id
				where losh.logistics_order_status ='1121030' and losh.status_type=1
								and  DATE_FORMAT( losh.create_time,'%Y-%m-%d')  = in_statistics_date
				group by  lo.principal_company_id ;

				/** 承运订单 已完成 数据 和 合同价格 **/
				DECLARE cur_order_finished_carry CURSOR FOR  
				 select lo.carry_company_id ,count(lo.id) ,sum(tc.total_price)  
				 from  xn_m_logistics_order lo 
				 inner join xn_m_logistics_order_status_his losh on losh.logistics_order_id = lo.id
				 inner join xn_m_transport_charge tc on tc.id = lo.contract_price_id
				where losh.logistics_order_status ='1121030' and losh.status_type=1
								and  DATE_FORMAT( losh.create_time,'%Y-%m-%d')  = in_statistics_date
				group by  lo.carry_company_id ;
				
				/** 调度 车次待装运数量 承运**/
				DECLARE cur_dispatch_unexecuted_carry CURSOR FOR  
				select  
				 lo.carry_company_id , count(d.id)
				from xn_m_dispatch_batch db
				inner join xn_m_dispatch d on d.dispatch_batch_id = db.id
				inner join xn_m_dispatch_status_his dsh on dsh.dispatch_id = d.id and dsh.is_valid =1
				INNER JOIN xn_m_logistics_order  lo   on lo.id = d.logistics_order_id
				where dsh.dispatch_status ='1141000' and dsh.is_valid = '1'
						and  DATE_FORMAT( dsh.create_time,'%Y-%m-%d')  = in_statistics_date
				group by lo.carry_company_id ; 

				/** 调度 车次待装运数量 委托**/
				DECLARE cur_dispatch_unexecuted_principal CURSOR FOR  
				select  
				 lo.principal_company_id , count(d.id)
				from xn_m_dispatch_batch db
				inner join xn_m_dispatch d on d.dispatch_batch_id = db.id
				inner join xn_m_dispatch_status_his dsh on dsh.dispatch_id = d.id and dsh.is_valid =1
				INNER JOIN xn_m_logistics_order  lo   on lo.id = d.logistics_order_id
				where dsh.dispatch_status ='1141000' and dsh.is_valid = '1'
						and  DATE_FORMAT( dsh.create_time,'%Y-%m-%d')  = in_statistics_date
				group by lo.principal_company_id ; 

				/** 调度 车次在途数量 承运**/
				DECLARE cur_dispatch_loaded_carry CURSOR FOR  
				select  
				 lo.carry_company_id , count(d.id)
				from xn_m_dispatch_batch db
				inner join xn_m_dispatch d on d.dispatch_batch_id = db.id
				inner join xn_m_dispatch_status_his dsh on dsh.dispatch_id = d.id and dsh.is_valid =1
				INNER JOIN xn_m_logistics_order  lo   on lo.id = d.logistics_order_id
				where dsh.dispatch_status ='1141010' and dsh.is_valid = '1'
						and  DATE_FORMAT( dsh.create_time,'%Y-%m-%d')  = in_statistics_date
				group by lo.carry_company_id ; 

				/** 调度 车次在途数量 委托**/
				DECLARE cur_dispatch_loaded_principal CURSOR FOR  
				select  
				 lo.principal_company_id , count(d.id)
				from xn_m_dispatch_batch db
				inner join xn_m_dispatch d on d.dispatch_batch_id = db.id
				inner join xn_m_dispatch_status_his dsh on dsh.dispatch_id = d.id and dsh.is_valid =1
				INNER JOIN xn_m_logistics_order  lo   on lo.id = d.logistics_order_id
				where dsh.dispatch_status ='1141010' and dsh.is_valid = '1'
						and  DATE_FORMAT( dsh.create_time,'%Y-%m-%d')  = in_statistics_date
				group by lo.principal_company_id ; 

				/** 调度 车次已完结(已签收)数量 承运**/
				DECLARE cur_dispatch_signed_carry CURSOR FOR  
				select  
				 lo.carry_company_id , count(d.id)
				from xn_m_dispatch_batch db
				inner join xn_m_dispatch d on d.dispatch_batch_id = db.id
				inner join xn_m_dispatch_status_his dsh on dsh.dispatch_id = d.id and dsh.is_valid =1
				INNER JOIN xn_m_logistics_order  lo   on lo.id = d.logistics_order_id
				where dsh.dispatch_status in ('1141030' ,'1141050')  and dsh.is_valid = '1'
							and  DATE_FORMAT( dsh.create_time,'%Y-%m-%d')  = in_statistics_date
				group by lo.carry_company_id ;

				/** 调度 车次已完结(已签收)数量 委托**/
				DECLARE cur_dispatch_signed_principal CURSOR FOR  
				select  
				 lo.principal_company_id , count(d.id)
				from xn_m_dispatch_batch db
				inner join xn_m_dispatch d on d.dispatch_batch_id = db.id
				inner join xn_m_dispatch_status_his dsh on dsh.dispatch_id = d.id and dsh.is_valid =1
				INNER JOIN xn_m_logistics_order  lo   on lo.id = d.logistics_order_id
				where dsh.dispatch_status in ('1141030' ,'1141050')  and dsh.is_valid = '1'
							and  DATE_FORMAT( dsh.create_time,'%Y-%m-%d')  = in_statistics_date
				group by lo.principal_company_id ;   


				/** 调度 运输时长统计 承运**/
				DECLARE cur_dispatch_transport_hour_carry CURSOR FOR  
				select  
				 lo.carry_company_id , count(d.id),sum(TIMESTAMPDIFF(hour ,d.real_departure_date , d.signed_time ) )   
					from xn_m_dispatch d  
				inner join xn_m_dispatch_status_his dsh on dsh.dispatch_id = d.id and dsh.is_valid =1
				INNER JOIN xn_m_logistics_order  lo   on lo.id = d.logistics_order_id
				where dsh.dispatch_status =  '1141030' and dsh.is_valid = '1'
							and  DATE_FORMAT( dsh.create_time,'%Y-%m-%d')  = in_statistics_date
				group by lo.carry_company_id ;  

				/** 调度 运输时长统计 委托**/
				DECLARE cur_dispatch_transport_hour_principal CURSOR FOR  
				select  
				 lo.principal_company_id , count(d.id),sum(TIMESTAMPDIFF(hour ,d.real_departure_date , d.signed_time ) )   
					from xn_m_dispatch d  
				inner join xn_m_dispatch_status_his dsh on dsh.dispatch_id = d.id and dsh.is_valid =1
				INNER JOIN xn_m_logistics_order  lo   on lo.id = d.logistics_order_id
				where dsh.dispatch_status =  '1141030' and dsh.is_valid = '1'
							and  DATE_FORMAT( dsh.create_time,'%Y-%m-%d')  = in_statistics_date
				group by lo.principal_company_id ;  

			/** 调度  调度量 装运量 签收量 统计 承运**/
			DECLARE cur_dispatch_goods_measuring_carry CURSOR FOR  
				select  
