				, sum( if(lo.valuation_mode=1131000 ,gm.weight , null )) plan_sum_weight_ton
				, sum( if(lo.valuation_mode=1131020 ,gm.weight,null)  ) plan_sum_weight
				, sum( if(lo.valuation_mode=1131010 ,gm.volume ,null ) ) plan_sum_volume
				, sum( gm.quantity ) plan_sum_quantity
				, sum( if(lo.valuation_mode=1131000 ,gm2.weight ,null ) ) real_sum_weight_ton
				, sum( if(lo.valuation_mode=1131020 ,gm2.weight,null)   ) real_sum_weight
				, sum( if(lo.valuation_mode=1131010 ,gm2.volume ,null ) ) real_sum_volume
				, sum( gm2.quantity ) real_sum_quantity
				, sum( if(lo.valuation_mode=1131000 ,gm3.weight ,null ) ) signed_sum_weight_ton
