				inner join xn_m_goods_measuring gm on gm.id = dg.plan_dspt_goods_measure_id  
				inner join xn_m_goods_measuring gm2 on gm2.id = dg.real_dspt_goods_measure_id
				inner join xn_m_goods_measuring gm3 on gm3.id = dg.signed_goods_measure_id

				where dsh.dispatch_status  in ('1141000','1141010','1141030') 
						 and dsh.is_valid = '1' 
						 and  DATE_FORMAT( dsh.create_time,'%Y-%m-%d')  = in_statistics_date
				group by  lo.carry_company_id ; 


			/** 调度  调度量 装运量 签收量 统计 委托**/
