		INSERT INTO `xn_m_statistics`  (company_id,statistics_date,
				plan_dspt_weight_ton_total,plan_dspt_weight_total,plan_dspt_quantity_total,
				real_dspt_weight_ton_total,real_dspt_weight_total,real_dspt_quantity_total,
				signed_dspt_weight_ton_total,signed_dspt_weight_total,signed_dspt_quantity_total
					,batch_code,create_time,modify_time,is_delete , plan_dspt_volume_total , real_dspt_volume_total , signed_dspt_volume_total)
				VALUES( v_company_id,in_statistics_date,
									v_plan_sum_weight_ton,v_plan_sum_weight,v_plan_sum_quantity,
									v_real_sum_weight_ton,v_real_sum_weight,v_real_sum_quantity,
									v_signed_sum_weight_ton,v_signed_sum_weight,v_signed_sum_quantity
								,in_batch_code,v_curr_date,v_curr_date,0 , v_plan_sum_volume , v_real_sum_volume , v_signed_sum_volume);		
    end IF;
	-- 判断事物是否有误
		if error_falg = 1 then  
			set @res = -1;   
			rollback;  
			set error_falg = 0;

		-- 	INSERT INTO `xn_m_statistics_error`  (error_desc,status,creater)
		-- 		VALUES( v_error_desc,@res,v_curr_date);		
    
		ELSE
			commit;  
		end if;
		-- 判断事物是否有误 结束
    -- 业务逻辑
  END LOOP;
   -- 循环结束
  -- 关闭游标
  CLOSE cur_dispatch_goods_measuring_principal;

/********************************  结尾返回  *****************************************************/

  -- 结尾返回
	set @res =1 ;	
 -- 	 select res;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for calc_distance
-- ----------------------------
DROP FUNCTION IF EXISTS `calc_distance`;
DELIMITER ;;
CREATE  FUNCTION `calc_distance`(
in_long1 double,in_lat1 double,in_long2 double,in_lat2 double) RETURNS double
    SQL SECURITY INVOKER
BEGIN
        DECLARE Distance DOUBLE;

        DECLARE RadLatBegin DOUBLE;
        DECLARE RadLatEnd DOUBLE;
        DECLARE RadLatDiff DOUBLE;
        DECLARE RadLngDiff DOUBLE;

        DECLARE EARTH_RADIUS DOUBLE;
        SET EARTH_RADIUS = 6378.137;

        SET RadLatBegin = in_lat1 *PI()/ 180.0 ;
        SET RadLatEnd = in_lat2 *PI()/ 180.0 ;
        SET RadLatDiff = RadLatBegin - RadLatEnd;
        SET RadLngDiff = in_long1 *PI()/ 180.0 - in_long2 *PI()/ 180.0 ;
        SET DISTANCE = 2 *ASIN(
                   SQRT(
                       POWER(SIN(RadLatDiff / 2), 2)+COS(RadLatBegin)*COS(RadLatEnd)
                       *POWER(SIN(RadLngDiff / 2), 2)
                   )
               );
           
        SET Distance = Distance * EARTH_RADIUS;
				SET	Distance = Distance * 1000; 
    RETURN DISTANCE;
    END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getDiviParentFullNameLst
-- ----------------------------
DROP FUNCTION IF EXISTS `getDiviParentFullNameLst`;
DELIMITER ;;
CREATE  FUNCTION `getDiviParentFullNameLst`(
nodeId int(11)) RETURNS varchar(1000) CHARSET utf8
    SQL SECURITY INVOKER
BEGIN  
DECLARE sTemp VARCHAR(1000);  
DECLARE sName VARCHAR(1000);
DECLARE sTempChd VARCHAR(1000);  
SET sTemp = '$';  
SET sTempChd =cast(nodeId as CHAR);  
 WHILE sTempChd is not null DO  
  SET sTemp = concat(sTemp,',',sTempChd);  
     SELECT group_concat(parent_administration_division_id) INTO sTempChd FROM xn_m_administration_division where FIND_IN_SET(xn_m_administration_division.id,sTempChd)>0;  
  END WHILE; 
  
  SELECT group_concat(xn_m_administration_division.name) INTO sName FROM xn_m_administration_division where FIND_IN_SET(xn_m_administration_division.id,sTemp)>0;    
RETURN sName;  
END
;;
DELIMITER ;

