-- ----------------------------
-- Function structure for getPayment
-- ----------------------------
DROP FUNCTION IF EXISTS `getPayment`;
DELIMITER ;;
CREATE  FUNCTION `getPayment`(sTempOrderId varchar(100)) RETURNS double
BEGIN 
  DECLARE sTempPayment DOUBLE;
  SELECT
    CASE o.operate_type WHEN 2561030 THEN zbc.total_price
         ELSE dp.dispatchPay END payMoney INTO sTempPayment
		FROM xn_m_logistics_order o 
		LEFT JOIN xn_m_logistics_order op ON op.id=o.parent_logistics_order_id
		LEFT JOIN xn_m_transport_charge zbc ON zbc.id=o.settle_price_id
		LEFT JOIN (
			SELECT SUM(d.cost_price) dispatchPay,
				d.logistics_order_id orderId 
			FROM xn_m_dispatch d 
      inner join  xn_m_dispatch_status_his  dh on d.id = dh.dispatch_id and dispatch_status !='1141040' and dh.is_valid=1
			inner JOIN xn_m_logistics_order dlo ON dlo.id=d.logistics_order_id
			WHERE d.parent_dispatch_id IS NOT NULL
			AND (dlo.parent_logistics_order_id = sTempOrderId   
				OR (dlo.id = sTempOrderId  and dlo.parent_logistics_order_id IS NULL AND dlo.rht-dlo.lft=1)
			)
			AND IFNULL(dlo.is_delete,0)=0
			GROUP BY d.logistics_order_id
		) dp ON o.id= dp.orderId
		WHERE (o.parent_logistics_order_id = sTempOrderId 
			or (o.id = sTempOrderId  AND o.parent_logistics_order_id is NULL AND o.rht-o.lft=1 )
		)
			AND IFNULL(o.is_delete,0)=0;
	RETURN sTempPayment;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getRealWeightOrVolumeOrQuatity
-- ----------------------------
DROP FUNCTION IF EXISTS `getRealWeightOrVolumeOrQuatity`;
DELIMITER ;;
CREATE  FUNCTION `getRealWeightOrVolumeOrQuatity`(sTempRootOrderId varchar(100),sTemplft int(11),sTemprht int(11),sTempCityCode int(20),sTempAddress varchar(50),sTempGoodsID varchar(50),sTempMark varchar(10)) RETURNS varchar(500) CHARSET utf8
BEGIN 
  DECLARE sTempResult VARCHAR(500);
  SELECT
      CASE sTempMark 
           WHEN 'quantity' THEN SUM(rgm.quantity)
				   WHEN 'weight' THEN SUM(rgm.weight)
				   WHEN 'volume' THEN SUM(rgm.volume)
      END result INTO sTempResult
				FROM xn_m_logistics_order t 
				LEFT JOIN xn_m_address sa ON sa.id=t.send_address_id
				LEFT JOIN xn_r_logistics_order_goods og ON og.logistics_order_id=t.id
				LEFT JOIN xn_m_goods_measuring rgm on og.real_dspt_goods_measure_id=rgm.id  
				WHERE t.root_order_id = sTempRootOrderId
					AND t.lft>=sTemplft and t.rht<=sTemprht AND t.rht-1=t.lft
					AND IFNULL(t.is_delete,0)=0
					AND sa.administrator_division_id = sTempCityCode
					AND sa.street_name = sTempAddress
					AND og.goods_id = sTempGoodsID
				group by t.id;
	RETURN sTempResult;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getSignedWeightOrVolumeOrQuatity
-- ----------------------------
DROP FUNCTION IF EXISTS `getSignedWeightOrVolumeOrQuatity`;
DELIMITER ;;
CREATE  FUNCTION `getSignedWeightOrVolumeOrQuatity`(sTempRootOrderId varchar(100),sTemplft int(11),sTemprht int(11),sTempCityCode int(20),sTempAddress varchar(50),sTempGoodsID varchar(50),sTempMark varchar(10)) RETURNS varchar(500) CHARSET utf8
BEGIN 
  DECLARE sTempResult VARCHAR(500);
  select 
			CASE sTempMark 
           WHEN 'quantity' THEN SUM(sgm.quantity)
				   WHEN 'weight' THEN SUM(sgm.weight)
				   WHEN 'volume' THEN SUM(sgm.volume)
      END result INTO sTempResult
				FROM xn_m_logistics_order t
				LEFT JOIN xn_m_address ra ON ra.id=t.receive_address_id
				LEFT JOIN xn_r_logistics_order_goods og ON og.logistics_order_id=t.id
				LEFT JOIN xn_m_goods_measuring sgm on og.signed_goods_measuring_id=sgm.id   
				WHERE t.root_order_id = sTempRootOrderId
					AND t.lft>=sTemplft and t.rht<=sTemprht AND t.rht-1=t.lft
					AND IFNULL(t.is_delete,0)=0
					AND ra.administrator_division_id = sTempCityCode
					AND ra.street_name = sTempAddress
					AND og.goods_id = sTempGoodsID
				group by t.id;
	RETURN sTempResult;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getTripSerial
-- ----------------------------
DROP FUNCTION IF EXISTS `getTripSerial`;
DELIMITER ;;
CREATE  FUNCTION `getTripSerial`(sTempIds varchar(1000)) RETURNS int(11)
BEGIN 
  DECLARE sTempCount INT;
	SELECT COUNT(*) INTO sTempCount from xn_m_dispatch xmd WHERE xmd.logistics_order_id in (SELECT lo.id
	 	From xn_m_logistics_order lo
		LEFT JOIN xn_m_logistics_order ro ON ro.root_order_id=lo.root_order_id AND lo.lft>=ro.lft and lo.rht <=ro.rht 
		WHERE
			INSTR(sTempIds,ro.id) > 0
			AND lo.rht-lo.lft=1 AND IFNULL(lo.is_delete,0)=0) AND xmd.parent_dispatch_id is not NULL;
	RETURN sTempCount;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getVehicleCodes
-- ----------------------------
DROP FUNCTION IF EXISTS `getVehicleCodes`;
DELIMITER ;;
CREATE  FUNCTION `getVehicleCodes`(sTempRootOrderId varchar(100),sTemplft int(11),sTemprht int(11)) RETURNS varchar(500) CHARSET utf8
BEGIN 
  DECLARE sTempVehicleCodes VARCHAR(500);
  select GROUP_CONCAT(t4.vehicle_code) INTO sTempVehicleCodes
			from xn_m_logistics_order t1
			left join xn_m_dispatch t2 on t1.id = t2.logistics_order_id
			left join xn_m_dispatch_batch t3 on t2.dispatch_batch_id = t3.id
			left join xn_m_vehicles t4 on t3.vehicles_id = t4.id
			left join xn_m_dispatch_status_his t5 on t2.id = t5.dispatch_id
			where t5.is_valid = 1
				and t5.dispatch_status != 1141040
				AND t1.root_order_id = sTempRootOrderId
				AND t1.lft>=sTemplft  
				AND t1.rht<=sTemprht
				AND t1.rht-1=t1.lft;
	RETURN sTempVehicleCodes;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for sequence_nextval
-- ----------------------------
DROP FUNCTION IF EXISTS `sequence_nextval`;
DELIMITER ;;
CREATE  FUNCTION `sequence_nextval`(
seq_name varchar(100),company_id char(22),document_type bigint(20)) RETURNS varchar(100) CHARSET utf8
    SQL SECURITY INVOKER
BEGIN  
    DECLARE step_value INTEGER;
    DECLARE temp_curr_date datetime;  
    DECLARE current_value INTEGER;
    DECLARE return_value varchar(50);
		
		-- 规则id
		DECLARE ruleId CHAR(22);
		-- code_rule 数据字典
		DECLARE code_rule_id BIGINT(20);
		-- 2521010 固定文本
		DECLARE fixed_text VARCHAR(200);
		-- 2521011 日期格式
		DECLARE date_rule_id BIGINT(20);
		-- 2521012 流水号
		DECLARE serial_number_rule_id BIGINT(20);
		DECLARE serial_number_length BIGINT(20);
		DECLARE restart_val BIGINT(20);
		DECLARE curr_val BIGINT(200);
		DECLARE curr_date datetime;
		-- 定义游标的结束标志
		DECLARE done INT DEFAULT FALSE;

		DECLARE is_set_rule INT DEFAULT FALSE;

		DECLARE cur_code_rule CURSOR FOR SELECT dcr.id ruleId,dcr.code_rule_id,dcr.fixed_text,
		dcr.date_rule_id,dcr.serial_number_length,dcr.serial_number_rule_id,
		dcr.restart_val,dcr.curr_val,dcr.curr_date
		FROM xn_m_document_code_rule dcr 
		WHERE dcr.document_type=document_type AND dcr.company_id=company_id 
		ORDER BY dcr.order_no ASC ;  

		-- 将结束标志绑定到游标
		DECLARE CONTINUE HANDLER FOR NOT FOUND  SET done = TRUE;
		
		SET temp_curr_date = date(now());
		
		IF company_id IS NOT NULL AND document_type IS NOT NULL THEN
			
			SET return_value='';
			SET done = false;
			OPEN cur_code_rule;
				-- 开始循环
				read_loop: LOOP
					-- 提取游标里的数据；
					FETCH cur_code_rule INTO ruleId,code_rule_id,fixed_text,date_rule_id,serial_number_length,serial_number_rule_id,restart_val,curr_val,curr_date;
					
					-- 声明结束的时候
					IF done THEN
						LEAVE read_loop;
					END IF;	
	
					set is_set_rule=TRUE;
					-- 固定文本 --
					IF code_rule_id=2521010 THEN
						SET return_value = concat(return_value,fixed_text);
					ELSEIF code_rule_id=2521011  THEN
						IF date_rule_id=2521020 THEN
							SET return_value = concat(return_value,DATE_FORMAT(temp_curr_date,'%Y%m%d'));
						ELSEIF date_rule_id=2521021 THEN 
							SET return_value = concat(return_value,DATE_FORMAT(temp_curr_date,'%Y%m'));
						ELSEIF date_rule_id=2521022 THEN 
							SET return_value = concat(return_value,DATE_FORMAT(temp_curr_date,'%y%m%d'));
						ELSEIF date_rule_id=2521023 THEN 
							SET return_value = concat(return_value,DATE_FORMAT(temp_curr_date,'%y%m'));
						ELSEIF date_rule_id=2521024 THEN 
							SET return_value = concat(return_value,DATE_FORMAT(temp_curr_date,'%y'));
						ELSEIF date_rule_id=2521025 THEN 
							SET return_value = concat(return_value,DATE_FORMAT(temp_curr_date,'%Y'));
						END IF;

					ELSEIF code_rule_id=2521012  THEN	
							SELECT (IFNULL(`curr_val`,`restart_val`)+1),`restart_val` INTO curr_val,restart_val FROM xn_m_document_code_rule WHERE `id`=ruleId FOR UPDATE;
							-- 按年重新设置
							IF serial_number_rule_id=2521030 THEN 
								IF curr_date IS NULL OR DATE_FORMAT(temp_curr_date,'%Y')>DATE_FORMAT(curr_date,'%Y') THEN
									SET curr_val=restart_val;
								END IF;
							-- 按月重新设置
							ELSEIF serial_number_rule_id=2521031 THEN 
								
								IF curr_date IS NULL OR DATE_FORMAT(temp_curr_date,'%Y%m')>DATE_FORMAT(curr_date,'%Y%m') THEN
									SET curr_val=restart_val;
								END IF;
							-- 按天重新设置
							ELSEIF serial_number_rule_id=2521032 THEN 
								IF curr_date IS NULL OR DATE_FORMAT(temp_curr_date,'%Y%m%d')>DATE_FORMAT(curr_date,'%Y%m%d') THEN
									SET curr_val=restart_val;
								END IF;
							END IF;
						
							SET return_value = concat(return_value,lpad(curr_val,serial_number_length,0));
							UPDATE `xn_m_document_code_rule` SET `curr_val`=curr_val,`curr_date`=date(now()) WHERE `id`=ruleId; 
					END IF;
				END LOOP;
				-- 循环结束
			CLOSE cur_code_rule;
			
		END IF;
		
		IF !is_set_rule THEN
			SELECT (curr_value+step),curr_date ,step INTO current_value,temp_curr_date,step_value
			from xn_m_squence
			WHERE `name` = seq_name for UPDATE;

			IF datediff(date(now()),temp_curr_date) >0 THEN
				set current_value = step_value;
				update xn_m_squence
					SET curr_value = step_value,
							curr_date = date(now())
				where `name` = seq_name;
			ELSE
				update xn_m_squence
						SET curr_value = current_value
				where `name` = seq_name;
			END IF;
			SET return_value = concat(date_format(now(),'%Y%m%d'),lpad(current_value,6,0));
		END IF;
    
    
		RETURN return_value;
END
;;
DELIMITER ;
